Property.Value:
BEGIN
    IF @BinaryReal IS NULL
        RETURN NULL;

    DECLARE @IntVal INT = CAST(@BinaryReal AS INT);
    DECLARE @Sign REAL = CASE WHEN (@IntVal & 0x80000000) = 0 THEN 1.0 ELSE -1.0 END;
    DECLARE @Exponent INT = ((@IntVal & 0x7F800000) / 0x00800000) - 127;
    DECLARE @Mantissa INT = (@IntVal & 0x007FFFFF);

    RETURN @Sign * (1.0 + CAST(@Mantissa AS REAL) * POWER(CAST(2 AS REAL), -23)) * POWER(CAST(2 AS REAL), @Exponent);
END;

BEGIN
    IF @Waveform IS NULL OR @Waveform.STGeometryType() <> 'LINESTRING'
        RETURN 0;

    DECLARE @PointCount INT = @Waveform.STNumPoints();
    DECLARE @SumSquares FLOAT = 0;
    DECLARE @PointIndex INT = 1;
    DECLARE @Amplitude FLOAT;

    WHILE @PointIndex <= @PointCount
    BEGIN
        -- Y coordinate is amplitude - must cast to float
        SET @Amplitude = CAST(@Waveform.STPointN(@PointIndex).STY AS FLOAT);
        SET @SumSquares = @SumSquares + (@Amplitude * @Amplitude);
        SET @PointIndex = @PointIndex + 1;
    END

    RETURN SQRT(@SumSquares / @PointCount);
END;

CREATE FUNCTION dbo.fn_ComputeSpatialBucket (
    @X FLOAT,
    @Y FLOAT,
    @Z FLOAT
)
RETURNS BIGINT
AS

BEGIN
    DECLARE @result GEOMETRY;

    IF @z IS NULL
        SET @result = geometry::STGeomFromText('POINT(' + CAST(@x AS NVARCHAR(50)) + ' ' + CAST(@y AS NVARCHAR(50)) + ')', 0);
    ELSE
        SET @result = geometry::STGeomFromText('POINT(' + CAST(@x AS NVARCHAR(50)) + ' ' + CAST(@y AS NVARCHAR(50)) + ' ' + CAST(@z AS NVARCHAR(50)) + ')', 0);

    RETURN @result;
END;

