CREATE FUNCTION dbo.fn_VectorCosineSimilarity(
    @vec1 VECTOR(1998),
    @vec2 VECTOR(1998)
)
RETURNS FLOAT
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @ConversationHandle UNIQUEIDENTIFIER;
    DECLARE @MessageBody XML;
    DECLARE @MessageTypeName NVARCHAR(256);
    DECLARE @HypothesesJson NVARCHAR(MAX);
    DECLARE @ExecutionResults NVARCHAR(MAX);

    BEGIN TRY
        -- 1. RECEIVE MESSAGE FROM HYPOTHESIZE PHASE
        WAITFOR (
            RECEIVE TOP(1)
                @ConversationHandle = conversation_handle,
                @MessageBody = CAST(message_body AS XML),
                @MessageTypeName = message_type_name
            FROM ActQueue
        ), TIMEOUT 5000; -- 5 second timeout

        IF @ConversationHandle IS NULL
        BEGIN
            PRINT 'sp_Act: No messages received';
            RETURN 0;
        END

        -- 2. PARSE HYPOTHESES
        SET @HypothesesJson = CAST(@MessageBody AS NVARCHAR(MAX));

        DECLARE @AnalysisId UNIQUEIDENTIFIER = JSON_VALUE(@HypothesesJson, '$.analysisId');
        DECLARE @HypothesesCount INT = JSON_VALUE(@HypothesesJson, '$.hypothesesGenerated');

        -- 3. EXECUTE ACTIONS FOR EACH HYPOTHESIS
        DECLARE @ActionResults TABLE (
            HypothesisId UNIQUEIDENTIFIER,
            HypothesisType NVARCHAR(50),
            ActionStatus NVARCHAR(50),
            ExecutedActions NVARCHAR(MAX),
            ExecutionTimeMs INT,
            ErrorMessage NVARCHAR(MAX)
        );

        DECLARE @Hypotheses TABLE (
            HypothesisId UNIQUEIDENTIFIER,
            HypothesisType NVARCHAR(50),
            Priority INT,
            Description NVARCHAR(MAX),
            RequiredActions NVARCHAR(MAX)
        );

        INSERT INTO @Hypotheses
        SELECT 
            HypothesisId,
            HypothesisType,
            Priority,
            Description,
            RequiredActions
        FROM OPENJSON(@HypothesesJson, '$.hypotheses')
        WITH (
            HypothesisId UNIQUEIDENTIFIER,
            HypothesisType NVARCHAR(50),
            Priority INT,
            Description NVARCHAR(MAX),
            RequiredActions NVARCHAR(MAX) AS JSON
        );

        -- 4. PROCESS EACH HYPOTHESIS
        DECLARE @CurrentHypothesisId UNIQUEIDENTIFIER;
        DECLARE @CurrentType NVARCHAR(50);
        DECLARE @CurrentPriority INT;
        DECLARE @CurrentActions NVARCHAR(MAX);
        DECLARE @StartTime DATETIME2;
        DECLARE @ExecutionTimeMs INT;
        DECLARE @ActionStatus NVARCHAR(50);
        DECLARE @ExecutedActionsList NVARCHAR(MAX);
        DECLARE @ActionError NVARCHAR(MAX);

        DECLARE hypothesis_cursor CURSOR FOR
        SELECT HypothesisId, HypothesisType, Priority, RequiredActions
        FROM @Hypotheses
        ORDER BY Priority;

        OPEN hypothesis_cursor;
        FETCH NEXT FROM hypothesis_cursor INTO @CurrentHypothesisId, @CurrentType, @CurrentPriority, @CurrentActions;

        -- GDEL ENGINE: Check for compute job messages first
        -- This is where the CLR compute function is invoked
        DECLARE @PrimeSearchJobId UNIQUEIDENTIFIER = @MessageBody.value('(/Action/PrimeSearch/JobId)[1]', 'uniqueidentifier');

        IF @PrimeSearchJobId IS NOT NULL
        BEGIN
            DECLARE @Start BIGINT = @MessageBody.value('(/Action/PrimeSearch/RangeStart)[1]', 'bigint');
            DECLARE @End BIGINT = @MessageBody.value('(/Action/PrimeSearch/RangeEnd)[1]', 'bigint');

            PRINT 'sp_Act: Executing prime search for range [' + CAST(@Start AS NVARCHAR(20)) + ', ' + CAST(@End AS NVARCHAR(20)) + ']';

            -- Call the CLR function to find primes in this chunk
            DECLARE @ResultJson NVARCHAR(MAX);
            SET @ResultJson = dbo.clr_FindPrimes(@Start, @End);

            PRINT 'sp_Act: Found primes: ' + @ResultJson;

            -- Send results to Learn phase
            DECLARE @LearnPayload XML = (
                SELECT 
                    @PrimeSearchJobId AS JobId,
                    @End AS LastChecked,
                    @ResultJson AS PrimesFound
                FOR XML PATH('PrimeResult'), ROOT('Learn')
            );

            DECLARE @LearnHandle UNIQUEIDENTIFIER;

            BEGIN DIALOG CONVERSATION @LearnHandle
                FROM SERVICE ActService
                TO SERVICE 'LearnService'
                ON CONTRACT [//Hartonomous/AutonomousLoop/LearnContract]
                WITH ENCRYPTION = OFF;

            SEND ON CONVERSATION @LearnHandle
                MESSAGE TYPE [//Hartonomous/AutonomousLoop/LearnMessage]
                (@LearnPayload);

            END CONVERSATION @ConversationHandle;

            PRINT 'sp_Act: Compute job results sent to Learn phase.';
            RETURN 0;
        END

        -- REGULAR OODA LOOP: Process performance improvement hypotheses
        WHILE @@FETCH_STATUS = 0
        BEGIN
            SET @StartTime = SYSUTCDATETIME();
            SET @ActionStatus = 'Pending';
            SET @ExecutedActionsList = NULL;
            SET @ActionError = NULL;

            BEGIN TRY
                -- INDEX OPTIMIZATION: Safe, auto-approve
                IF @CurrentType = 'IndexOptimization'
                BEGIN
                    -- Analyze missing indexes
                    DECLARE @MissingIndexes TABLE (
                        TableName NVARCHAR(256),
                        IndexColumns NVARCHAR(MAX),
                        IncludedColumns NVARCHAR(MAX),
                        ImpactScore FLOAT
                    );

                    -- Get missing index recommendations
                    INSERT INTO @MissingIndexes
                    SELECT TOP 5
                        OBJECT_NAME(mid.object_id) AS TableName,
                        mid.equality_columns + ISNULL(', ' + mid.inequality_columns, '') AS IndexColumns,
                        mid.included_columns AS IncludedColumns,
                        migs.avg_total_user_cost * migs.avg_user_impact * (migs.user_seeks + migs.user_scans) AS ImpactScore
                    FROM sys.dm_db_missing_index_details mid
                    INNER JOIN sys.dm_db_missing_index_groups mig ON mig.index_handle = mid.index_handle
                    INNER JOIN sys.dm_db_missing_index_group_stats migs ON migs.group_handle = mig.index_group_handle
                    WHERE mid.database_id = DB_ID()
                    ORDER BY ImpactScore DESC;

                    -- Update statistics on key tables
                    UPDATE STATISTICS dbo.Atoms WITH FULLSCAN;
                    UPDATE STATISTICS dbo.AtomEmbeddings WITH FULLSCAN;
                    UPDATE STATISTICS dbo.InferenceRequests WITH FULLSCAN;

                    SET @ExecutedActionsList = (
                        SELECT TableName, IndexColumns, ImpactScore
                        FROM @MissingIndexes
                        FOR JSON PATH
                    );
                    SET @ActionStatus = 'Executed';
                END

                -- QUERY REGRESSION FIX: Force last good execution plan via Query Store
                ELSE IF @CurrentType = 'QueryRegression'
                BEGIN
                    -- Parse query regression recommendations from sp_Analyze observations
                    DECLARE @RecommendationsJson NVARCHAR(MAX) = JSON_QUERY(@CurrentActions, '$.queryStoreRecommendations');
                    DECLARE @ForcedPlansCount INT = 0;

                    IF @RecommendationsJson IS NOT NULL
                    BEGIN
                        DECLARE @QueryId BIGINT;
                        DECLARE @RecommendedPlanId BIGINT;
                        DECLARE @ForceScript NVARCHAR(MAX);

                        DECLARE plan_cursor CURSOR FOR
                        SELECT 
                            TRY_CAST(JSON_VALUE(value, '$.QueryId') AS BIGINT),
                            TRY_CAST(JSON_VALUE(value, '$.RecommendedPlanId') AS BIGINT),
                            JSON_VALUE(value, '$.ForceScript')
                        FROM OPENJSON(@RecommendationsJson);

                        OPEN plan_cursor;
                        FETCH NEXT FROM plan_cursor INTO @QueryId, @RecommendedPlanId, @ForceScript;

                        WHILE @@FETCH_STATUS = 0
                        BEGIN
                            BEGIN TRY
                                -- Force recommended plan via sp_query_store_force_plan
                                IF @QueryId IS NOT NULL AND @RecommendedPlanId IS NOT NULL
                                BEGIN
                                    EXEC sp_query_store_force_plan @QueryId, @RecommendedPlanId;
                                    SET @ForcedPlansCount = @ForcedPlansCount + 1;
                                END
                            END TRY
                            BEGIN CATCH
                                -- Log error but continue processing other plans
                                PRINT 'Failed to force plan ' + CAST(@RecommendedPlanId AS NVARCHAR(20)) + ' for query ' + CAST(@QueryId AS NVARCHAR(20)) + ': ' + ERROR_MESSAGE();
                            END CATCH

                            FETCH NEXT FROM plan_cursor INTO @QueryId, @RecommendedPlanId, @ForceScript;
                        END

                        CLOSE plan_cursor;
                        DEALLOCATE plan_cursor;
                    END

                    SET @ExecutedActionsList = (SELECT @ForcedPlansCount AS forcedPlans FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
                    SET @ActionStatus = 'Executed';
                END

                -- CACHE WARMING: Safe, auto-approve
                ELSE IF @CurrentType = 'CacheWarming'
                BEGIN
                    -- Preload frequent embeddings into buffer pool
                    DECLARE @PreloadedCount INT = 0;

                    SELECT @PreloadedCount = COUNT(*)
                    FROM (SELECT TOP 1000 CacheId 
                          FROM dbo.InferenceCache WITH (NOLOCK)
                          WHERE LastAccessedUtc >= DATEADD(DAY, -7, SYSUTCDATETIME())
                          ORDER BY LastAccessedUtc DESC) AS FrequentCache;

                    SET @ExecutedActionsList = (SELECT @PreloadedCount AS preloadedEmbeddings FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
                    SET @ActionStatus = 'Executed';
                END

                -- CONCEPT DISCOVERY: Safe, run clustering
                ELSE IF @CurrentType = 'ConceptDiscovery'
                BEGIN
                    -- Trigger concept discovery (placeholder - actual CLR function to be implemented)
                    DECLARE @DiscoveredConcepts INT = 0;

                    -- For now, just detect clusters via Hilbert curve buckets (21-bit precision = 2M buckets)
                    SELECT @DiscoveredConcepts = COUNT(DISTINCT (HilbertValue / 1024))  -- Group into ~2K clusters
                    FROM dbo.AtomEmbeddings
                    WHERE CreatedAt >= DATEADD(DAY, -7, SYSUTCDATETIME())
                      AND HilbertValue IS NOT NULL;

                    SET @ExecutedActionsList = (SELECT @DiscoveredConcepts AS discoveredClusters FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
                    SET @ActionStatus = 'Executed';
                END

                -- MODEL RETRAINING: DANGEROUS, queue for approval
                ELSE IF @CurrentType = 'ModelRetraining'
                BEGIN
                    -- Insert into approval queue (table to be created)
                    -- For now, just log the request
                    SET @ExecutedActionsList = (SELECT 'QueuedForApproval' AS status, 'ModelRetraining requires manual approval' AS reason FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
                    SET @ActionStatus = 'QueuedForApproval';
                END

                ELSE
                BEGIN
                    SET @ExecutedActionsList = (SELECT 'Skipped' AS status, 'Unknown hypothesis type' AS reason FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
                    SET @ActionStatus = 'Skipped';
                END

            END TRY
            BEGIN CATCH
                SET @ActionError = ERROR_MESSAGE();
                SET @ActionStatus = 'Failed';
                SET @ExecutedActionsList = (SELECT @ActionError AS error FOR JSON PATH, WITHOUT_ARRAY_WRAPPER);
            END CATCH

            SET @ExecutionTimeMs = DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME());

            INSERT INTO @ActionResults
            VALUES (@CurrentHypothesisId, @CurrentType, @ActionStatus, @ExecutedActionsList, @ExecutionTimeMs, @ActionError);

            FETCH NEXT FROM hypothesis_cursor INTO @CurrentHypothesisId, @CurrentType, @CurrentPriority, @CurrentActions;
        END

        CLOSE hypothesis_cursor;
        DEALLOCATE hypothesis_cursor;

        -- 5. COMPILE EXECUTION RESULTS
        SELECT @ExecutionResults = (
            SELECT 
                HypothesisId,
                HypothesisType,
                ActionStatus,
                JSON_QUERY(ExecutedActions) AS ExecutedActions,
                ExecutionTimeMs,
                ErrorMessage
            FROM @ActionResults
            FOR JSON PATH
        );

        DECLARE @ExecutedCount INT, @QueuedCount INT, @FailedCount INT;
        SELECT @ExecutedCount = COUNT(*) FROM @ActionResults WHERE ActionStatus = 'Executed';
        SELECT @QueuedCount = COUNT(*) FROM @ActionResults WHERE ActionStatus = 'QueuedForApproval';
        SELECT @FailedCount = COUNT(*) FROM @ActionResults WHERE ActionStatus = 'Failed';

        DECLARE @ActPayload NVARCHAR(MAX) = (
            SELECT 
                @AnalysisId AS analysisId,
                JSON_QUERY(@HypothesesJson) AS originalHypothesisPayload,
                @ExecutedCount AS executedActions,
                @QueuedCount AS queuedActions,
                @FailedCount AS failedActions,
                JSON_QUERY(@ExecutionResults) AS results,
                FORMAT(SYSUTCDATETIME(), 'yyyy-MM-ddTHH:mm:ss.fffZ') AS timestamp
            FOR JSON PATH, WITHOUT_ARRAY_WRAPPER
        );

        -- 6. SEND TO LEARN QUEUE
        DECLARE @LearnConversationHandle UNIQUEIDENTIFIER;
        DECLARE @LearnMessageBody XML = CAST(@ActPayload AS XML);

        BEGIN DIALOG CONVERSATION @LearnConversationHandle
            FROM SERVICE ActService
            TO SERVICE 'LearnService'
            ON CONTRACT [//Hartonomous/AutonomousLoop/LearnContract]
            WITH ENCRYPTION = OFF;

        SEND ON CONVERSATION @LearnConversationHandle
            MESSAGE TYPE [//Hartonomous/AutonomousLoop/LearnMessage]
            (@LearnMessageBody);

        -- 7. END ORIGINAL CONVERSATION
        END CONVERSATION @ConversationHandle;

        DECLARE @ExecutedActionsCount INT;
        SELECT @ExecutedActionsCount = COUNT(*) FROM @ActionResults WHERE ActionStatus = 'Executed';
        PRINT 'sp_Act completed: ' + CAST(@ExecutedActionsCount AS VARCHAR(10)) + ' actions executed';
        PRINT 'Execution Results: ' + @ExecutionResults;

        RETURN 0;
    END TRY
    BEGIN CATCH
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        DECLARE @ErrorSeverity INT = ERROR_SEVERITY();
        DECLARE @ErrorState INT = ERROR_STATE();

        IF @ConversationHandle IS NOT NULL
        BEGIN
            END CONVERSATION @ConversationHandle WITH ERROR = 1 DESCRIPTION = @ErrorMessage;
        END

        PRINT 'sp_Act ERROR: ' + @ErrorMessage;
        RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState);
        RETURN -1;
    END CATCH
END;

BEGIN SET NOCOUNT ON;
DECLARE @AnalysisId UNIQUEIDENTIFIER = NEWID(); DECLARE @StartTime DATETIME2 = SYSUTCDATETIME(); DECLARE @Observations NVARCHAR(MAX); DECLARE @Anomalies NVARCHAR(MAX); DECLARE @Patterns NVARCHAR(MAX);
BEGIN TRY -- GDEL ENGINE: Check for autonomous compute job messages (bypass performance analysis) -- This allows the OODA loop to process abstract computational tasks (prime search, proofs, etc.) DECLARE @ConversationHandle UNIQUEIDENTIFIER; DECLARE @MessageBody XML; DECLARE @MessageTypeName NVARCHAR(256);
-- Try to receive a message (non-blocking check) RECEIVE TOP(1) @ConversationHandle = conversation_handle, @MessageBody = CAST(message_body AS XML), @MessageTypeName = message_type_name FROM AnalyzeQueue;
-- If we received a compute job request, route it directly to Hypothesize IF @MessageBody IS NOT NULL BEGIN DECLARE @JobId UNIQUEIDENTIFIER = @MessageBody.value('(/JobRequest/JobId)[1]', 'uniqueidentifier');
IF @JobId IS NOT NULL BEGIN -- This is a compute job request, not a performance analysis trigger PRINT 'sp_Analyze: Detected compute job request for JobId: ' + CAST(@JobId AS NVARCHAR(36));
DECLARE @HypothesisPayload XML = ( SELECT @JobId AS JobId FOR XML PATH('ComputeJob'), ROOT('Hypothesis') );
DECLARE @HypothesizeHandle UNIQUEIDENTIFIER;
BEGIN DIALOG CONVERSATION @HypothesizeHandle FROM SERVICE AnalyzeService TO SERVICE 'HypothesizeService' ON CONTRACT [//Hartonomous/AutonomousLoop/HypothesizeContract] WITH ENCRYPTION = OFF;
SEND ON CONVERSATION @HypothesizeHandle MESSAGE TYPE [//Hartonomous/AutonomousLoop/HypothesizeMessage] (@HypothesisPayload);
END CONVERSATION @ConversationHandle;
PRINT 'sp_Analyze: Compute job routed to Hypothesize phase.'; RETURN 0; END END
-- REGULAR OODA LOOP: Continue with standard performance analysis -- 1. QUERY RECENT INFERENCE ACTIVITY WITH EMBEDDINGS DECLARE @RecentInferences TABLE ( InferenceRequestId BIGINT, ModelId INT, RequestedAt DATETIME2, CompletedAt DATETIME2, DurationMs INT, TokenCount INT, PerformanceVector VECTOR(1998) );
INSERT INTO @RecentInferences SELECT TOP 1000 ir.InferenceId AS InferenceRequestId, CAST(JSON_VALUE(ir.ModelsUsed, '$[0].ModelId') AS INT) AS ModelId, ir.RequestTimestamp AS RequestedAt, DATEADD(MILLISECOND, ISNULL(ir.TotalDurationMs, 0), ir.RequestTimestamp) AS CompletedAt, ISNULL(ir.TotalDurationMs, 0) AS DurationMs, -- Estimate token count: ~4 chars per token for English text (LEN(CAST(ir.InputData AS NVARCHAR(MAX))) + LEN(CAST(ir.OutputData AS NVARCHAR(MAX)))) / 4 AS TokenCount, -- Create performance vector for anomaly detection -- [duration_normalized, tokens_normalized, hour_of_day, day_of_week, ...] CAST(NULL AS VECTOR(1998)) -- Placeholder, would compute actual vector FROM dbo.InferenceRequests ir WHERE ir.RequestTimestamp >= DATEADD(HOUR, -@LookbackHours, SYSUTCDATETIME()) AND ir.Status IN ('Completed', 'Failed') ORDER BY ir.RequestTimestamp DESC;
-- 2. PARADIGM-COMPLIANT: DETECT PERFORMANCE ANOMALIES USING ISOLATION FOREST -- Replace simple AVG() comparison with advanced CLR aggregate DECLARE @AvgDurationMs FLOAT; DECLARE @IsolationForestScores NVARCHAR(MAX); DECLARE @LOFScores NVARCHAR(MAX);
SELECT @AvgDurationMs = AVG(CAST(DurationMs AS FLOAT)) FROM @RecentInferences WHERE DurationMs > 0;
-- Build performance metrics as JSON vectors for anomaly detection DECLARE @PerformanceMetrics TABLE ( InferenceRequestId BIGINT, ModelId INT, DurationMs INT, MetricVector NVARCHAR(MAX) -- JSON array of normalized metrics );
INSERT INTO @PerformanceMetrics SELECT InferenceRequestId, ModelId, DurationMs, -- Create metric vector: [duration_norm, tokens_norm, time_features...] '[' + CAST((DurationMs / NULLIF(@AvgDurationMs, 0)) AS NVARCHAR(20)) + ',' + CAST((TokenCount / 1000.0) AS NVARCHAR(20)) + ',' + CAST(DATEPART(HOUR, RequestedAt) / 24.0 AS NVARCHAR(20)) + ',' + CAST(DATEPART(WEEKDAY, RequestedAt) / 7.0 AS NVARCHAR(20)) + ']' AS MetricVector FROM @RecentInferences;
-- PARADIGM-COMPLIANT: Use IsolationForestScore aggregate instead of simple threshold SELECT @IsolationForestScores = dbo.IsolationForestScore(MetricVector) FROM @PerformanceMetrics;
-- PARADIGM-COMPLIANT: Use LocalOutlierFactor for density-based detection SELECT @LOFScores = dbo.LocalOutlierFactor( MetricVector, 5 -- k neighbors ) FROM @PerformanceMetrics;
-- Parse scores and identify anomalies (scores > 0.7 for IsolationForest, > 1.5 for LOF) DECLARE @IsolationThreshold FLOAT = 0.7; DECLARE @LOFThreshold FLOAT = 1.5;
WITH IsolationScores AS ( SELECT pm.InferenceRequestId, pm.ModelId, pm.DurationMs, @AvgDurationMs AS AvgDurationMs, TRY_CAST(value AS FLOAT) AS IsolationScore, ROW_NUMBER() OVER (ORDER BY pm.InferenceRequestId) AS RowNum FROM @PerformanceMetrics pm CROSS APPLY OPENJSON(@IsolationForestScores) ), LOFScoresParsed AS ( SELECT pm.InferenceRequestId, TRY_CAST(value AS FLOAT) AS LOFScore, ROW_NUMBER() OVER (ORDER BY pm.InferenceRequestId) AS RowNum FROM @PerformanceMetrics pm CROSS APPLY OPENJSON(@LOFScores) ), CombinedScores AS ( SELECT iso.InferenceRequestId, iso.ModelId, iso.DurationMs, iso.AvgDurationMs, iso.IsolationScore, lof.LOFScore FROM IsolationScores iso LEFT JOIN LOFScoresParsed lof ON iso.RowNum = lof.RowNum ), AnomalousInferences AS ( -- DUAL DETECTION: Anomaly detected by EITHER IsolationForest OR LOF SELECT InferenceRequestId, ModelId, DurationMs, AvgDurationMs, (DurationMs / NULLIF(AvgDurationMs, 0)) AS SlowdownFactor, IsolationScore, LOFScore, CASE WHEN IsolationScore > @IsolationThreshold AND LOFScore > @LOFThreshold THEN 'both' WHEN IsolationScore > @IsolationThreshold THEN 'isolation_forest' WHEN LOFScore > @LOFThreshold THEN 'lof' ELSE NULL END AS DetectionMethod FROM CombinedScores WHERE IsolationScore > @IsolationThreshold OR LOFScore > @LOFThreshold ) SELECT @Anomalies = ( SELECT InferenceRequestId, ModelId, DurationMs, AvgDurationMs, SlowdownFactor, IsolationScore, LOFScore, DetectionMethod FROM AnomalousInferences FOR JSON PATH );
-- 3. QUERY STORE: CHECK FOR QUERY REGRESSION RECOMMENDATIONS DECLARE @QueryStoreRecommendations NVARCHAR(MAX);
SELECT @QueryStoreRecommendations = ( SELECT reason AS RecommendationType, score AS ImpactScore, state AS RecommendationState, JSON_VALUE(details, '$.planForceDetails.queryId') AS QueryId, JSON_VALUE(details, '$.planForceDetails.regressedPlanId') AS RegressedPlanId, JSON_VALUE(details, '$.planForceDetails.recommendedPlanId') AS RecommendedPlanId, JSON_VALUE(details, '$.implementationDetails.script') AS ForceScript FROM sys.dm_db_tuning_recommendations WHERE is_executable_action = 1 AND state = 1 -- Active state FOR JSON PATH );
-- 4. IDENTIFY EMBEDDING PATTERNS -- Find clusters of similar embeddings (potential concept emergence) SELECT @Patterns = ( SELECT TOP 10 ae.AtomId, a.Modality, COUNT(*) OVER (PARTITION BY ae.SpatialBucketX, ae.SpatialBucketY, ae.SpatialBucketZ) AS ClusterSize FROM dbo.AtomEmbeddings ae INNER JOIN dbo.Atoms a ON ae.AtomId = a.AtomId WHERE ae.CreatedAt >= DATEADD(HOUR, -@LookbackHours, SYSUTCDATETIME()) AND ae.SpatialBucketX IS NOT NULL ORDER BY ClusterSize DESC FOR JSON PATH );
-- 5. SPATIO-TEMPORAL ANALYTICS: Detect "Untapped Knowledge" regions -- High Pressure (many embeddings) + Low Velocity (rarely used) = Untapped potential DECLARE @UntappedKnowledge NVARCHAR(MAX);
SELECT @UntappedKnowledge = ( SELECT TOP 20 RankedRegions.HilbertValue, RankedRegions.Pressure, RankedRegions.Velocity, RankedRegions.PressureRank, RankedRegions.VelocityRank FROM ( SELECT ae.[HilbertValue], COUNT_BIG(ae.AtomId) AS Pressure, ISNULL(( SELECT COUNT_BIG(1) FROM [dbo].[InferenceTracking] it WHERE it.AtomId = ae.AtomId ), 0) AS Velocity, PERCENT_RANK() OVER (ORDER BY COUNT_BIG(ae.AtomId) DESC) AS PressureRank, PERCENT_RANK() OVER (ORDER BY ISNULL(( SELECT COUNT_BIG(1) FROM [dbo].[InferenceTracking] it WHERE it.AtomId = ae.AtomId ), 0) ASC) AS VelocityRank FROM [dbo].[AtomEmbeddings] ae WHERE ae.[HilbertValue] IS NOT NULL AND ae.[HilbertValue] <> 0 GROUP BY ae.[HilbertValue], ae.AtomId ) AS RankedRegions WHERE RankedRegions.PressureRank < 0.1 -- Top 10% most dense AND RankedRegions.VelocityRank < 0.1 -- Bottom 10% least used ORDER BY (RankedRegions.PressureRank + RankedRegions.VelocityRank) ASC FOR JSON PATH );
-- 6. COMPILE OBSERVATIONS SET @Observations = JSON_OBJECT( 'analysisId': @AnalysisId, 'scope': @AnalysisScope, 'lookbackHours': @LookbackHours, 'totalInferences': (SELECT COUNT(*) FROM @RecentInferences), 'avgDurationMs': @AvgDurationMs, 'anomalyCount': (SELECT COUNT(*) FROM OPENJSON(@Anomalies)), 'anomalies': JSON_QUERY(@Anomalies), 'queryStoreRecommendations': JSON_QUERY(@QueryStoreRecommendations), 'patterns': JSON_QUERY(@Patterns), 'untappedKnowledge': JSON_QUERY(@UntappedKnowledge), 'timestamp': FORMAT(SYSUTCDATETIME(), 'yyyy-MM-ddTHH:mm:ss.fffZ') );
-- 7. SEND TO HYPOTHESIZE QUEUE DECLARE @AnalyzeConversationHandle UNIQUEIDENTIFIER; DECLARE @AnalyzeMessageBody XML = CAST(@Observations AS XML);
BEGIN DIALOG CONVERSATION @AnalyzeConversationHandle FROM SERVICE AnalyzeService TO SERVICE 'HypothesizeService' ON CONTRACT [//Hartonomous/AutonomousLoop/HypothesizeContract] WITH ENCRYPTION = OFF;
SEND ON CONVERSATION @AnalyzeConversationHandle MESSAGE TYPE [//Hartonomous/AutonomousLoop/HypothesizeMessage] (@AnalyzeMessageBody);
-- Don't end conversation - keep it open for reply
-- 8. LOG ANALYSIS COMPLETION PRINT 'sp_Analyze completed: ' + CAST(DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS VARCHAR(10)) + 'ms'; PRINT 'Observations: ' + @Observations;
RETURN 0; END TRY BEGIN CATCH DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @ErrorSeverity INT = ERROR_SEVERITY(); DECLARE @ErrorState INT = ERROR_STATE();
PRINT 'sp_Analyze ERROR: ' + @ErrorMessage; RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState); RETURN -1; END CATCH END;

-- sp_Analyze: Autonomous loop Phase 1 - Observation & Analysis
-- PARADIGM: Uses advanced CLR aggregates for anomaly detection
-- Queries embeddings, detects anomalies using IsolationForest/LOF, identifies patterns
-- Sends HypothesizeMessage to Service Broker for next phase

CREATE PROCEDURE dbo.sp_Analyze
    @TenantId INT = 0,
    @AnalysisScope NVARCHAR(256) = 'full',
    @LookbackHours INT = 24
AS

BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    DECLARE @JobStatus VARCHAR(50), @AtomChunkSize INT, @CurrentAtomOffset BIGINT;
    DECLARE @AtomQuota BIGINT, @TotalAtomsProcessed BIGINT;
    DECLARE @ParentAtomId BIGINT;
    DECLARE @RowsInChunk BIGINT;
    DECLARE @TotalPixels BIGINT = CAST(@ImageWidth AS BIGINT) * CAST(@ImageHeight AS BIGINT);
    DECLARE @TenantId INT; -- V3: Added for tenancy

    -- Load job state
    SELECT
        @JobStatus = JobStatus,
        @AtomChunkSize = AtomChunkSize,
        @CurrentAtomOffset = CurrentAtomOffset,
        @AtomQuota = AtomQuota,
        @TotalAtomsProcessed = TotalAtomsProcessed,
        @ParentAtomId = ParentAtomId,
        @TenantId = TenantId -- V3: Retrieve TenantId from the job
    FROM dbo.IngestionJobs
    WHERE IngestionJobId = @IngestionJobId;

    IF @JobStatus IS NULL OR @JobStatus IN ('Complete', 'Processing')
    BEGIN
        RAISERROR('Invalid job state.', 16, 1);
        RETURN -1;
    END

    UPDATE dbo.IngestionJobs 
    SET JobStatus = 'Processing', LastUpdatedAt = SYSUTCDATETIME() 
    WHERE IngestionJobId = @IngestionJobId;

    -- Create temp tables
    CREATE TABLE #ChunkPixels (
        [PositionX] INT,
        [PositionY] INT,
        [R] TINYINT,
        [G] TINYINT,
        [B] TINYINT,
        [A] TINYINT,
        [SequenceIndex] BIGINT
    );

    CREATE TABLE #UniquePixels (
        [R] TINYINT,
        [G] TINYINT,
        [B] TINYINT,
        [A] TINYINT,
        [AtomicValue] VARBINARY(4) NOT NULL,
        [ContentHash] BINARY(32) NOT NULL,
        PRIMARY KEY ([R], [G], [B], [A])
    );

    CREATE TABLE #PixelToAtomId (
        [R] TINYINT,
        [G] TINYINT,
        [B] TINYINT,
        [A] TINYINT,
        [AtomId] BIGINT NOT NULL,
        PRIMARY KEY ([R], [G], [B], [A])
    );

    -- State machine loop
    WHILE (1 = 1)
    BEGIN
        BEGIN TRY
            IF @TotalAtomsProcessed > @AtomQuota
            BEGIN
                UPDATE dbo.IngestionJobs 
                SET JobStatus = 'Failed', ErrorMessage = 'Atom quota exceeded.'
                WHERE IngestionJobId = @IngestionJobId;
                RAISERROR('Atom quota exceeded.', 16, 1);
                BREAK;
            END

            TRUNCATE TABLE #ChunkPixels;
            TRUNCATE TABLE #UniquePixels;
            TRUNCATE TABLE #PixelToAtomId;

            -- Extract pixel chunk
            -- This is a simplified version - production would use CLR for proper image decoding
            DECLARE @BytesPerPixel INT = 4; -- RGBA
            DECLARE @ChunkStartByte BIGINT = @CurrentAtomOffset * @BytesPerPixel;
            DECLARE @ChunkEndByte BIGINT = (@CurrentAtomOffset + @AtomChunkSize) * @BytesPerPixel;

            IF @ChunkStartByte >= DATALENGTH(@ImageData)
                BREAK;

            -- Simple extraction (placeholder - real implementation would decode image format)
            DECLARE @PixelIdx BIGINT = @CurrentAtomOffset;
            DECLARE @ByteIdx BIGINT = @ChunkStartByte;

            WHILE @PixelIdx < (@CurrentAtomOffset + @AtomChunkSize) 
                AND @ByteIdx < DATALENGTH(@ImageData) 
                AND @PixelIdx < @TotalPixels
            BEGIN
                DECLARE @R TINYINT = CAST(SUBSTRING(@ImageData, @ByteIdx + 1, 1) AS TINYINT);
                DECLARE @G TINYINT = CAST(SUBSTRING(@ImageData, @ByteIdx + 2, 1) AS TINYINT);
                DECLARE @B TINYINT = CAST(SUBSTRING(@ImageData, @ByteIdx + 3, 1) AS TINYINT);
                DECLARE @A TINYINT = CAST(SUBSTRING(@ImageData, @ByteIdx + 4, 1) AS TINYINT);

                DECLARE @X INT = @PixelIdx % @ImageWidth;
                DECLARE @Y INT = @PixelIdx / @ImageWidth;

                INSERT INTO #ChunkPixels ([PositionX], [PositionY], [R], [G], [B], [A], [SequenceIndex])
                VALUES (@X, @Y, @R, @G, @B, @A, @PixelIdx);

                SET @PixelIdx = @PixelIdx + 1;
                SET @ByteIdx = @ByteIdx + @BytesPerPixel;
            END

            SET @RowsInChunk = @@ROWCOUNT;

            IF @RowsInChunk = 0
                BREAK;

            -- Get unique RGBA values
            INSERT INTO #UniquePixels ([R], [G], [B], [A], [AtomicValue], [ContentHash])
            SELECT DISTINCT 
                [R], [G], [B], [A],
                CAST(([R] * 0x1000000 + [G] * 0x10000 + [B] * 0x100 + [A]) AS VARBINARY(4)),
                HASHBYTES('SHA2_256', CAST(([R] * 0x1000000 + [G] * 0x10000 + [B] * 0x100 + [A]) AS VARBINARY(4)))
            FROM #ChunkPixels;

            BEGIN TRANSACTION;

                MERGE [dbo].[Atoms] AS T
                USING #UniquePixels AS S
                ON T.[ContentHash] = S.[ContentHash]
                WHEN NOT MATCHED BY TARGET THEN
                    INSERT ([Modality], [Subtype], [ContentHash], [AtomicValue], [ReferenceCount], [TenantId])
                    VALUES ('image', 'rgba-pixel', S.[ContentHash], S.[AtomicValue], 0, @TenantId);

                INSERT INTO #PixelToAtomId ([R], [G], [B], [A], [AtomId])
                SELECT up.[R], up.[G], up.[B], up.[A], a.[AtomId]
                FROM #UniquePixels up
                JOIN [dbo].[Atoms] a ON a.[ContentHash] = up.[ContentHash];

                UPDATE a
                SET a.[ReferenceCount] = a.[ReferenceCount] + pixel_count
                FROM [dbo].[Atoms] a
                JOIN (
                    SELECT pta.[AtomId], COUNT(*) AS pixel_count
                    FROM #ChunkPixels cp
                    JOIN #PixelToAtomId pta 
                        ON cp.[R] = pta.[R] 
                        AND cp.[G] = pta.[G] 
                        AND cp.[B] = pta.[B] 
                        AND cp.[A] = pta.[A]
                    GROUP BY pta.[AtomId]
                ) AS counts ON a.[AtomId] = counts.[AtomId];

                -- Insert XYZM structural representation
                INSERT INTO [dbo].[AtomCompositions] (
                    [ParentAtomId], 
                    [ComponentAtomId], 
                    [SequenceIndex], 
                    [SpatialKey]
                )
                SELECT 
                    @ParentAtomId,
                    pta.[AtomId],
                    cp.[SequenceIndex],
                    GEOMETRY::Point(
                        cp.[PositionX],  -- X = Pixel X
                        cp.[PositionY],  -- Y = Pixel Y
                        0                -- Z = unused (could be used for layers/channels)
                    )
                FROM #ChunkPixels cp
                JOIN #PixelToAtomId pta 
                    ON cp.[R] = pta.[R] 
                    AND cp.[G] = pta.[G] 
                    AND cp.[B] = pta.[B] 
                    AND cp.[A] = pta.[A];

            COMMIT TRANSACTION;

            SET @CurrentAtomOffset = @CurrentAtomOffset + @AtomChunkSize;
            SET @TotalAtomsProcessed = @TotalAtomsProcessed + @RowsInChunk;

            UPDATE dbo.IngestionJobs 
            SET CurrentAtomOffset = @CurrentAtomOffset, 
                TotalAtomsProcessed = @TotalAtomsProcessed,
                LastUpdatedAt = SYSUTCDATETIME()
            WHERE IngestionJobId = @IngestionJobId;

        END TRY
        BEGIN CATCH
            IF (XACT_STATE() <> 0) ROLLBACK TRANSACTION;

            DECLARE @Error NVARCHAR(MAX) = ERROR_MESSAGE();
            UPDATE dbo.IngestionJobs 
            SET JobStatus = 'Failed', ErrorMessage = @Error
            WHERE IngestionJobId = @IngestionJobId;

            DROP TABLE IF EXISTS #ChunkPixels;
            DROP TABLE IF EXISTS #UniquePixels;
            DROP TABLE IF EXISTS #PixelToAtomId;

            RAISERROR(@Error, 16, 1);
            RETURN -1;
        END CATCH
    END

    UPDATE dbo.IngestionJobs 
    SET JobStatus = 'Complete', LastUpdatedAt = SYSUTCDATETIME() 
    WHERE IngestionJobId = @IngestionJobId;

    DROP TABLE #ChunkPixels;
    DROP TABLE #UniquePixels;
    DROP TABLE #PixelToAtomId;

    RETURN 0;
END

-- =============================================
-- sp_AtomizeImage_Governed: Governed Image Pixel Atomization
-- =============================================
-- Implements chunked, resumable image atomization with XYZM structural storage
-- =============================================

CREATE PROCEDURE [dbo].[sp_AtomizeImage_Governed]
    @IngestionJobId BIGINT,
    @ImageData VARBINARY(MAX),
    @ImageWidth INT,
    @ImageHeight INT
AS

BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    DECLARE @JobStatus VARCHAR(50), @AtomChunkSize INT, @CurrentAtomOffset BIGINT;
    DECLARE @AtomQuota BIGINT, @TotalAtomsProcessed BIGINT;
    DECLARE @ParentAtomId BIGINT, @ModelId INT;
    DECLARE @RowsInChunk BIGINT;
    DECLARE @TenantId INT; -- V3: Added for tenancy

    -- 1. Load job state and governance parameters
    SELECT
        @JobStatus = JobStatus,
        @AtomChunkSize = AtomChunkSize,
        @CurrentAtomOffset = CurrentAtomOffset,
        @AtomQuota = AtomQuota,
        @TotalAtomsProcessed = TotalAtomsProcessed,
        @ParentAtomId = ParentAtomId,
        @ModelId = ModelId,
        @TenantId = TenantId -- V3: Retrieve TenantId from the job
    FROM dbo.IngestionJobs
    WHERE IngestionJobId = @IngestionJobId;

    IF @JobStatus IS NULL
    BEGIN
        RAISERROR('IngestionJobId not found.', 16, 1);
        RETURN -1;
    END

    IF @JobStatus = 'Complete' OR @JobStatus = 'Processing'
    BEGIN
        RAISERROR('Job is already complete or in progress.', 16, 1);
        RETURN -1;
    END

    UPDATE dbo.IngestionJobs 
    SET JobStatus = 'Processing', LastUpdatedAt = SYSUTCDATETIME() 
    WHERE IngestionJobId = @IngestionJobId;

    -- 2. Create temp tables for batch processing
    CREATE TABLE #ChunkWeights (
        [LayerIdx] INT,
        [PositionX] INT,
        [PositionY] INT,
        [PositionZ] INT,
        [Value] REAL
    );

    CREATE TABLE #UniqueWeights (
        [Value] REAL PRIMARY KEY,
        [AtomicValue] VARBINARY(4) NOT NULL,
        [ContentHash] BINARY(32) NOT NULL
    );

    CREATE TABLE #WeightToAtomId (
        [Value] REAL PRIMARY KEY,
        [AtomId] BIGINT NOT NULL
    );

    CREATE TABLE #ChunkCounts (
        [Value] REAL PRIMARY KEY,
        [Count] BIGINT NOT NULL
    );

    -- 3. Begin Governed State Machine Loop
    WHILE (1 = 1)
    BEGIN
        BEGIN TRY
            -- 3a. Check Governance
            IF @TotalAtomsProcessed > @AtomQuota
            BEGIN
                UPDATE dbo.IngestionJobs 
                SET JobStatus = 'Failed', 
                    ErrorMessage = 'Atom quota exceeded.',
                    LastUpdatedAt = SYSUTCDATETIME()
                WHERE IngestionJobId = @IngestionJobId;

                RAISERROR('Atom quota exceeded.', 16, 1);
                BREAK;
            END

            -- 3b. Clear temp tables for this chunk
            TRUNCATE TABLE #ChunkWeights;
            TRUNCATE TABLE #UniqueWeights;
            TRUNCATE TABLE #WeightToAtomId;
            TRUNCATE TABLE #ChunkCounts;

            -- 3c. Get ONE chunk from CLR streaming function
            INSERT INTO #ChunkWeights ([LayerIdx], [PositionX], [PositionY], [PositionZ], [Value])
            SELECT [LayerIdx], [PositionX], [PositionY], [PositionZ], [Value]
            FROM [dbo].[clr_StreamAtomicWeights_Chunked](
                @ModelData, 
                @ModelFormat, 
                @CurrentAtomOffset, 
                @AtomChunkSize
            );

            SET @RowsInChunk = @@ROWCOUNT;

            IF @RowsInChunk = 0
                BREAK; -- Finished streaming all weights

            -- 3d. Get unique atoms and counts *for this chunk*
            INSERT INTO #UniqueWeights ([Value], [AtomicValue], [ContentHash])
            SELECT DISTINCT 
                [Value], 
                CAST([Value] AS VARBINARY(4)), 
                HASHBYTES('SHA2_256', CAST([Value] AS VARBINARY(4)))
            FROM #ChunkWeights;

            INSERT INTO #ChunkCounts ([Value], [Count])
            SELECT [Value], COUNT_BIG(*) 
            FROM #ChunkWeights 
            GROUP BY [Value];

            -- 3e. Begin small, fast transaction
            BEGIN TRANSACTION;

                -- 3f. Merge unique weights into dbo.Atoms (deduplication)
                MERGE [dbo].[Atoms] AS T
                USING #UniqueWeights AS S
                ON T.[ContentHash] = S.[ContentHash]
                WHEN NOT MATCHED BY TARGET THEN
                    INSERT ([Modality], [Subtype], [ContentHash], [AtomicValue], [ReferenceCount], [TenantId])
                    VALUES ('model', 'float32-weight', S.[ContentHash], S.[AtomicValue], 0, @TenantId);

                -- 3g. Update reference counts atomically
                UPDATE a
                SET a.[ReferenceCount] = a.[ReferenceCount] + cc.[Count]
                FROM [dbo].[Atoms] a
                JOIN #UniqueWeights uw ON a.[ContentHash] = uw.[ContentHash]
                JOIN #ChunkCounts cc ON uw.[Value] = cc.[Value]
                WHERE a.[Modality] = 'model' AND a.[Subtype] = 'float32-weight';

                -- 3h. Get AtomIds for this chunk
                INSERT INTO #WeightToAtomId ([Value], [AtomId])
                SELECT uw.[Value], a.[AtomId]
                FROM #UniqueWeights uw
                JOIN [dbo].[Atoms] a ON a.[ContentHash] = uw.[ContentHash]
                WHERE a.[Modality] = 'model' AND a.[Subtype] = 'float32-weight';

                -- 3i. Insert the reconstruction data for this chunk into TensorAtomCoefficients
                INSERT INTO [dbo].[TensorAtomCoefficients] (
                    [TensorAtomId], 
                    [ModelId], 
                    [LayerIdx], 
                    [PositionX], 
                    [PositionY], 
                    [PositionZ]
                )
                SELECT 
                    wta.[AtomId],
                    @ModelId,
                    s.[LayerIdx],
                    s.[PositionX],
                    s.[PositionY],
                    s.[PositionZ]
                FROM #ChunkWeights s
                JOIN #WeightToAtomId wta ON s.[Value] = wta.[Value];

            COMMIT TRANSACTION;

            -- 3j. Update state and log progress
            SET @CurrentAtomOffset = @CurrentAtomOffset + @AtomChunkSize;
            SET @TotalAtomsProcessed = @TotalAtomsProcessed + @RowsInChunk;

            UPDATE dbo.IngestionJobs 
            SET CurrentAtomOffset = @CurrentAtomOffset, 
                TotalAtomsProcessed = @TotalAtomsProcessed, 
                LastUpdatedAt = SYSUTCDATETIME()
            WHERE IngestionJobId = @IngestionJobId;

        END TRY
        BEGIN CATCH
            IF (XACT_STATE() <> 0) ROLLBACK TRANSACTION;

            DECLARE @Error NVARCHAR(MAX) = ERROR_MESSAGE();
            UPDATE dbo.IngestionJobs 
            SET JobStatus = 'Failed', 
                ErrorMessage = @Error,
                LastUpdatedAt = SYSUTCDATETIME()
            WHERE IngestionJobId = @IngestionJobId;

            -- Cleanup temp tables
            DROP TABLE IF EXISTS #ChunkWeights;
            DROP TABLE IF EXISTS #UniqueWeights;
            DROP TABLE IF EXISTS #WeightToAtomId;
            DROP TABLE IF EXISTS #ChunkCounts;

            RAISERROR(@Error, 16, 1);
            RETURN -1;
        END CATCH
    END -- End WHILE

    -- Mark job as complete
    IF @JobStatus <> 'Failed'
        UPDATE dbo.IngestionJobs 
        SET JobStatus = 'Complete', 
            LastUpdatedAt = SYSUTCDATETIME() 
        WHERE IngestionJobId = @IngestionJobId;

    -- Cleanup temp tables
    DROP TABLE #ChunkWeights;
    DROP TABLE #UniqueWeights;
    DROP TABLE #WeightToAtomId;
    DROP TABLE #ChunkCounts;

    RETURN 0;
END

BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    DECLARE @JobStatus VARCHAR(50), @AtomChunkSize INT, @CurrentAtomOffset BIGINT;
    DECLARE @AtomQuota BIGINT, @TotalAtomsProcessed BIGINT;
    DECLARE @ParentAtomId BIGINT;
    DECLARE @RowsInChunk BIGINT;
    DECLARE @TenantId INT; -- V3: Added for tenancy

    -- 1. Load job state
    SELECT
        @JobStatus = JobStatus,
        @AtomChunkSize = AtomChunkSize,
        @CurrentAtomOffset = CurrentAtomOffset,
        @AtomQuota = AtomQuota,
        @TotalAtomsProcessed = TotalAtomsProcessed,
        @ParentAtomId = ParentAtomId,
        @TenantId = TenantId -- V3: Retrieve TenantId from the job
    FROM dbo.IngestionJobs
    WHERE IngestionJobId = @IngestionJobId;

    IF @JobStatus IS NULL OR @JobStatus IN ('Complete', 'Processing')
    BEGIN
        RAISERROR('Invalid job state.', 16, 1);
        RETURN -1;
    END

    UPDATE dbo.IngestionJobs 
    SET JobStatus = 'Processing', LastUpdatedAt = SYSUTCDATETIME() 
    WHERE IngestionJobId = @IngestionJobId;

    -- 2. Create temp tables
    CREATE TABLE #ChunkTokens (
        [TokenId] INT,
        [TokenText] NVARCHAR(256),
        [SequenceIndex] BIGINT
    );

    CREATE TABLE #UniqueTokens (
        [TokenText] NVARCHAR(256) PRIMARY KEY,
        [AtomicValue] VARBINARY(64) NOT NULL,
        [ContentHash] BINARY(32) NOT NULL
    );

    CREATE TABLE #TokenToAtomId (
        [TokenText] NVARCHAR(256) PRIMARY KEY,
        [AtomId] BIGINT NOT NULL
    );

    -- 3. State machine loop
    WHILE (1 = 1)
    BEGIN
        BEGIN TRY
            -- Check governance
            IF @TotalAtomsProcessed > @AtomQuota
            BEGIN
                UPDATE dbo.IngestionJobs 
                SET JobStatus = 'Failed', ErrorMessage = 'Atom quota exceeded.'
                WHERE IngestionJobId = @IngestionJobId;
                RAISERROR('Atom quota exceeded.', 16, 1);
                BREAK;
            END

            -- Clear temp tables
            TRUNCATE TABLE #ChunkTokens;
            TRUNCATE TABLE #UniqueTokens;
            TRUNCATE TABLE #TokenToAtomId;

            -- Tokenize text chunk (simplified - production would use proper tokenizer)
            -- For now, split by whitespace as proof of concept
            DECLARE @ChunkStart BIGINT = @CurrentAtomOffset;
            DECLARE @ChunkEnd BIGINT = @ChunkStart + @AtomChunkSize;
            DECLARE @TextLength BIGINT = LEN(@TextData);

            IF @ChunkStart >= @TextLength
                BREAK;

            -- Simple whitespace tokenization (placeholder for real tokenizer)
            DECLARE @ChunkText NVARCHAR(MAX) = SUBSTRING(@TextData, @ChunkStart + 1, @AtomChunkSize);
            DECLARE @Pos INT = 1;
            DECLARE @SeqIdx BIGINT = @ChunkStart;

            WHILE @Pos <= LEN(@ChunkText)
            BEGIN
                DECLARE @SpacePos INT = CHARINDEX(' ', @ChunkText, @Pos);
                IF @SpacePos = 0
                    SET @SpacePos = LEN(@ChunkText) + 1;

                DECLARE @Token NVARCHAR(256) = SUBSTRING(@ChunkText, @Pos, @SpacePos - @Pos);

                IF LEN(@Token) > 0
                BEGIN
                    INSERT INTO #ChunkTokens ([TokenId], [TokenText], [SequenceIndex])
                    VALUES (0, @Token, @SeqIdx);
                    SET @SeqIdx = @SeqIdx + 1;
                END

                SET @Pos = @SpacePos + 1;
            END

            SET @RowsInChunk = @@ROWCOUNT;

            IF @RowsInChunk = 0
                BREAK;

            -- Get unique tokens
            INSERT INTO #UniqueTokens ([TokenText], [AtomicValue], [ContentHash])
            SELECT DISTINCT 
                [TokenText],
                CAST([TokenText] AS VARBINARY(64)),
                HASHBYTES('SHA2_256', CAST([TokenText] AS VARBINARY(64)))
            FROM #ChunkTokens;

            BEGIN TRANSACTION;

                -- Merge into Atoms
                MERGE [dbo].[Atoms] AS T
                USING #UniqueTokens AS S
                ON T.[ContentHash] = S.[ContentHash]
                WHEN NOT MATCHED BY TARGET THEN
                    INSERT ([Modality], [Subtype], [ContentHash], [AtomicValue], [ReferenceCount], [TenantId])
                    VALUES ('text', 'token', S.[ContentHash], S.[AtomicValue], 0, @TenantId);

                -- Get AtomIds
                INSERT INTO #TokenToAtomId ([TokenText], [AtomId])
                SELECT ut.[TokenText], a.[AtomId]
                FROM #UniqueTokens ut
                JOIN [dbo].[Atoms] a ON a.[ContentHash] = ut.[ContentHash];

                -- Update reference counts
                UPDATE a
                SET a.[ReferenceCount] = a.[ReferenceCount] + 1
                FROM [dbo].[Atoms] a
                JOIN #TokenToAtomId tta ON a.[AtomId] = tta.[AtomId];

                -- Insert structural representation with XYZM spatial key
                INSERT INTO [dbo].[AtomCompositions] (
                    [ParentAtomId], 
                    [ComponentAtomId], 
                    [SequenceIndex], 
                    [SpatialKey]
                )
                SELECT 
                    @ParentAtomId,
                    tta.[AtomId],
                    ct.[SequenceIndex],
                    GEOMETRY::Point(
                        ct.[SequenceIndex],  -- X = Position
                        tta.[AtomId] % 10000, -- Y = Value (modulo for scaling)
                        0                     -- Z = unused
                    )
                FROM #ChunkTokens ct
                JOIN #TokenToAtomId tta ON ct.[TokenText] = tta.[TokenText];

            COMMIT TRANSACTION;

            -- Update progress
            SET @CurrentAtomOffset = @CurrentAtomOffset + @AtomChunkSize;
            SET @TotalAtomsProcessed = @TotalAtomsProcessed + @RowsInChunk;

            UPDATE dbo.IngestionJobs 
            SET CurrentAtomOffset = @CurrentAtomOffset, 
                TotalAtomsProcessed = @TotalAtomsProcessed,
                LastUpdatedAt = SYSUTCDATETIME()
            WHERE IngestionJobId = @IngestionJobId;

        END TRY
        BEGIN CATCH
            IF (XACT_STATE() <> 0) ROLLBACK TRANSACTION;

            DECLARE @Error NVARCHAR(MAX) = ERROR_MESSAGE();
            UPDATE dbo.IngestionJobs 
            SET JobStatus = 'Failed', ErrorMessage = @Error
            WHERE IngestionJobId = @IngestionJobId;

            DROP TABLE IF EXISTS #ChunkTokens;
            DROP TABLE IF EXISTS #UniqueTokens;
            DROP TABLE IF EXISTS #TokenToAtomId;

            RAISERROR(@Error, 16, 1);
            RETURN -1;
        END CATCH
    END

    -- Mark complete
    UPDATE dbo.IngestionJobs 
    SET JobStatus = 'Complete', LastUpdatedAt = SYSUTCDATETIME() 
    WHERE IngestionJobId = @IngestionJobId;

    DROP TABLE #ChunkTokens;
    DROP TABLE #UniqueTokens;
    DROP TABLE #TokenToAtomId;

    RETURN 0;
END

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @ReasoningSteps TABLE (
        StepNumber INT,
        GenerationStreamId BIGINT,
        ContextUsed NVARCHAR(MAX),
        Reasoning NVARCHAR(MAX),
        Confidence FLOAT,
        StepTime DATETIME2
    );

    IF @Debug = 1
        PRINT 'Starting attention inference for problem ' + CAST(@ProblemId AS NVARCHAR(36));

    -- Initial context preparation
    DECLARE @CurrentContext NVARCHAR(MAX) = @ContextAtoms;
    DECLARE @StepNumber INT = 1;

    WHILE @StepNumber <= @MaxReasoningSteps
    BEGIN
        DECLARE @StepStartTime DATETIME2 = SYSUTCDATETIME();

        -- Generate reasoning step using attention
        DECLARE @StepContextJson NVARCHAR(MAX) = CONCAT('{"step":', CAST(@StepNumber AS NVARCHAR(10)), ',"query":"', REPLACE(@Query, '"', '\"'), '"}');
        DECLARE @StepStreamId BIGINT;
        EXEC dbo.sp_GenerateWithAttention
            @ModelId = @ModelId,
            @InputAtomIds = @CurrentContext,
            @ContextJson = @StepContextJson,
            @MaxTokens = 50,
            @Temperature = 0.8,
            @TopK = 40,
            @TopP = 0.85,
            @AttentionHeads = @AttentionHeads,
            @Debug = 0;

        -- Get the generated stream ID (this is a simplification - in practice need to capture from sp_GenerateWithAttention)
        SELECT TOP 1 @StepStreamId = GenerationStreamId
        FROM dbo.AttentionGenerationLog
        WHERE ModelId = @ModelId AND CreatedAt >= @StepStartTime
        ORDER BY CreatedAt DESC;

        IF @StepStreamId IS NULL
        BEGIN
            IF @Debug = 1
                PRINT 'No generation stream found for step ' + CAST(@StepNumber AS NVARCHAR(10));
            BREAK;
        END

        -- Get generated atoms for this step
        DECLARE @GeneratedAtoms NVARCHAR(MAX);
        SELECT @GeneratedAtoms = CAST(GeneratedAtomIds AS NVARCHAR(MAX))
        FROM provenance.GenerationStreams
        WHERE GenerationStreamId = @StepStreamId;

        -- Store reasoning step
        INSERT INTO @ReasoningSteps (StepNumber, GenerationStreamId, ContextUsed, Reasoning, Confidence, StepTime)
        VALUES (@StepNumber, @StepStreamId, @CurrentContext, @GeneratedAtoms, 0.8, @StepStartTime);

        -- Update context for next step
        SET @CurrentContext = @CurrentContext + ',' + @GeneratedAtoms;
        SET @StepNumber = @StepNumber + 1;

        -- Check for convergence (simplified)
        IF LEN(@GeneratedAtoms) < 10 -- Very short response might indicate completion
        BEGIN
            BREAK;
        END
    END

    -- Store final attention inference result
    INSERT INTO dbo.AttentionInferenceResults (
        ProblemId,
        Query,
        ModelId,
        MaxReasoningSteps,
        AttentionHeads,
        ReasoningSteps,
        TotalSteps,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @ProblemId,
        @Query,
        @ModelId,
        @MaxReasoningSteps,
        @AttentionHeads,
        (SELECT * FROM @ReasoningSteps FOR JSON PATH),
        @StepNumber - 1,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return reasoning steps
    SELECT
        @ProblemId AS ProblemId,
        'attention_inference' AS InferenceType,
        StepNumber,
        GenerationStreamId,
        ContextUsed,
        Reasoning,
        Confidence,
        StepTime
    FROM @ReasoningSteps
    ORDER BY StepNumber;

    IF @Debug = 1
        PRINT 'Attention inference completed with ' + CAST(@StepNumber - 1 AS NVARCHAR(10)) + ' steps';
END;

