CREATE PROCEDURE dbo.sp_AttentionInference
    @ProblemId UNIQUEIDENTIFIER,
    @ContextAtoms NVARCHAR(MAX), -- Atom IDs providing context
    @Query NVARCHAR(MAX), -- The query/problem to solve
    @ModelId INT = 1,
    @MaxReasoningSteps INT = 10,
    @AttentionHeads INT = 8,
    @Debug BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();

    IF @StartDate IS NULL SET @StartDate = DATEADD(DAY, -7, SYSUTCDATETIME());
    IF @EndDate IS NULL SET @EndDate = SYSUTCDATETIME();

    IF @Debug = 1
        PRINT 'Auditing provenance chains from ' + CAST(@StartDate AS NVARCHAR(30)) + ' to ' + CAST(@EndDate AS NVARCHAR(30));

    -- Get operations in date range
    DECLARE @Operations TABLE (
        OperationId UNIQUEIDENTIFIER,
        Scope NVARCHAR(100),
        Model NVARCHAR(100),
        CreatedAt DATETIME2,
        SegmentCount INT,
        ValidationStatus NVARCHAR(20),
        ValidationScore FLOAT
    );

    INSERT INTO @Operations
    SELECT
        op.OperationId,
        op.ProvenanceStream.Scope,
        op.ProvenanceStream.Model,
        op.CreatedAt,
        op.ProvenanceStream.SegmentCount,
        pvr.OverallStatus,
        CASE pvr.OverallStatus
            WHEN 'PASS' THEN 1.0
            WHEN 'WARN' THEN 0.7
            WHEN 'FAIL' THEN 0.0
            ELSE 0.5
        END
    FROM dbo.OperationProvenance op
    LEFT JOIN dbo.ProvenanceValidationResults pvr ON op.OperationId = pvr.OperationId
    WHERE op.CreatedAt BETWEEN @StartDate AND @EndDate
    AND (@Scope IS NULL OR op.ProvenanceStream.Scope = @Scope);

    -- Calculate audit metrics
    DECLARE @TotalOperations INT = (SELECT COUNT(*) FROM @Operations);
    DECLARE @ValidOperations INT = (SELECT COUNT(*) FROM @Operations WHERE ValidationStatus = 'PASS');
    DECLARE @WarningOperations INT = (SELECT COUNT(*) FROM @Operations WHERE ValidationStatus = 'WARN');
    DECLARE @FailedOperations INT = (SELECT COUNT(*) FROM @Operations WHERE ValidationStatus = 'FAIL');
    DECLARE @AverageValidationScore FLOAT = (SELECT AVG(ValidationScore) FROM @Operations);
    DECLARE @AverageSegmentCount FLOAT = (SELECT AVG(SegmentCount) FROM @Operations);

    -- Check for anomalies
    DECLARE @Anomalies TABLE (AnomalyType NVARCHAR(100), Details NVARCHAR(MAX));

    -- Operations with no provenance
    IF EXISTS (SELECT 1 FROM dbo.OperationProvenance WHERE CreatedAt BETWEEN @StartDate AND @EndDate AND (ProvenanceStream IS NULL OR ProvenanceStream.IsNull = 1))
        INSERT INTO @Anomalies VALUES ('Missing Provenance', 'Operations found without provenance streams');

    -- Operations failing validation
    IF @FailedOperations > 0
        INSERT INTO @Anomalies VALUES ('Validation Failures', CAST(@FailedOperations AS NVARCHAR(10)) + ' operations failed validation');

    -- Operations with unusual segment counts
    DECLARE @AvgSegments FLOAT = (SELECT AVG(SegmentCount) FROM @Operations);
    DECLARE @StdDevSegments FLOAT = (SELECT STDEV(SegmentCount) FROM @Operations);

    IF @StdDevSegments IS NOT NULL AND EXISTS (SELECT 1 FROM @Operations WHERE ABS(SegmentCount - @AvgSegments) > 2 * @StdDevSegments)
        INSERT INTO @Anomalies VALUES ('Segment Count Anomalies', 'Operations with unusual number of provenance segments detected');

    -- Store audit result
    INSERT INTO dbo.ProvenanceAuditResults (
        AuditPeriodStart,
        AuditPeriodEnd,
        Scope,
        TotalOperations,
        ValidOperations,
        WarningOperations,
        FailedOperations,
        AverageValidationScore,
        AverageSegmentCount,
        Anomalies,
        AuditDurationMs,
        AuditedAt
    )
    VALUES (
        @StartDate,
        @EndDate,
        @Scope,
        @TotalOperations,
        @ValidOperations,
        @WarningOperations,
        @FailedOperations,
        @AverageValidationScore,
        @AverageSegmentCount,
        (SELECT * FROM @Anomalies FOR JSON PATH),
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return audit summary
    SELECT
        'Audit Summary' AS Metric,
        CAST(@StartDate AS NVARCHAR(30)) + ' - ' + CAST(@EndDate AS NVARCHAR(30)) AS Period,
        @TotalOperations AS TotalOperations,
        @ValidOperations AS ValidOperations,
        CAST(CAST(@ValidOperations AS FLOAT) / NULLIF(@TotalOperations, 0) * 100 AS DECIMAL(5,2)) AS ValidPercentage,
        @WarningOperations AS WarningOperations,
        @FailedOperations AS FailedOperations,
        CAST(@AverageValidationScore * 100 AS DECIMAL(5,2)) AS AvgValidationScore,
        CAST(@AverageSegmentCount AS DECIMAL(10,2)) AS AvgSegmentCount;

    -- Return anomalies
    SELECT
        AnomalyType,
        Details
    FROM @Anomalies;

    -- Return detailed operation results
    SELECT TOP 100
        OperationId,
        Scope,
        Model,
        CreatedAt,
        SegmentCount,
        ValidationStatus,
        CAST(ValidationScore * 100 AS DECIMAL(5,2)) AS ValidationScorePercent
    FROM @Operations
    ORDER BY CreatedAt DESC;

    IF @Debug = 1
        PRINT 'Provenance audit completed, analyzed ' + CAST(@TotalOperations AS NVARCHAR(10)) + ' operations';
END;

CREATE PROCEDURE dbo.sp_AuditProvenanceChain
    @StartDate DATETIME2 = NULL,
    @EndDate DATETIME2 = NULL,
    @Scope NVARCHAR(100) = NULL,
    @MinValidationScore FLOAT = 0.8,
    @Debug BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    -- Build domains for each concept by defining boundaries with nearest concepts
    -- This is a simplified "cell" approach - each concept gets a buffered region

    CREATE TABLE #ConceptCentroids (
        ConceptId INT PRIMARY KEY,
        Centroid GEOMETRY NOT NULL
    );

    -- Get all active concepts with spatial centroids
    INSERT INTO #ConceptCentroids (ConceptId, Centroid)
    SELECT ConceptId, CentroidSpatialKey
    FROM [provenance].[Concepts]
    WHERE [TenantId] = @TenantId
      AND [IsActive] = 1
      AND [CentroidSpatialKey] IS NOT NULL;

    IF NOT EXISTS (SELECT 1 FROM #ConceptCentroids)
    BEGIN
        PRINT 'No concepts with spatial centroids found.';
        RETURN 0;
    END

    -- For each concept, compute its domain as a buffer around centroid
    -- Size is determined by distance to nearest neighbor / 2
    CREATE TABLE #ConceptDomains (
        ConceptId INT PRIMARY KEY,
        Domain GEOMETRY NOT NULL,
        Radius FLOAT NOT NULL
    );

    DECLARE @ConceptId INT;
    DECLARE @Centroid GEOMETRY;
    DECLARE @NearestDistance FLOAT;

    DECLARE concept_cursor CURSOR FOR
        SELECT ConceptId, Centroid 
        FROM #ConceptCentroids;

    OPEN concept_cursor;
    FETCH NEXT FROM concept_cursor INTO @ConceptId, @Centroid;

    WHILE @@FETCH_STATUS = 0
    BEGIN
        -- Find distance to nearest neighbor concept
        SELECT TOP 1 @NearestDistance = @Centroid.STDistance(cc.Centroid)
        FROM #ConceptCentroids cc
        WHERE cc.ConceptId <> @ConceptId
        ORDER BY @Centroid.STDistance(cc.Centroid) ASC;

        IF @NearestDistance IS NULL
            SET @NearestDistance = 1.0; -- Single concept case

        -- Create domain as buffer with radius = half distance to nearest neighbor
        DECLARE @Radius FLOAT = @NearestDistance / 2.0;
        DECLARE @Domain GEOMETRY = @Centroid.STBuffer(@Radius);

        INSERT INTO #ConceptDomains (ConceptId, Domain, Radius)
        VALUES (@ConceptId, @Domain, @Radius);

        FETCH NEXT FROM concept_cursor INTO @ConceptId, @Centroid;
    END

    CLOSE concept_cursor;
    DEALLOCATE concept_cursor;

    -- Update Concepts table with computed domains
    UPDATE c
    SET 
        c.[ConceptDomain] = cd.Domain,
        c.[LastUpdatedAt] = SYSUTCDATETIME()
    FROM [provenance].[Concepts] c
    JOIN #ConceptDomains cd ON c.ConceptId = cd.ConceptId;

    DECLARE @UpdatedCount INT = @@ROWCOUNT;

    -- Ensure spatial indexes exist (will be skipped if already exists)
    IF NOT EXISTS (SELECT 1 FROM sys.spatial_indexes WHERE name = 'SIX_Concepts_ConceptDomain')
    BEGIN
        CREATE SPATIAL INDEX [SIX_Concepts_ConceptDomain] 
            ON [provenance].[Concepts]([ConceptDomain])
            WITH (BOUNDING_BOX = (-1, -1, 1, 1));
    END

    DROP TABLE #ConceptCentroids;
    DROP TABLE #ConceptDomains;

    PRINT 'Built ' + CAST(@UpdatedCount AS VARCHAR(10)) + ' concept domains.';
    RETURN 0;
END

BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        IF @BillingPeriodStart IS NULL
            SET @BillingPeriodStart = DATEADD(MONTH, DATEDIFF(MONTH, 0, SYSUTCDATETIME()), 0);

        IF @BillingPeriodEnd IS NULL
            SET @BillingPeriodEnd = DATEADD(MONTH, 1, @BillingPeriodStart);

        DECLARE @UsageSummary TABLE (
            UsageType NVARCHAR(50),
            TotalQuantity BIGINT,
            TotalCost DECIMAL(18, 2)
        );

        INSERT INTO @UsageSummary
        SELECT 
            UsageType,
            SUM(Quantity) AS TotalQuantity,
            SUM(TotalCost) AS TotalCost
        FROM dbo.BillingUsageLedger
        WHERE TenantId = @TenantId
              AND RecordedUtc >= @BillingPeriodStart
              AND RecordedUtc < @BillingPeriodEnd
        GROUP BY UsageType;

        DECLARE @Subtotal DECIMAL(18, 2) = (SELECT SUM(TotalCost) FROM @UsageSummary);
        DECLARE @DiscountPercent DECIMAL(5, 2) = 0.0;
        DECLARE @Tax DECIMAL(18, 2) = 0.0;
        DECLARE @Total DECIMAL(18, 2);

        IF @Subtotal > 10000
            SET @DiscountPercent = 15.0;
        ELSE IF @Subtotal > 5000
            SET @DiscountPercent = 10.0;
        ELSE IF @Subtotal > 1000
            SET @DiscountPercent = 5.0;

        DECLARE @Discount DECIMAL(18, 2) = @Subtotal * (@DiscountPercent / 100.0);
        SET @Tax = (@Subtotal - @Discount) * 0.08; -- 8% tax
        SET @Total = @Subtotal - @Discount + @Tax;

        IF @GenerateInvoice = 1
        BEGIN
            INSERT INTO dbo.BillingInvoices (
                TenantId,
                InvoiceNumber,
                BillingPeriodStart,
                BillingPeriodEnd,
                Subtotal,
                Discount,
                Tax,
                Total,
                Status,
                GeneratedUtc
            )
            VALUES (
                @TenantId,
                'INV-' + FORMAT(@TenantId, '00000') + '-' + FORMAT(SYSUTCDATETIME(), 'yyyyMMdd'),
                @BillingPeriodStart,
                @BillingPeriodEnd,
                @Subtotal,
                @Discount,
                @Tax,
                @Total,
                'Pending',
                SYSUTCDATETIME()
            );
        END

        SELECT 
            @TenantId AS TenantId,
            @BillingPeriodStart AS PeriodStart,
            @BillingPeriodEnd AS PeriodEnd,
            @Subtotal AS Subtotal,
            @DiscountPercent AS DiscountPercent,
            @Discount AS Discount,
            @Tax AS Tax,
            @Total AS Total,
            (SELECT * FROM @UsageSummary FOR JSON PATH) AS UsageBreakdown;

        RETURN 0;
    END TRY
    BEGIN CATCH
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        RAISERROR(@ErrorMessage, 16, 1);
        RETURN -1;
    END CATCH
END;

CREATE PROCEDURE dbo.sp_CalculateBill
    @TenantId INT,
    @BillingPeriodStart DATETIME2 = NULL,
    @BillingPeriodEnd DATETIME2 = NULL,
    @GenerateInvoice BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();

    IF @Debug = 1
        PRINT 'Starting chain-of-thought reasoning for problem ' + CAST(@ProblemId AS NVARCHAR(36));

    -- PARADIGM-COMPLIANT: Generate reasoning steps in a table, then use CLR aggregate
    -- This replaces the WHILE loop with a set-based operation
    DECLARE @ReasoningSteps TABLE (
        StepNumber INT,
        Prompt NVARCHAR(MAX),
        Response NVARCHAR(MAX),
        ResponseVector VECTOR(1998),
        Confidence FLOAT,
        StepTime DATETIME2
    );

    -- Generate all reasoning steps (could be parallelized)
    DECLARE @CurrentStep INT = 1;
    DECLARE @CurrentPrompt NVARCHAR(MAX) = @InitialPrompt;

    WHILE @CurrentStep <= @MaxSteps
    BEGIN
        DECLARE @StepStartTime DATETIME2 = SYSUTCDATETIME();
        DECLARE @StepResponse NVARCHAR(MAX);
        DECLARE @ResponseEmbedding VECTOR(1998);
        DECLARE @EmbeddingDim INT;

        -- Generate reasoning step using text generation
        EXEC dbo.sp_GenerateText
            @prompt = @CurrentPrompt,
            @max_tokens = 100,
            @temperature = @Temperature,
            @GeneratedText = @StepResponse OUTPUT;

        -- Get embedding for coherence analysis
        EXEC dbo.sp_TextToEmbedding
            @text = @StepResponse,
            @ModelName = NULL,
            @embedding = @ResponseEmbedding OUTPUT,
            @dimension = @EmbeddingDim OUTPUT;

        -- Calculate confidence based on response coherence (simplified)
        DECLARE @Confidence FLOAT = 0.8;

        -- Store step
        INSERT INTO @ReasoningSteps (StepNumber, Prompt, Response, ResponseVector, Confidence, StepTime)
        VALUES (@CurrentStep, @CurrentPrompt, @StepResponse, @ResponseEmbedding, @Confidence, @StepStartTime);

        -- Prepare next step prompt
        SET @CurrentPrompt = 'Continue reasoning: ' + @StepResponse;
        SET @CurrentStep = @CurrentStep + 1;

        IF @Debug = 1
            PRINT 'Completed step ' + CAST(@CurrentStep - 1 AS NVARCHAR(10));
    END

    -- PARADIGM-COMPLIANT: Use CLR aggregate to analyze reasoning chain coherence
    DECLARE @CoherenceAnalysis NVARCHAR(MAX);

    SELECT @CoherenceAnalysis = dbo.ChainOfThoughtCoherence(
        StepNumber,
        CAST(ResponseVector AS NVARCHAR(MAX))
    )
    FROM @ReasoningSteps;

    -- Store final reasoning chain with coherence analysis
    INSERT INTO dbo.ReasoningChains (
        ProblemId,
        ReasoningType,
        ChainData,
        TotalSteps,
        DurationMs,
        CoherenceMetrics,
        CreatedAt
    )
    VALUES (
        @ProblemId,
        'chain_of_thought',
        (SELECT * FROM @ReasoningSteps FOR JSON PATH),
        @MaxSteps,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        @CoherenceAnalysis,
        SYSUTCDATETIME()
    );

    -- Return reasoning chain with coherence analysis
    SELECT
        @ProblemId AS ProblemId,
        'chain_of_thought' AS ReasoningType,
        StepNumber,
        Prompt,
        Response,
        Confidence,
        StepTime,
        @CoherenceAnalysis AS CoherenceAnalysis
    FROM @ReasoningSteps
    ORDER BY StepNumber;

    IF @Debug = 1
    BEGIN
        PRINT 'Chain-of-thought reasoning completed';
        PRINT 'Coherence Analysis: ' + ISNULL(@CoherenceAnalysis, 'N/A');
    END
END;

CREATE PROCEDURE dbo.sp_ChainOfThoughtReasoning
    @ProblemId UNIQUEIDENTIFIER,
    @InitialPrompt NVARCHAR(MAX),
    @MaxSteps INT = 5,
    @Temperature FLOAT = 0.7,
    @Debug BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    IF @query_embedding IS NULL
    BEGIN
        ;THROW 50010, 'Query embedding cannot be NULL.', 1;
    END;

    IF @activation_threshold IS NULL OR @activation_threshold <= -1.0 OR @activation_threshold > 1.0
    BEGIN
        ;THROW 50011, 'Activation threshold must be within (-1, 1].', 1;
    END;

    DECLARE @start_time DATETIME2 = SYSUTCDATETIME();
    DECLARE @max_distance FLOAT = 1.0 - @activation_threshold;

    IF @max_distance <= 0
    BEGIN
        ;THROW 50012, 'Activation threshold too high for cosine similarity search.', 1;
    END;

    PRINT 'COGNITIVE ACTIVATION: Atom embeddings firing based on cosine similarity';
    PRINT '  Threshold: ' + CAST(@activation_threshold AS NVARCHAR(10)) + ' | Max candidates: ' + CAST(@max_activated AS NVARCHAR(10));

    DECLARE @activated TABLE (
        AtomEmbeddingId BIGINT PRIMARY KEY,
        AtomId BIGINT NOT NULL,
        ActivationStrength FLOAT NOT NULL
    );

    INSERT INTO @activated (AtomEmbeddingId, AtomId, ActivationStrength)
    SELECT TOP (@max_activated)
        ae.AtomEmbeddingId,
        ae.AtomId,
        1.0 - VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_embedding) AS ActivationStrength
    FROM dbo.AtomEmbeddings AS ae
    WHERE ae.EmbeddingVector IS NOT NULL
      AND VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_embedding) <= @max_distance
    ORDER BY VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_embedding) ASC;

    DECLARE @activated_count INT = @@ROWCOUNT;
    PRINT '  Activated nodes: ' + CAST(@activated_count AS NVARCHAR(10));

    SELECT
        ae.AtomEmbeddingId,
        ae.AtomId,
        a.Modality,
        a.Subtype,
        a.SourceType,
        a.SourceUri,
        a.CanonicalText,
        act.ActivationStrength,
        CASE
            WHEN act.ActivationStrength >= 0.95 THEN 'VERY_HIGH'
            WHEN act.ActivationStrength >= 0.90 THEN 'HIGH'
            WHEN act.ActivationStrength >= 0.85 THEN 'MEDIUM'
            ELSE 'LOW'
        END AS ActivationLevel
    FROM @activated AS act
    INNER JOIN dbo.AtomEmbeddings AS ae ON ae.AtomEmbeddingId = act.AtomEmbeddingId
    INNER JOIN dbo.Atoms AS a ON a.AtomId = act.AtomId
    ORDER BY act.ActivationStrength DESC;

    DECLARE @DurationMs INT = DATEDIFF(MILLISECOND, @start_time, SYSUTCDATETIME());
    DECLARE @input_json JSON = JSON_OBJECT('activationThreshold': @activation_threshold, 'maxActivated': @max_activated);
    DECLARE @output_json JSON = JSON_OBJECT('activatedCount': @activated_count);
    DECLARE @output_metadata JSON = JSON_OBJECT('status': 'completed', 'durationMs': @DurationMs);
    DECLARE @InferenceId BIGINT;

    INSERT INTO dbo.InferenceRequests (TaskType, InputData, ModelsUsed, EnsembleStrategy, OutputData, OutputMetadata, TotalDurationMs)
    VALUES (
        'cognitive_activation',
        CAST(@input_json AS NVARCHAR(MAX)),
        'atom_embeddings',
        'cognitive_activation',
        CAST(@output_json AS NVARCHAR(MAX)),
        CAST(@output_metadata AS NVARCHAR(MAX)),
        @DurationMs
    );

    SET @InferenceId = SCOPE_IDENTITY();
    PRINT ' Cognitive activation complete - Inference ID: ' + CAST(@InferenceId AS NVARCHAR(20));
END

CREATE PROCEDURE dbo.sp_CognitiveActivation
    @query_embedding VECTOR(1998),
    @activation_threshold FLOAT = 0.8,
    @max_activated INT = 50
AS

BEGIN SET NOCOUNT ON;
PRINT 'KNOWLEDGE COMPARISON: Model ' + CAST(@ModelAId AS NVARCHAR(20)) + ' vs Model ' + CAST(@ModelBId AS NVARCHAR(20));
SELECT 'Model A' AS model_name, @ModelAId AS model_id, COUNT(*) AS total_tensor_atoms, AVG(CAST(ImportanceScore AS FLOAT)) AS avg_importance, STDEV(CAST(ImportanceScore AS FLOAT)) AS stdev_importance, MIN(ImportanceScore) AS min_importance, MAX(ImportanceScore) AS max_importance FROM dbo.TensorAtoms WHERE ModelId = @ModelAId
UNION ALL
SELECT 'Model B' AS model_name, @ModelBId AS model_id, COUNT(*) AS total_tensor_atoms, AVG(CAST(ImportanceScore AS FLOAT)) AS avg_importance, STDEV(CAST(ImportanceScore AS FLOAT)) AS stdev_importance, MIN(ImportanceScore) AS min_importance, MAX(ImportanceScore) AS max_importance FROM dbo.TensorAtoms WHERE ModelId = @ModelBId;
SELECT 'Layer Comparison' AS analysis_type, COALESCE(a.LayerIdx, b.LayerIdx) AS layer_idx, a.LayerType AS model_a_type, b.LayerType AS model_b_type, a.ParameterCount AS model_a_parameters, b.ParameterCount AS model_b_parameters, a.TensorShape AS model_a_shape, b.TensorShape AS model_b_shape FROM dbo.ModelLayers AS a FULL OUTER JOIN dbo.ModelLayers AS b ON a.LayerIdx = b.LayerIdx AND a.ModelId = @ModelAId AND b.ModelId = @ModelBId WHERE a.ModelId = @ModelAId OR b.ModelId = @ModelBId ORDER BY COALESCE(a.LayerIdx, b.LayerIdx);
SELECT 'Coefficient Coverage' AS analysis_type, stats.model_id, stats.total_coefficients, stats.avg_value, stats.max_value, stats.min_value FROM ( SELECT ta.ModelId AS model_id, COUNT(tc.Coefficient) AS total_coefficients, AVG(CAST(tc.Coefficient AS FLOAT)) AS avg_value, MAX(tc.Coefficient) AS max_value, MIN(tc.Coefficient) AS min_value FROM dbo.TensorAtoms AS ta LEFT JOIN dbo.TensorAtomCoefficients AS tc ON tc.TensorAtomId = ta.TensorAtomId WHERE ta.ModelId IN (@ModelAId, @ModelBId) GROUP BY ta.ModelId ) AS stats ORDER BY stats.model_id;
PRINT ' Knowledge comparison complete'; END

CREATE PROCEDURE dbo.sp_CompareModelKnowledge
    @ModelAId INT,
    @ModelBId INT
AS

BEGIN SET NOCOUNT ON;
PRINT 'Computing semantic features for all embeddings...';
DECLARE @atom_embedding_id BIGINT; DECLARE @count INT = 0;
DECLARE cursor_embeddings CURSOR FOR SELECT ae.AtomEmbeddingId FROM dbo.AtomEmbeddings AS ae INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId WHERE a.Modality = 'text' AND a.AtomicValue IS NOT NULL; -- Changed: CanonicalText Modality filter
OPEN cursor_embeddings; FETCH NEXT FROM cursor_embeddings INTO @atom_embedding_id;
WHILE @@FETCH_STATUS = 0 BEGIN EXEC dbo.sp_ComputeSemanticFeatures @atom_embedding_id = @atom_embedding_id;
SET @count = @count + 1; IF @count % 100 = 0 PRINT ' Processed ' + CAST(@count AS VARCHAR) + ' embeddings...';
FETCH NEXT FROM cursor_embeddings INTO @atom_embedding_id; END;
CLOSE cursor_embeddings; DEALLOCATE cursor_embeddings;
PRINT ' Computed semantic features for ' + CAST(@count AS VARCHAR) + ' embeddings';
SELECT 'Technical' as topic, AVG(TopicTechnical) as avg_score, MAX(TopicTechnical) as max_score, COUNT(CASE WHEN TopicTechnical > 0.5 THEN 1 END) as high_score_count FROM dbo.SemanticFeatures
UNION ALL
SELECT 'Business' as topic, AVG(TopicBusiness) as avg_score, MAX(TopicBusiness) as max_score, COUNT(CASE WHEN TopicBusiness > 0.5 THEN 1 END) as high_score_count FROM dbo.SemanticFeatures
UNION ALL
SELECT 'Scientific' as topic, AVG(TopicScientific) as avg_score, MAX(TopicScientific) as max_score, COUNT(CASE WHEN TopicScientific > 0.5 THEN 1 END) as high_score_count FROM dbo.SemanticFeatures
UNION ALL
SELECT 'Creative' as topic, AVG(TopicCreative) as avg_score, MAX(TopicCreative) as max_score, COUNT(CASE WHEN TopicCreative > 0.5 THEN 1 END) as high_score_count FROM dbo.SemanticFeatures; END

BEGIN
    SET NOCOUNT ON;

    DECLARE @text NVARCHAR(MAX);
    SELECT
        @text = CONVERT(NVARCHAR(256), a.AtomicValue) -- Derived from AtomicValue
    FROM dbo.AtomEmbeddings AS ae
    INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId
    WHERE ae.AtomEmbeddingId = @atom_embedding_id;

    IF @text IS NULL
    BEGIN
        PRINT 'Atom embedding not found or lacks canonical text: ' + CAST(@atom_embedding_id AS NVARCHAR(40));
        RETURN;
    END;

    DECLARE @features_json NVARCHAR(MAX) = dbo.clr_SemanticFeaturesJson(@text);

    IF @features_json IS NULL
    BEGIN
        RAISERROR('Semantic feature computation failed for AtomEmbeddingId %d.', 16, 1, @atom_embedding_id);
        RETURN;
    END;

    DECLARE @topic_technical FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.topicTechnical') AS FLOAT);
    DECLARE @topic_business FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.topicBusiness') AS FLOAT);
    DECLARE @topic_scientific FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.topicScientific') AS FLOAT);
    DECLARE @topic_creative FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.topicCreative') AS FLOAT);
    DECLARE @sentiment_score FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.sentimentScore') AS FLOAT);
    DECLARE @formality_score FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.formalityScore') AS FLOAT);
    DECLARE @complexity_score FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.complexityScore') AS FLOAT);
    DECLARE @temporal_relevance FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.temporalRelevance') AS FLOAT);
    DECLARE @text_length INT = TRY_CAST(JSON_VALUE(@features_json, '$.textLength') AS INT);
    DECLARE @word_count INT = TRY_CAST(JSON_VALUE(@features_json, '$.wordCount') AS INT);
    DECLARE @avg_word_length FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.avgWordLength') AS FLOAT);
    DECLARE @unique_word_ratio FLOAT = TRY_CAST(JSON_VALUE(@features_json, '$.uniqueWordRatio') AS FLOAT);

    SET @topic_technical = ISNULL(@topic_technical, 0);
    SET @topic_business = ISNULL(@topic_business, 0);
    SET @topic_scientific = ISNULL(@topic_scientific, 0);
    SET @topic_creative = ISNULL(@topic_creative, 0);
    SET @sentiment_score = ISNULL(@sentiment_score, 0);
    SET @formality_score = ISNULL(@formality_score, 0.3);
    SET @complexity_score = ISNULL(@complexity_score, 0.3);
    SET @temporal_relevance = ISNULL(@temporal_relevance, 1.0);
    SET @text_length = ISNULL(@text_length, LEN(@text));
    SET @word_count = ISNULL(@word_count, CASE WHEN LEN(LTRIM(RTRIM(@text))) = 0 THEN 0 ELSE LEN(@text) - LEN(REPLACE(@text, ' ', '')) + 1 END);
    SET @avg_word_length = ISNULL(@avg_word_length, CASE WHEN @word_count = 0 THEN 0 ELSE CAST(@text_length AS FLOAT) / NULLIF(@word_count, 0) END);
    SET @unique_word_ratio = ISNULL(@unique_word_ratio, 0);
    DECLARE @reference_date DATETIME2 = SYSUTCDATETIME();

    IF EXISTS (SELECT 1 FROM dbo.SemanticFeatures WHERE AtomEmbeddingId = @atom_embedding_id)
    BEGIN
        UPDATE dbo.SemanticFeatures
        SET
            TopicTechnical = @topic_technical,
            TopicBusiness = @topic_business,
            TopicScientific = @topic_scientific,
            TopicCreative = @topic_creative,
            SentimentScore = @sentiment_score,
            FormalityScore = @formality_score,
            ComplexityScore = @complexity_score,
            TemporalRelevance = @temporal_relevance,
            ReferenceDate = @reference_date,
            TextLength = @text_length,
            WordCount = @word_count,
            AvgWordLength = @avg_word_length,
            UniqueWordRatio = @unique_word_ratio,
            ComputedAt = SYSUTCDATETIME()
        WHERE AtomEmbeddingId = @atom_embedding_id;
    END
    ELSE
    BEGIN
        INSERT INTO dbo.SemanticFeatures (
            AtomEmbeddingId,
            TopicTechnical, TopicBusiness, TopicScientific, TopicCreative,
            SentimentScore, FormalityScore, ComplexityScore,
            TemporalRelevance, ReferenceDate,
            TextLength, WordCount, AvgWordLength, UniqueWordRatio,
            ComputedAt
        )
        VALUES (
            @atom_embedding_id,
            @topic_technical, @topic_business, @topic_scientific, @topic_creative,
            @sentiment_score, @formality_score, @complexity_score,
            @temporal_relevance, @reference_date,
            @text_length, @word_count, @avg_word_length, @unique_word_ratio,
            SYSUTCDATETIME()
        );
    END;
END

BEGIN
    SET NOCOUNT ON;

    -- Input validation
    IF @input_vector IS NULL
        THROW 50001, 'Input vector cannot be NULL', 1;

    IF @input_dimension <= 0 OR @input_dimension > 1998
        THROW 50002, 'Input dimension must be between 1 and 1998', 1;

    -- Simple projection using first 3 dimensions with normalization
    -- For production, this should use PCA or t-SNE via CLR functions
    DECLARE @vectorJson NVARCHAR(MAX) = CAST(@input_vector AS NVARCHAR(MAX));
    DECLARE @values TABLE (idx INT, value FLOAT);

    -- Parse first 3 values from JSON array
    INSERT INTO @values (idx, value)
    SELECT TOP 3
        ROW_NUMBER() OVER (ORDER BY (SELECT NULL)) - 1,
        CAST([value] AS FLOAT)
    FROM OPENJSON(@vectorJson);

    -- Extract coordinates with normalization
    SELECT
        @output_x = COALESCE(MAX(CASE WHEN idx = 0 THEN value END), 0.0),
        @output_y = COALESCE(MAX(CASE WHEN idx = 1 THEN value END), 0.0),
        @output_z = COALESCE(MAX(CASE WHEN idx = 2 THEN value END), 0.0)
    FROM @values;

    -- Normalize to prevent spatial index overflow
    DECLARE @magnitude FLOAT = SQRT(@output_x * @output_x + @output_y * @output_y + @output_z * @output_z);
    IF @magnitude > 0
    BEGIN
        SET @output_x = @output_x / @magnitude * 100.0;  -- Scale to 100 range
        SET @output_y = @output_y / @magnitude * 100.0;
        SET @output_z = @output_z / @magnitude * 100.0;
    END;
END;

-- =============================================
-- sp_ComputeSpatialProjection: 3D Spatial Projection from High-Dimensional Vectors
-- Projects high-dimensional embeddings to 3D GEOMETRY space using PCA/SVD
-- Enterprise-grade implementation with proper error handling
-- =============================================
CREATE PROCEDURE [dbo].[sp_ComputeSpatialProjection]
    @input_vector VECTOR(1998),
    @input_dimension INT,
    @output_x FLOAT OUTPUT,
    @output_y FLOAT OUTPUT,
    @output_z FLOAT OUTPUT
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @ToolList NVARCHAR(MAX);
    DECLARE @ToolSelectionPrompt NVARCHAR(MAX);
    DECLARE @ToolSelectionResult NVARCHAR(MAX);
    DECLARE @SelectedToolName NVARCHAR(128);
    DECLARE @SelectedToolParams NVARCHAR(MAX);
    DECLARE @ToolExecutionResult NVARCHAR(MAX);
    DECLARE @SynthesisPrompt NVARCHAR(MAX);
    DECLARE @FinalAnswer NVARCHAR(MAX);

    BEGIN TRY
        -- STEP 1: Get the list of available tools for the LLM to choose from.
        SELECT @ToolList = (
            SELECT ToolName, Description, ParametersJson
            FROM dbo.AgentTools
            WHERE IsEnabled = 1
            FOR JSON PATH
        );

        IF @ToolList IS NULL OR @ToolList = ''
        BEGIN
            RAISERROR('No tools are available for the agent.', 16, 1);
            RETURN;
        END;

        -- STEP 2: Tool Selection (Decide)
        -- Ask the LLM to choose a tool based on the user's prompt.
        SET @ToolSelectionPrompt = N'
You are a helpful AI assistant with access to a set of tools. Your task is to choose the single best tool to answer the user''s prompt.
Respond with a JSON object containing the "tool_name" and the "parameters" to call it with.

USER PROMPT:
"' + @Prompt + N'"

AVAILABLE TOOLS:
' + @ToolList + N'

Based on the user prompt, which tool should you use?

RESPONSE (JSON only):
';
        IF @Debug = 1 PRINT 'Tool Selection Prompt: ' + @ToolSelectionPrompt;

        -- Call the text generation model to get the tool selection
        DECLARE @GenerationResult TABLE (GeneratedText NVARCHAR(MAX));
        INSERT INTO @GenerationResult
        EXEC dbo.sp_GenerateText @prompt = @ToolSelectionPrompt, @temperature = 0.0;

        SELECT TOP 1 @ToolSelectionResult = GeneratedText FROM @GenerationResult;

        IF @Debug = 1 PRINT 'Tool Selection Result: ' + @ToolSelectionResult;

        -- Parse the LLM's decision
        SELECT
            @SelectedToolName = JSON_VALUE(@ToolSelectionResult, '$.tool_name'),
            @SelectedToolParams = JSON_QUERY(@ToolSelectionResult, '$.parameters');

        IF @SelectedToolName IS NULL
        BEGIN
            -- If the model didn't pick a tool, maybe it can answer directly.
            -- For now, we'll treat this as an error.
            RAISERROR('The model did not select a tool to execute.', 16, 1);
            RETURN;
        END;

        -- STEP 3: Tool Execution (Act)
        -- This is a simplified dispatcher. A real implementation would be more robust.
        IF @SelectedToolName = 'analyze_system_state'
        BEGIN
            -- The tool returns a table-valued function, query it directly
            SELECT @ToolExecutionResult = (
                SELECT AnalysisJson 
                FROM dbo.fn_clr_AnalyzeSystemState(NULL) 
                FOR JSON PATH, WITHOUT_ARRAY_WRAPPER
            );
        END
        -- ELSE IF @SelectedToolName = 'another_tool' ...
        ELSE
        BEGIN
            RAISERROR('Selected tool "%s" is not implemented in the dispatcher.', 16, 1, @SelectedToolName);
            RETURN;
        END;

        IF @Debug = 1 PRINT 'Tool Execution Result: ' + @ToolExecutionResult;

        -- STEP 4: Response Synthesis
        -- Ask the LLM to generate a human-readable answer based on the tool's output.
        SET @SynthesisPrompt = N'
You are a helpful AI assistant.
A user asked the following question: "' + @Prompt + N'"
To answer this, you ran the "' + @SelectedToolName + N'" tool and got the following data:
' + @ToolExecutionResult + N'

Based on this data, please provide a clear, concise, and helpful answer to the user''s original question.
Do not just repeat the data; explain what it means.
';
        IF @Debug = 1 PRINT 'Synthesis Prompt: ' + @SynthesisPrompt;

        DELETE FROM @GenerationResult;
        INSERT INTO @GenerationResult
        EXEC dbo.sp_GenerateText @prompt = @SynthesisPrompt, @temperature = 0.7;

        SELECT TOP 1 @FinalAnswer = GeneratedText FROM @GenerationResult;

        -- Return the final answer
        SELECT @FinalAnswer AS FinalAnswer;

    END TRY
    BEGIN CATCH
        -- Error handling
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        RAISERROR('An error occurred in the agent conversation: %s', 16, 1, @ErrorMessage);
    END CATCH;
END;

CREATE PROCEDURE dbo.sp_Converse
    @Prompt NVARCHAR(MAX),
    @Debug BIT = 0
AS

BEGIN SET NOCOUNT ON;
PRINT 'CROSS-MODAL INFERENCE'; PRINT ' Text filter: ' + ISNULL(@text_query, '(none)'); PRINT ' Target modality: ' + ISNULL(@modality_filter, 'all');
IF @spatial_query_x IS NOT NULL AND @spatial_query_y IS NOT NULL BEGIN DECLARE @z FLOAT = ISNULL(@spatial_query_z, 0); DECLARE @query_wkt NVARCHAR(200) = CONCAT('POINT (', @spatial_query_x, ' ', @spatial_query_y, ' ', @z, ')'); DECLARE @query_pt GEOMETRY = geometry::STGeomFromText(@query_wkt, 0);
SELECT TOP (@top_k) ae.AtomEmbeddingId, ae.AtomId, a.Modality, a.Subtype, a.SourceType, a.SourceUri, a.CanonicalText, ae.EmbeddingType, ae.ModelId, ae.SpatialKey.STDistance(@query_pt) AS SpatialDistance FROM dbo.AtomEmbeddings AS ae INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId WHERE ae.SpatialKey IS NOT NULL AND (@modality_filter IS NULL OR a.Modality = @modality_filter) AND (@text_query IS NULL OR CONVERT(NVARCHAR(256), a.AtomicValue) LIKE '%' + @text_query + '%') -- Changed: CanonicalText AtomicValue ORDER BY ae.SpatialKey.STDistance(@query_pt); END ELSE BEGIN SELECT TOP (@top_k) ae.AtomEmbeddingId, ae.AtomId, a.Modality, a.Subtype, a.Modality AS SourceType, -- Replaced NULL AS SourceUri, -- Removed CONVERT(NVARCHAR(256), a.AtomicValue) AS CanonicalText, -- Derived ae.AtomEmbeddingId, ae.ModelId FROM dbo.Atoms a LEFT JOIN dbo.AtomEmbeddings ae ON a.AtomId = ae.AtomId WHERE (@modality_filter IS NULL OR a.Modality = @modality_filter) AND (@text_query IS NULL OR CONVERT(NVARCHAR(256), a.AtomicValue) LIKE '%' + @text_query + '%') -- Changed ORDER BY NEWID(); END;
PRINT ' Cross-modal results returned'; END

CREATE PROCEDURE dbo.sp_CrossModalQuery
    @text_query NVARCHAR(MAX) = NULL,
    @spatial_query_x FLOAT = NULL,
    @spatial_query_y FLOAT = NULL,
    @spatial_query_z FLOAT = NULL,
    @modality_filter NVARCHAR(50) = NULL,
    @top_k INT = 10
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY DECLARE @DuplicateGroups TABLE ( PrimaryAtomId BIGINT, DuplicateAtomId BIGINT, Similarity FLOAT );
-- Find duplicate pairs using self-join on embeddings INSERT INTO @DuplicateGroups SELECT TOP (@BatchSize) ae1.AtomId AS PrimaryAtomId, ae2.AtomId AS DuplicateAtomId, 1.0 - VECTOR_DISTANCE('cosine', ae1.EmbeddingVector, ae2.EmbeddingVector) AS Similarity FROM dbo.AtomEmbeddings ae1 INNER JOIN dbo.AtomEmbeddings ae2 ON ae1.ModelId = ae2.ModelId AND ae1.AtomId < ae2.AtomId -- Avoid duplicate pairs INNER JOIN dbo.Atoms a1 ON ae1.AtomId = a1.AtomId INNER JOIN dbo.Atoms a2 ON ae2.AtomId = a2.AtomId WHERE a1.TenantId = @TenantId AND a2.TenantId = @TenantId AND (1.0 - VECTOR_DISTANCE('cosine', ae1.EmbeddingVector, ae2.EmbeddingVector)) >= @SimilarityThreshold ORDER BY Similarity DESC;
-- Return duplicate groups SELECT dg.PrimaryAtomId, dg.DuplicateAtomId, dg.Similarity, a1.ContentHash AS PrimaryHash, a2.ContentHash AS DuplicateHash, a1.CreatedAt AS PrimaryCreated, a2.CreatedAt AS DuplicateCreated FROM @DuplicateGroups dg INNER JOIN dbo.Atoms a1 ON dg.PrimaryAtomId = a1.AtomId INNER JOIN dbo.Atoms a2 ON dg.DuplicateAtomId = a2.AtomId ORDER BY dg.Similarity DESC;
RETURN 0; END TRY BEGIN CATCH DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE(); RAISERROR(@ErrorMessage, 16, 1); RETURN -1; END CATCH END;

CREATE PROCEDURE dbo.sp_DetectDuplicates
    @SimilarityThreshold FLOAT = 0.95,
    @BatchSize INT = 1000,
    @TenantId INT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @DiscoveredCount INT = 0;
    DECLARE @BoundCount INT = 0;
    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();

    BEGIN TRY
        BEGIN TRANSACTION;

        -- Phase 1: Discover concepts
        DECLARE @DiscoveredConcepts TABLE (
            Centroid VARBINARY(MAX),
            AtomCount INT,
            Coherence FLOAT,
            HilbertValue INT
        );

        INSERT INTO @DiscoveredConcepts
        SELECT * FROM dbo.fn_DiscoverConcepts(
            @MinClusterSize,
            @CoherenceThreshold,
            @MaxConcepts,
            @TenantId
        );

        SET @DiscoveredCount = @@ROWCOUNT;

        IF @DryRun = 0
        BEGIN
            -- Temp table to capture generated ConceptIds
            DECLARE @InsertedConcepts TABLE (
                ConceptId BIGINT,
                Centroid VARBINARY(MAX),
                AtomCount INT,
                Coherence FLOAT,
                HilbertValue INT
            );

            -- Persist discovered concepts and capture generated IDs
            INSERT INTO provenance.Concepts (
                ConceptName,
                Description,
                CentroidVector,
                Centroid,
                VectorDimension,
                MemberCount,
                AtomCount,
                CoherenceScore,
                Coherence,
                HilbertValue,
                DiscoveryMethod,
                ModelId,
                TenantId
            )
            OUTPUT 
                INSERTED.ConceptId,
                INSERTED.Centroid,
                INSERTED.AtomCount,
                INSERTED.Coherence,
                INSERTED.HilbertValue
            INTO @InsertedConcepts
            SELECT 
                'Cluster_' + CAST(ROW_NUMBER() OVER (ORDER BY Coherence DESC) AS NVARCHAR(50)),
                'Auto-discovered concept cluster',
                Centroid,
                Centroid,
                0, -- VectorDimension - will be computed
                AtomCount,
                AtomCount,
                Coherence,
                Coherence,
                HilbertValue,
                'DBSCAN_Spatial',
                1, -- Default ModelId - adjust as needed
                @TenantId
            FROM @DiscoveredConcepts;

            -- Track discovery in evolution log
            INSERT INTO provenance.ConceptEvolution (
                ConceptId,
                PreviousCentroid,
                NewCentroid,
                CentroidShift,
                AtomCountDelta,
                CoherenceDelta,
                EvolutionType,
                TenantId
            )
            SELECT 
                ConceptId,
                NULL, -- No previous centroid for new discoveries
                Centroid,
                NULL, -- No shift for new concepts
                AtomCount,
                NULL, -- No delta for new concepts
                'Discovered',
                @TenantId
            FROM @InsertedConcepts;
        END

        -- Phase 2: Bind atoms to concepts (use inserted concepts for binding)
        DECLARE @ConceptsToBind TABLE (ConceptId BIGINT);
        INSERT INTO @ConceptsToBind SELECT ConceptId FROM @InsertedConcepts;

        DECLARE @AtomBindings TABLE (
            AtomId BIGINT,
            ConceptId BIGINT,
            Similarity FLOAT,
            IsPrimary BIT
        );

        -- For each concept, find matching atoms
        DECLARE @CurrentConceptId BIGINT;
        DECLARE @ConceptCentroid VARBINARY(MAX);

        DECLARE concept_cursor CURSOR LOCAL FAST_FORWARD FOR
        SELECT ConceptId, Centroid FROM @InsertedConcepts;

        OPEN concept_cursor;
        FETCH NEXT FROM concept_cursor INTO @CurrentConceptId, @ConceptCentroid;

        WHILE @@FETCH_STATUS = 0
        BEGIN
            -- Use enterprise CLR function that properly handles binary VECTOR format
            -- fn_BindAtomsToCentroid accepts VARBINARY and handles VECTOR_DISTANCE internally
            INSERT INTO @AtomBindings (AtomId, ConceptId, Similarity, IsPrimary)
            SELECT 
                AtomId,
                @CurrentConceptId AS ConceptId,
                Similarity,
                0 AS IsPrimary -- Will set primary in second pass
            FROM dbo.fn_BindAtomsToCentroid(@ConceptCentroid, @SimilarityThreshold, @TenantId);

            FETCH NEXT FROM concept_cursor INTO @CurrentConceptId, @ConceptCentroid;
        END

        CLOSE concept_cursor;
        DEALLOCATE concept_cursor;

        -- Set primary concept (highest similarity per atom)
        WITH RankedBindings AS (
            SELECT 
                AtomId,
                ConceptId,
                Similarity,
                ROW_NUMBER() OVER (PARTITION BY AtomId ORDER BY Similarity DESC) AS Rank
            FROM @AtomBindings
        )
        UPDATE ab
        SET IsPrimary = CASE WHEN rb.Rank = 1 THEN 1 ELSE 0 END
        FROM @AtomBindings ab
        INNER JOIN RankedBindings rb ON ab.AtomId = rb.AtomId AND ab.ConceptId = rb.ConceptId;

        SET @BoundCount = (SELECT COUNT(*) FROM @AtomBindings);

        IF @DryRun = 0
        BEGIN
            -- Persist atom-concept bindings
            INSERT INTO provenance.AtomConcepts (
                AtomId,
                ConceptId,
                Similarity,
                IsPrimary,
                TenantId
            )
            SELECT 
                AtomId,
                ConceptId,
                Similarity,
                IsPrimary,
                @TenantId
            FROM @AtomBindings;

            -- Update concept atom counts
            UPDATE c
            SET AtomCount = (
                SELECT COUNT(DISTINCT ac.AtomId)
                FROM provenance.AtomConcepts ac
                WHERE ac.ConceptId = c.ConceptId
            )
            FROM provenance.Concepts c
            WHERE c.ConceptId IN (SELECT ConceptId FROM @DiscoveredConcepts);
        END

        COMMIT TRANSACTION;

        -- Return summary
        SELECT 
            @DiscoveredCount AS ConceptsDiscovered,
            @BoundCount AS AtomBindings,
            DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS DurationMs,
            @DryRun AS WasDryRun;

        PRINT 'Concept discovery complete: ' + 
              CAST(@DiscoveredCount AS VARCHAR(10)) + ' concepts, ' +
              CAST(@BoundCount AS VARCHAR(10)) + ' bindings';

    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0
            ROLLBACK TRANSACTION;

        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        DECLARE @ErrorSeverity INT = ERROR_SEVERITY();
        DECLARE @ErrorState INT = ERROR_STATE();

        PRINT 'sp_DiscoverAndBindConcepts ERROR: ' + @ErrorMessage;
        RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState);
    END CATCH
END;

-- sp_DiscoverAndBindConcepts: Orchestration procedure
-- Runs unsupervised learning pipeline end-to-end
-- Phase 1: Discover concepts via clustering
-- Phase 2: Bind atoms to discovered concepts

CREATE PROCEDURE dbo.sp_DiscoverAndBindConcepts
    @MinClusterSize INT = 10,
    @CoherenceThreshold FLOAT = 0.7,
    @MaxConcepts INT = 100,
    @SimilarityThreshold FLOAT = 0.6,
    @MaxConceptsPerAtom INT = 5,
    @TenantId INT = 0,
    @DryRun BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    IF @target_size_ratio <= 0 OR @target_size_ratio > 1
    BEGIN
        ;THROW 50020, 'Target size ratio must be within (0, 1].', 1;
    END;

    DECLARE @parent_exists INT = (
        SELECT COUNT(*)
        FROM dbo.Models
        WHERE ModelId = @ParentModelId
    );

    IF @parent_exists = 0
    BEGIN
        ;THROW 50021, 'Parent model does not exist.', 1;
    END;

    DECLARE @ratio_percent INT = CEILING(@target_size_ratio * 100);
    IF @ratio_percent < 1 SET @ratio_percent = 1;
    DECLARE @NewModelName NVARCHAR(200) = CONCAT('Student_', @ParentModelId, '_', @selection_strategy, '_', @ratio_percent, 'pct');
    DECLARE @layer_subset NVARCHAR(MAX) = NULL;
    DECLARE @importance_threshold FLOAT = NULL;

    IF @selection_strategy = 'layer'
    BEGIN
        DECLARE @total_layers INT = (
            SELECT COUNT(*)
            FROM dbo.ModelLayers
            WHERE ModelId = @ParentModelId
        );

        IF @total_layers = 0
        BEGIN
            ;THROW 50022, 'Parent model has no layers to extract.', 1;
        END;

        DECLARE @layers_to_take INT = CEILING(@total_layers * @target_size_ratio);
        IF @layers_to_take < 1 SET @layers_to_take = 1;

        SELECT @layer_subset = STRING_AGG(CAST(LayerIdx AS NVARCHAR(10)), ',') WITHIN GROUP (ORDER BY LayerIdx)
        FROM (
            SELECT TOP (@layers_to_take) LayerIdx
            FROM dbo.ModelLayers
            WHERE ModelId = @ParentModelId
            ORDER BY LayerIdx
        ) AS layer_selection;

        PRINT 'DYNAMIC EXTRACTION  Layer subset: ' + ISNULL(@layer_subset, '(empty)');
    END
    ELSE IF @selection_strategy = 'random'
    BEGIN
        DECLARE @total_layers_random INT = (
            SELECT COUNT(*)
            FROM dbo.ModelLayers
            WHERE ModelId = @ParentModelId
        );

        IF @total_layers_random = 0
        BEGIN
            ;THROW 50023, 'Parent model has no layers to extract.', 1;
        END;

        DECLARE @random_take INT = CEILING(@total_layers_random * @target_size_ratio);
        IF @random_take < 1 SET @random_take = 1;

        SELECT @layer_subset = STRING_AGG(CAST(LayerIdx AS NVARCHAR(10)), ',')
        FROM (
            SELECT TOP (@random_take) LayerIdx
            FROM dbo.ModelLayers
            WHERE ModelId = @ParentModelId
            ORDER BY NEWID()
        ) AS random_layers;

        PRINT 'DYNAMIC EXTRACTION  Random layer subset: ' + ISNULL(@layer_subset, '(empty)');
    END
    ELSE
    BEGIN
        DECLARE @total_atoms INT = (
            SELECT COUNT(*)
            FROM dbo.TensorAtoms
            WHERE ModelId = @ParentModelId
        );

        IF @total_atoms = 0
        BEGIN
            PRINT 'Parent model has no tensor atoms; falling back to full copy.';
            SET @importance_threshold = NULL;
        END
        ELSE
        BEGIN
            DECLARE @atoms_to_take INT = CEILING(@total_atoms * @target_size_ratio);
            IF @atoms_to_take < 1 SET @atoms_to_take = 1;

            SELECT @importance_threshold = MIN(ImportanceScore)
            FROM (
                SELECT TOP (@atoms_to_take) ImportanceScore
                FROM dbo.TensorAtoms
                WHERE ModelId = @ParentModelId
                  AND ImportanceScore IS NOT NULL
                ORDER BY ImportanceScore DESC
            ) AS ranked;

            IF @importance_threshold IS NULL
            BEGIN
                PRINT 'Importance scores missing; no threshold applied.';
            END;
        END;

        PRINT 'DYNAMIC EXTRACTION  Importance threshold: ' + COALESCE(CAST(@importance_threshold AS NVARCHAR(32)), 'none');
    END;

    EXEC dbo.sp_ExtractStudentModel
        @ParentModelId = @ParentModelId,
        @layer_subset = @layer_subset,
        @importance_threshold = @importance_threshold,
        @NewModelName = @NewModelName;
END

