BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @FusedStream VARBINARY(MAX);

    IF @Debug = 1
        PRINT 'Starting multi-modal stream fusion for streams: ' + @StreamIds;

    -- Parse stream IDs
    CREATE TABLE #StreamList (StreamId INT, Weight FLOAT);

    INSERT INTO #StreamList (StreamId, Weight)
    SELECT
        CAST(value AS INT) AS StreamId,
        CASE
            WHEN @Weights IS NOT NULL THEN JSON_VALUE(@Weights, CONCAT('$[', ROW_NUMBER() OVER (ORDER BY (SELECT NULL)) - 1, ']'))
            ELSE 1.0
        END AS Weight
    FROM STRING_SPLIT(@StreamIds, ',');

    -- Validate streams exist
    IF NOT EXISTS (SELECT 1 FROM #StreamList sl INNER JOIN dbo.StreamOrchestrationResults sor ON sl.StreamId = sor.Id)
    BEGIN
        RAISERROR('One or more stream IDs not found', 16, 1);
        DROP TABLE #StreamList;
        RETURN;
    END

    -- Perform fusion based on type
    IF @FusionType = 'weighted_average'
    BEGIN
        -- Weighted average fusion
        SELECT @FusedStream = dbo.clr_StreamOrchestrator(
            dc.AtomId,
            DATEADD(MICROSECOND, ROW_NUMBER() OVER (ORDER BY dc.AtomId) * 100, '2024-01-01'), -- Synthetic timestamp
            dc.Weight * sl.Weight
        )
        FROM #StreamList sl
        CROSS APPLY dbo.fn_DecompressComponents(sor.ComponentStream) dc
        INNER JOIN dbo.StreamOrchestrationResults sor ON sl.StreamId = sor.Id
        GROUP BY sl.StreamId; -- Dummy grouping
    END
    ELSE IF @FusionType = 'max_pooling'
    BEGIN
        -- Max pooling fusion
        SELECT @FusedStream = dbo.clr_StreamOrchestrator(
            dc.AtomId,
            DATEADD(MICROSECOND, ROW_NUMBER() OVER (ORDER BY dc.AtomId) * 100, '2024-01-01'),
            MAX(dc.Weight) -- Take maximum weight across streams
        )
        FROM #StreamList sl
        CROSS APPLY dbo.fn_DecompressComponents(sor.ComponentStream) dc
        INNER JOIN dbo.StreamOrchestrationResults sor ON sl.StreamId = sor.Id
        GROUP BY dc.AtomId;
    END
    ELSE IF @FusionType = 'attention_fusion'
    BEGIN
        -- Attention-based fusion (using attention generation)
        DECLARE @AttentionInput NVARCHAR(MAX);
        SELECT @AttentionInput = STRING_AGG(CAST(dc.AtomId AS NVARCHAR(20)), ',')
        FROM #StreamList sl
        CROSS APPLY dbo.fn_DecompressComponents(sor.ComponentStream) dc
        INNER JOIN dbo.StreamOrchestrationResults sor ON sl.StreamId = sor.Id;

        -- Use attention mechanism for fusion
        DECLARE @FusionContextJson NVARCHAR(MAX) = CONCAT('{"fusion_type":"attention","streams":"', @StreamIds, '"}');
        DECLARE @FusionStreamId BIGINT;
        EXEC dbo.sp_GenerateWithAttention
            @ModelId = 1,
            @InputAtomIds = @AttentionInput,
            @ContextJson = @FusionContextJson,
            @MaxTokens = 100,
            @Temperature = 0.3,
            @TopK = 50,
            @TopP = 0.8,
            @AttentionHeads = 4,
            @Debug = 0;

        -- Get the fused stream (simplified)
        SELECT TOP 1 @FusedStream = ComponentStream
        FROM dbo.StreamOrchestrationResults
        WHERE Id IN (SELECT StreamId FROM #StreamList);
    END

    -- Store fusion result
    INSERT INTO dbo.StreamFusionResults (
        StreamIds,
        FusionType,
        Weights,
        FusedStream,
        ComponentCount,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @StreamIds,
        @FusionType,
        @Weights,
        @FusedStream,
        dbo.fn_GetComponentCount(@FusedStream),
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return fusion metadata
    SELECT
        @StreamIds AS StreamIds,
        @FusionType AS FusionType,
        @Weights AS Weights,
        dbo.fn_GetComponentCount(@FusedStream) AS ComponentCount,
        dbo.fn_GetTimeWindow(@FusedStream) AS TimeWindow,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS DurationMs;

    -- Cleanup
    DROP TABLE #StreamList;

    IF @Debug = 1
        PRINT 'Multi-modal stream fusion completed';
END;

CREATE PROCEDURE dbo.sp_FuseMultiModalStreams
    @StreamIds NVARCHAR(MAX), -- Comma-separated stream IDs
    @FusionType NVARCHAR(50) = 'weighted_average', -- 'weighted_average', 'max_pooling', 'attention_fusion'
    @Weights NVARCHAR(MAX) = NULL, -- JSON weights for each stream
    @Debug BIT = 0
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY -- Validate weights sum to 1.0 IF ABS((@VectorWeight + @KeywordWeight + @SpatialWeight) - 1.0) > 0.01 BEGIN RAISERROR('Weights must sum to 1.0', 16, 1); RETURN -1; END
DECLARE @Results TABLE ( AtomId BIGINT, VectorScore FLOAT, KeywordScore FLOAT, SpatialScore FLOAT, CombinedScore FLOAT );
-- Compute vector scores INSERT INTO @Results (AtomId, VectorScore, KeywordScore, SpatialScore) SELECT ae.AtomId, 1.0 - VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @QueryVector) AS VectorScore, 0.0 AS KeywordScore, 0.0 AS SpatialScore FROM dbo.AtomEmbeddings ae LEFT JOIN dbo.TenantAtoms ta ON ae.AtomId = ta.AtomId WHERE (@TenantId IS NULL OR ta.TenantId = @TenantId);
-- Add keyword scores (if keywords provided) -- CONTAINSTABLE requires dynamic SQL for NVARCHAR(MAX) parameters IF @Keywords IS NOT NULL AND LEN(@Keywords) > 0 BEGIN -- Create temp table for CONTAINSTABLE results since table variables can't be used in dynamic SQL CREATE TABLE #FTSResults (AtomId BIGINT, FTSRank INT);
DECLARE @SQL NVARCHAR(MAX) = N' INSERT INTO #FTSResults (AtomId, FTSRank) SELECT [KEY], RANK FROM CONTAINSTABLE(dbo.Atoms, Content, @SearchTerm)';
EXEC sp_executesql @SQL, N'@SearchTerm NVARCHAR(4000)', @Keywords;
UPDATE r SET KeywordScore = ISNULL(fts.FTSRank / 1000.0, 0.0) FROM @Results r INNER JOIN #FTSResults fts ON r.AtomId = fts.AtomId;
DROP TABLE #FTSResults; END
-- Add spatial scores (if region provided) IF @SpatialRegion IS NOT NULL BEGIN UPDATE r SET SpatialScore = CASE WHEN ae.SpatialKey IS NOT NULL AND ae.SpatialKey.STWithin(@SpatialRegion) = 1 THEN 1.0 ELSE 0.0 END FROM @Results r INNER JOIN dbo.AtomEmbeddings ae ON r.AtomId = ae.AtomId; END
-- Compute combined score UPDATE @Results SET CombinedScore = (VectorScore * @VectorWeight) + (KeywordScore * @KeywordWeight) + (SpatialScore * @SpatialWeight);
-- Return top K results SELECT TOP (@TopK) r.AtomId, r.VectorScore, r.KeywordScore, r.SpatialScore, r.CombinedScore, a.ContentHash, a.ContentType, a.CreatedAt FROM @Results r INNER JOIN dbo.Atoms a ON r.AtomId = a.AtomId -- No need for second TenantAtoms filter - already filtered in vector score computation ORDER BY r.CombinedScore DESC;
RETURN 0; END TRY BEGIN CATCH DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE(); RAISERROR(@ErrorMessage, 16, 1); RETURN -1; END CATCH END;

CREATE PROCEDURE dbo.sp_FusionSearch
    @QueryVector VECTOR(1998),
    @Keywords NVARCHAR(MAX) = NULL,
    @SpatialRegion GEOMETRY = NULL,
    @TopK INT = 10,
    @VectorWeight FLOAT = 0.5,
    @KeywordWeight FLOAT = 0.3,
    @SpatialWeight FLOAT = 0.2,
    @TenantId INT = NULL -- Optional tenant filtering
AS

BEGIN
    SET NOCOUNT ON;

    IF @prompt IS NULL OR LTRIM(RTRIM(@prompt)) = ''
        THROW 50110, 'Prompt is required for audio generation.', 1;

    IF @targetDurationMs IS NULL OR @targetDurationMs <= 0
        SET @targetDurationMs = 5000;

    IF @sampleRate IS NULL OR @sampleRate <= 0
        SET @sampleRate = 44100;

    IF @temperature IS NULL OR @temperature <= 0
        SET @temperature = 0.1;

    DECLARE @promptEmbedding VECTOR(1998);
    DECLARE @embeddingDim INT;
    EXEC dbo.sp_TextToEmbedding @text = @prompt, @ModelName = NULL, @embedding = @promptEmbedding OUTPUT, @dimension = @embeddingDim OUTPUT;

    DECLARE @models TABLE (ModelId INT PRIMARY KEY, Weight FLOAT NOT NULL, ModelName NVARCHAR(200));

    INSERT INTO @models (ModelId, Weight, ModelName)
    SELECT ModelId, Weight, ModelName
    FROM dbo.fn_SelectModelsForTask('audio_generation', @ModelIds, NULL, 'audio,sound', 'audio_generation');

    IF NOT EXISTS (SELECT 1 FROM @models)
        THROW 50111, 'No audio-capable models are configured for generation.', 1;

    DECLARE @modelsJson NVARCHAR(MAX) = (
        SELECT ModelId, Weight, ModelName
        FROM @models
        FOR JSON PATH
    );

    DECLARE @requestJson NVARCHAR(MAX) = JSON_OBJECT(
        'prompt': @prompt,
        'targetDurationMs': @targetDurationMs,
        'sampleRate': @sampleRate,
        'temperature': @temperature,
        'top_k': @top_k
    );

    DECLARE @inferenceId BIGINT;
        -- Create inference request
    INSERT INTO dbo.InferenceRequests (TaskType, InputData, ModelsUsed, EnsembleStrategy, OutputMetadata)
    VALUES (
        'audio_generation',
        CONVERT(NVARCHAR(MAX), @requestJson),
        CONVERT(NVARCHAR(MAX), @modelsJson),
        'vector_similarity',
        JSON_OBJECT('status': 'running')
    );
    SET @inferenceId = SCOPE_IDENTITY();

    DECLARE @startTime DATETIME2 = SYSUTCDATETIME();

    DECLARE @audioCandidates TABLE (
        AudioId BIGINT,
        SourcePath NVARCHAR(500),
        DurationMs BIGINT,
        SampleRate INT,
        NumChannels TINYINT,
        Score FLOAT,
        Distance FLOAT,
        Rank INT
    );

    IF @promptEmbedding IS NOT NULL
    BEGIN
        ;WITH AudioBase AS (
            SELECT
                ad.AudioId,
                ad.SourcePath,
                ad.DurationMs,
                ad.SampleRate,
                ad.NumChannels,
                VECTOR_DISTANCE('cosine', ad.GlobalEmbedding, @promptEmbedding) AS Distance
            FROM dbo.AudioData ad
            WHERE ad.GlobalEmbedding IS NOT NULL
        )
        INSERT INTO @audioCandidates (AudioId, SourcePath, DurationMs, SampleRate, NumChannels, Score, Distance, Rank)
        SELECT TOP (@top_k)
            AudioId,
            SourcePath,
            DurationMs,
            SampleRate,
            NumChannels,
            1.0 - Distance,
            Distance,
            ROW_NUMBER() OVER (ORDER BY Distance, AudioId)
        FROM AudioBase
        ORDER BY Distance, AudioId;
    END;

    DECLARE @segments TABLE (
        AudioId BIGINT,
        FrameNumber BIGINT,
        TimestampMs BIGINT,
        AmplitudeL FLOAT,
        AmplitudeR FLOAT,
        RmsEnergy FLOAT,
        SpectralCentroid FLOAT
    );

    IF EXISTS (SELECT 1 FROM @audioCandidates)
    BEGIN
        INSERT INTO @segments
    SELECT TOP (CONVERT(INT, CEILING(@targetDurationMs / 50.0)))
            af.AudioId,
            af.FrameNumber,
            af.TimestampMs,
            af.AmplitudeL,
            af.AmplitudeR,
            af.RmsEnergy,
            af.SpectralCentroid
        FROM dbo.AudioFrames af
        INNER JOIN @audioCandidates c ON c.AudioId = af.AudioId
        ORDER BY c.Rank, af.TimestampMs;
    END;

    DECLARE @durationMs INT = DATEDIFF(MILLISECOND, @startTime, SYSUTCDATETIME());
    DECLARE @outputJson NVARCHAR(MAX);

    IF EXISTS (SELECT 1 FROM @segments)
    BEGIN
        DECLARE @segmentJson NVARCHAR(MAX) = (
            SELECT AudioId, FrameNumber, TimestampMs, AmplitudeL, AmplitudeR, RmsEnergy, SpectralCentroid
            FROM @segments
            ORDER BY TimestampMs
            FOR JSON PATH
        );

        DECLARE @candidateJson NVARCHAR(MAX) = (
            SELECT AudioId, SourcePath, DurationMs, SampleRate, NumChannels, Score, Distance, Rank
            FROM @audioCandidates
            ORDER BY Rank
            FOR JSON PATH
        );

        SET @outputJson = JSON_OBJECT(
            'strategy': 'retrieval_composition',
            'segments': JSON_QUERY(@segmentJson),
            'candidates': JSON_QUERY(@candidateJson)
        );

        UPDATE dbo.InferenceRequests
        SET TotalDurationMs = @durationMs,
            OutputData = @outputJson
        WHERE InferenceId = @inferenceId;

        INSERT INTO dbo.InferenceSteps (InferenceId, StepNumber, OperationType, DurationMs, RowsReturned)
        VALUES (@inferenceId, 1, 'audio_candidate_search', @durationMs, (SELECT COUNT(*) FROM @audioCandidates));

        SELECT
            @inferenceId AS InferenceId,
            c.AudioId,
            c.SourcePath,
            c.DurationMs,
            c.SampleRate,
            c.NumChannels,
            c.Score,
            c.Distance,
            c.Rank,
            JSON_QUERY(@segmentJson) AS SegmentPlan
        FROM @audioCandidates c
        ORDER BY c.Rank;
    END
    ELSE
    BEGIN
        DECLARE @seed BIGINT = CONVERT(BIGINT, CHECKSUM(@prompt));
        IF @seed < 0 SET @seed = -@seed;

        DECLARE @fundamentalHz FLOAT = 220.0 + (@seed % 380);
        DECLARE @secondLevel FLOAT = ((@seed / 11) % 70) / 100.0;
        DECLARE @thirdLevel FLOAT = ((@seed / 23) % 60) / 100.0;
        DECLARE @amplitude FLOAT = 0.55 + ((@seed / 7) % 35) / 100.0;
        IF @amplitude > 0.95 SET @amplitude = 0.95;

        DECLARE @synthetic VARBINARY(MAX) = dbo.clr_GenerateHarmonicTone(@fundamentalHz, @targetDurationMs, @sampleRate, 2, @amplitude, @secondLevel, @thirdLevel);
        DECLARE @waveform GEOMETRY = NULL;
        DECLARE @rms FLOAT = NULL;
        DECLARE @peak FLOAT = NULL;

        IF @synthetic IS NOT NULL
        BEGIN
            SET @waveform = dbo.clr_AudioToWaveform(@synthetic, 2, @sampleRate, 4096);
            SET @rms = dbo.clr_AudioComputeRms(@synthetic, 2);
            SET @peak = dbo.clr_AudioComputePeak(@synthetic, 2);
        END;

        DECLARE @base64 NVARCHAR(MAX) = NULL;
        IF @synthetic IS NOT NULL
        BEGIN
            SET @base64 = (
                SELECT @synthetic
                FOR XML PATH(''), BINARY BASE64
            );
        END;

        SET @outputJson = JSON_OBJECT(
            'strategy': 'synthetic_fallback',
            'fundamentalHz': @fundamentalHz,
            'sampleRate': @sampleRate,
            'durationMs': @targetDurationMs,
            'channels': 2,
            'amplitude': @amplitude,
            'secondHarmonic': @secondLevel,
            'thirdHarmonic': @thirdLevel,
            'rmsAmplitude': @rms,
            'peakAmplitude': @peak,
            'base64': @base64
        );

        UPDATE dbo.InferenceRequests
        SET TotalDurationMs = @durationMs,
            OutputData = CONVERT(NVARCHAR(MAX), @outputJson),
            OutputMetadata = JSON_OBJECT(
                'status': 'completed',
                'segment_count': 0,
                'candidate_count': 0,
                'generation_mode': 'synthetic_fallback'
            )
        WHERE InferenceId = @inferenceId;

        INSERT INTO dbo.InferenceSteps (InferenceId, StepNumber, OperationType, DurationMs, RowsReturned)
        VALUES (@inferenceId, 1, 'audio_synthesis_tone', @durationMs, 0);

        SELECT
            @inferenceId AS InferenceId,
            NULL AS AudioId,
            NULL AS SourcePath,
            @targetDurationMs AS DurationMs,
            @sampleRate AS SampleRate,
            2 AS NumChannels,
            1.0 AS Score,
            0.0 AS Distance,
            1 AS Rank,
            @waveform AS WaveformGeometry,
            @base64 AS SynthesizedAudioBase64;
    END;
END

CREATE PROCEDURE dbo.sp_GenerateAudio
    @prompt NVARCHAR(MAX),
    @targetDurationMs INT = 5000,
    @sampleRate INT = 44100,
    @ModelIds NVARCHAR(MAX) = NULL,
    @top_k INT = 5,
    @temperature FLOAT = 0.6
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @EventAtoms TABLE (AtomId BIGINT, Weight FLOAT, ClusterId INT);

    IF @Debug = 1
        PRINT 'Generating events from stream ' + CAST(@StreamId AS NVARCHAR(10)) + ' with threshold ' + CAST(@Threshold AS NVARCHAR(10));

    -- Validate stream exists
    IF NOT EXISTS (SELECT 1 FROM dbo.StreamOrchestrationResults WHERE Id = @StreamId)
    BEGIN
        RAISERROR('Stream ID not found', 16, 1);
        RETURN;
    END

    -- Get stream data
    DECLARE @ComponentStream VARBINARY(MAX);
    SELECT @ComponentStream = ComponentStream
    FROM dbo.StreamOrchestrationResults
    WHERE Id = @StreamId;

    -- Decompress and filter components
    INSERT INTO @EventAtoms (AtomId, Weight)
    SELECT dc.AtomId, dc.Weight
    FROM dbo.fn_DecompressComponents(@ComponentStream) dc
    WHERE dc.Weight >= @Threshold;

    -- Apply clustering to identify event patterns
    IF @Clustering = 'dbscan'
    BEGIN
        -- Use DBSCAN clustering from concept discovery
        UPDATE @EventAtoms
        SET ClusterId = dbo.fn_DiscoverConcepts(AtomId, Weight, 0.3, 3); -- eps=0.3, minPts=3
    END
    ELSE IF @Clustering = 'kmeans'
    BEGIN
        -- Simplified k-means (would need full implementation)
        UPDATE @EventAtoms
        SET ClusterId = ABS(AtomId) % 5; -- Simple hash-based clustering
    END

    -- Generate event atoms for each cluster
    DECLARE @EventCount INT = 0;
    DECLARE @ClusterId INT;

    DECLARE cluster_cursor CURSOR LOCAL FAST_FORWARD FOR
    SELECT DISTINCT ClusterId FROM @EventAtoms WHERE ClusterId IS NOT NULL;

    OPEN cluster_cursor;
    FETCH NEXT FROM cluster_cursor INTO @ClusterId;

    WHILE @@FETCH_STATUS = 0
    BEGIN
        -- Calculate cluster centroid
        DECLARE @CentroidAtomId BIGINT;
        DECLARE @AvgWeight FLOAT;
        DECLARE @ClusterSize INT;

        SELECT
            @CentroidAtomId = AVG(AtomId),
            @AvgWeight = AVG(Weight),
            @ClusterSize = COUNT(*)
        FROM @EventAtoms
        WHERE ClusterId = @ClusterId;

        -- Create event atom (simplified - would integrate with atom creation)
        INSERT INTO dbo.EventAtoms (
            StreamId,
            EventType,
            CentroidAtomId,
            AverageWeight,
            ClusterSize,
            ClusterId,
            CreatedAt
        )
        VALUES (
            @StreamId,
            @EventType,
            @CentroidAtomId,
            @AvgWeight,
            @ClusterSize,
            @ClusterId,
            SYSUTCDATETIME()
        );

        SET @EventCount = @EventCount + 1;
        FETCH NEXT FROM cluster_cursor INTO @ClusterId;
    END

    CLOSE cluster_cursor;
    DEALLOCATE cluster_cursor;

    -- Store event generation result
    INSERT INTO dbo.EventGenerationResults (
        StreamId,
        EventType,
        Threshold,
        ClusteringMethod,
        EventsGenerated,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @StreamId,
        @EventType,
        @Threshold,
        @Clustering,
        @EventCount,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return event generation summary
    SELECT
        @StreamId AS StreamId,
        @EventType AS EventType,
        @Threshold AS Threshold,
        @Clustering AS ClusteringMethod,
        @EventCount AS EventsGenerated,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS DurationMs;

    IF @Debug = 1
        PRINT 'Event generation completed, created ' + CAST(@EventCount AS NVARCHAR(10)) + ' events';
END;

CREATE PROCEDURE dbo.sp_GenerateEventsFromStream
    @StreamId INT,
    @EventType NVARCHAR(100),
    @Threshold FLOAT = 0.5, -- Minimum weight threshold for event generation
    @Clustering NVARCHAR(50) = 'dbscan', -- 'dbscan', 'kmeans', 'hierarchical'
    @Debug BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    IF @prompt IS NULL OR LTRIM(RTRIM(@prompt)) = ''
        THROW 50100, 'Prompt is required for image generation.', 1;

    DECLARE @promptEmbedding VECTOR(1998);
    DECLARE @embeddingDim INT;
    EXEC dbo.sp_TextToEmbedding @text = @prompt, @ModelName = NULL, @embedding = @promptEmbedding OUTPUT, @dimension = @embeddingDim OUTPUT;

    DECLARE @models TABLE (ModelId INT PRIMARY KEY, Weight FLOAT NOT NULL, ModelName NVARCHAR(200));

    INSERT INTO @models (ModelId, Weight, ModelName)
    SELECT ModelId, Weight, ModelName
    FROM dbo.fn_SelectModelsForTask('image_generation', @ModelIds, NULL, 'image,vision', 'image_generation');

    IF NOT EXISTS (SELECT 1 FROM @models)
        THROW 50101, 'No image-capable models are configured for generation.', 1;

    DECLARE @modelsJson NVARCHAR(MAX) = (
        SELECT ModelId, Weight, ModelName FROM @models FOR JSON PATH
    );

    DECLARE @requestInfo NVARCHAR(MAX) = JSON_OBJECT(
        'prompt': @prompt,
        'width': @width,
        'height': @height,
        'patch_size': @patch_size,
        'steps': @steps,
        'guidance_scale': @guidance_scale,
        'top_k': @top_k,
        'output_format': @output_format
    );

    DECLARE @inferenceId BIGINT;
    INSERT INTO dbo.InferenceRequests (TaskType, InputData, ModelsUsed, EnsembleStrategy, OutputMetadata)
    VALUES (
        'image_generation',
        CONVERT(NVARCHAR(MAX), @requestInfo),
        CONVERT(NVARCHAR(MAX), @modelsJson),
        'spatial_diffusion',
        JSON_OBJECT('status': 'running')
    );
    SET @inferenceId = SCOPE_IDENTITY();

    DECLARE @startTime DATETIME2 = SYSUTCDATETIME();

    DECLARE @imageCandidates TABLE (
        ImageId BIGINT,
        SourcePath NVARCHAR(500),
        Width INT,
        Height INT,
        Score FLOAT,
        Distance FLOAT,
        Rank INT
    );

    IF @promptEmbedding IS NOT NULL
    BEGIN
        ;WITH ImageBase AS (
            SELECT
                img.ImageId,
                img.SourcePath,
                img.Width,
                img.Height,
                VECTOR_DISTANCE('cosine', img.GlobalEmbedding, @promptEmbedding) AS Distance
            FROM dbo.Images img
            WHERE img.GlobalEmbedding IS NOT NULL
        )
        INSERT INTO @imageCandidates (ImageId, SourcePath, Width, Height, Score, Distance, Rank)
        SELECT TOP (@top_k)
            ImageId,
            SourcePath,
            Width,
            Height,
            1.0 - Distance,
            Distance,
            ROW_NUMBER() OVER (ORDER BY Distance, ImageId)
        FROM ImageBase
        ORDER BY Distance, ImageId;
    END;

    DECLARE @guideX FLOAT = 0;
    DECLARE @guideY FLOAT = 0;
    DECLARE @guideZ FLOAT = 0;

    IF EXISTS (SELECT 1 FROM @imageCandidates)
    BEGIN
        SELECT
            @guideX = AVG(CAST(p.PatchRegion.STCentroid().STX AS FLOAT)),
            @guideY = AVG(CAST(p.PatchRegion.STCentroid().STY AS FLOAT)),
            @guideZ = AVG(CAST(COALESCE(p.PatchRegion.STCentroid().Z, 0.0) AS FLOAT))
        FROM dbo.ImagePatches p
        INNER JOIN @imageCandidates c ON c.ImageId = p.ImageId;

        IF @guideX IS NULL SET @guideX = 0;
        IF @guideY IS NULL SET @guideY = 0;
        IF @guideZ IS NULL SET @guideZ = 0;
    END;

    DECLARE @seed INT = ABS(CHECKSUM(@prompt + CONVERT(NVARCHAR(50), @startTime)));

    DECLARE @patches TABLE (
        patch_x INT,
        patch_y INT,
        spatial_x FLOAT,
        spatial_y FLOAT,
        spatial_z FLOAT,
        geometry GEOMETRY
    );

    INSERT INTO @patches (patch_x, patch_y, spatial_x, spatial_y, spatial_z, geometry)
    SELECT
        patch_x,
        patch_y,
        spatial_x,
        spatial_y,
        spatial_z,
        patch
    FROM dbo.clr_GenerateImagePatches(
        @width,
        @height,
        @patch_size,
        @steps,
        @guidance_scale,
        @guideX,
        @guideY,
        @guideZ,
        @seed
    );

    DECLARE @durationMs INT = DATEDIFF(MILLISECOND, @startTime, SYSUTCDATETIME());
    DECLARE @patchCount INT = (SELECT COUNT(*) FROM @patches);

    DECLARE @patchesJson NVARCHAR(MAX) = (
        SELECT patch_x, patch_y, spatial_x, spatial_y, spatial_z, geometry.STAsText() AS patch_wkt
        FROM @patches
        ORDER BY patch_y, patch_x
        FOR JSON PATH
    );

    DECLARE @candidatesJson NVARCHAR(MAX) = NULL;
    IF EXISTS (SELECT 1 FROM @imageCandidates)
    BEGIN
        SET @candidatesJson = (
            SELECT ImageId, SourcePath, Width, Height, Score, Distance, Rank
            FROM @imageCandidates
            ORDER BY Rank
            FOR JSON PATH
        );
    END;

    DECLARE @outputJson NVARCHAR(MAX) = JSON_OBJECT(
        'generated_format': @output_format,
        'patches': JSON_QUERY(@patchesJson),
        'candidates': JSON_QUERY(@candidatesJson)
    );

    UPDATE dbo.InferenceRequests
    SET TotalDurationMs = @durationMs,
        OutputData = @outputJson,
        OutputMetadata = JSON_OBJECT(
            'status': 'completed',
            'patch_count': @patchCount,
            'width': @width,
            'height': @height,
            'steps': @steps,
            'guidance': JSON_OBJECT('x': @guideX, 'y': @guideY, 'z': @guideZ)
        )
    WHERE InferenceId = @inferenceId;

    INSERT INTO dbo.InferenceSteps (InferenceId, StepNumber, OperationType, DurationMs, RowsReturned)
    VALUES (@inferenceId, 1, 'image_candidate_search', @durationMs, ISNULL((SELECT COUNT(*) FROM @imageCandidates), 0));

    IF @output_format = 'patches'
    BEGIN
        SELECT
            @inferenceId AS InferenceId,
            patch_x AS PatchX,
            patch_y AS PatchY,
            spatial_x,
            spatial_y,
            spatial_z,
            geometry
        FROM @patches
        ORDER BY patch_y, patch_x;
    END
    ELSE
    BEGIN
        DECLARE @resultGeometry GEOMETRY = dbo.clr_GenerateImageGeometry(
            @width,
            @height,
            @patch_size,
            @steps,
            @guidance_scale,
            @guideX,
            @guideY,
            @guideZ,
            @seed
        );

        SELECT @inferenceId AS InferenceId, @resultGeometry AS GeneratedImageGeometry;
    END;

    SELECT
        @inferenceId AS InferenceId,
        @prompt AS Prompt,
        @width AS Width,
        @height AS Height,
        @steps AS Steps,
        @durationMs AS DurationMs,
        JSON_QUERY(@candidatesJson) AS CandidateImages;
END;

CREATE PROCEDURE dbo.sp_GenerateImage
    @prompt NVARCHAR(MAX),
    @width INT = 512,
    @height INT = 512,
    @patch_size INT = 32,
    @steps INT = 32,
    @guidance_scale FLOAT = 6.5,
    @ModelIds NVARCHAR(MAX) = NULL,
    @top_k INT = 4,
    @output_format NVARCHAR(10) = 'patches'
AS

BEGIN SET NOCOUNT ON;
DECLARE @StartPoint GEOMETRY; DECLARE @TargetRegion GEOMETRY; DECLARE @TargetCentroid GEOMETRY;
-- Get start point and target region SELECT @StartPoint = [SpatialKey] FROM [dbo].[AtomEmbeddings] WHERE [AtomId] = @StartAtomId;
SELECT @TargetRegion = [ConceptDomain], @TargetCentroid = [CentroidSpatialKey] FROM [provenance].[Concepts] WHERE [ConceptId] = @TargetConceptId;
IF @StartPoint IS NULL OR @TargetRegion IS NULL OR @TargetCentroid IS NULL BEGIN RAISERROR('Invalid start atom or target concept. Ensure concept has computed ConceptDomain.', 16, 1); RETURN -1; END
-- A* data structures DECLARE @OpenSet TABLE ( AtomId BIGINT PRIMARY KEY, ParentAtomId BIGINT, gCost FLOAT NOT NULL, -- Cost from start hCost FLOAT NOT NULL, -- Heuristic to goal fCost AS (gCost + hCost) -- Total estimated cost );
CREATE TABLE #ClosedSet ( AtomId BIGINT PRIMARY KEY, ParentAtomId BIGINT );
DECLARE @CurrentAtomId BIGINT; DECLARE @CurrentPoint GEOMETRY; DECLARE @gCost FLOAT; DECLARE @Steps INT = 0; DECLARE @GoalAtomId BIGINT = NULL;
-- Initialize with start node INSERT INTO @OpenSet (AtomId, ParentAtomId, gCost, hCost) VALUES ( @StartAtomId, NULL, 0, @StartPoint.STDistance(@TargetCentroid) );
-- A* main loop WHILE (EXISTS (SELECT 1 FROM @OpenSet) AND @Steps < @MaxSteps AND @GoalAtomId IS NULL) BEGIN -- 1. Get node with lowest fCost from Open Set SELECT TOP 1 @CurrentAtomId = os.AtomId, @gCost = os.gCost, @CurrentPoint = ae.[SpatialKey] FROM @OpenSet os JOIN [dbo].[AtomEmbeddings] ae ON os.AtomId = ae.AtomId ORDER BY os.fCost ASC, os.hCost ASC; -- Tie-break with heuristic
-- 2. Check if we've reached the goal (inside target concept domain) IF @CurrentPoint.STWithin(@TargetRegion) = 1 BEGIN SET @GoalAtomId = @CurrentAtomId; BREAK; END
-- 3. Move current node from Open to Closed DELETE FROM @OpenSet WHERE AtomId = @CurrentAtomId; INSERT INTO #ClosedSet (AtomId, ParentAtomId) SELECT AtomId, ParentAtomId FROM @OpenSet WHERE AtomId = @CurrentAtomId;
-- 4. Find neighbors using spatial index DECLARE @NeighborSearchRegion GEOMETRY = @CurrentPoint.STBuffer(@NeighborRadius);
-- 5. Process each neighbor ;WITH Neighbors AS ( SELECT ae.AtomId, ae.SpatialKey, @CurrentPoint.STDistance(ae.SpatialKey) AS StepCost, ae.SpatialKey.STDistance(@TargetCentroid) AS HeuristicCost FROM dbo.AtomEmbeddings ae WITH(INDEX(SIX_AtomEmbeddings_SpatialKey)) WHERE ae.SpatialKey.STIntersects(@NeighborSearchRegion) = 1 AND ae.AtomId <> @CurrentAtomId AND NOT EXISTS (SELECT 1 FROM #ClosedSet WHERE AtomId = ae.AtomId) ) -- 6. Merge neighbors into Open Set (update if better path found) MERGE @OpenSet AS T USING Neighbors AS S ON T.AtomId = S.AtomId WHEN MATCHED AND (S.StepCost + @gCost) < T.gCost THEN -- Found a better path to this node UPDATE SET T.ParentAtomId = @CurrentAtomId, T.gCost = S.StepCost + @gCost, T.hCost = S.HeuristicCost WHEN NOT MATCHED BY TARGET THEN -- New node discovered INSERT (AtomId, ParentAtomId, gCost, hCost) VALUES (S.AtomId, @CurrentAtomId, S.StepCost + @gCost, S.HeuristicCost);
SET @Steps = @Steps + 1; END
-- 7. Reconstruct and return path IF @GoalAtomId IS NOT NULL BEGIN -- Add goal to closed set INSERT INTO #ClosedSet (AtomId, ParentAtomId) SELECT AtomId, ParentAtomId FROM @OpenSet WHERE AtomId = @GoalAtomId;
-- Reconstruct path using recursive CTE ;WITH PathCTE AS ( -- Start from goal SELECT AtomId, ParentAtomId, 0 AS Depth FROM #ClosedSet WHERE AtomId = @GoalAtomId
UNION ALL
-- Walk backwards to start SELECT cs.AtomId, cs.ParentAtomId, p.Depth + 1 FROM #ClosedSet cs JOIN PathCTE p ON cs.AtomId = p.ParentAtomId WHERE p.ParentAtomId IS NOT NULL ) SELECT p.Depth AS StepNumber, p.AtomId, a.Modality, a.Subtype, a.[AtomicValue], ae.[SpatialKey].ToString() AS SpatialPosition, ae.[SpatialKey].STDistance(@TargetCentroid) AS DistanceToGoal FROM PathCTE p JOIN dbo.Atoms a ON p.AtomId = a.AtomId LEFT JOIN dbo.AtomEmbeddings ae ON p.AtomId = ae.AtomId ORDER BY p.Depth DESC; -- Start to goal order END ELSE BEGIN -- No path found RAISERROR('No path to target concept found within MaxSteps limit.', 10, 1); SELECT NULL AS StepNumber, NULL AS AtomId, NULL AS Modality; END
DROP TABLE #ClosedSet; RETURN 0; END

-- =============================================
-- sp_GenerateOptimalPath: A* Pathfinding for Semantic Generation
-- =============================================
-- Uses A* algorithm to find optimal path through semantic space
-- from start atom to target concept region
-- =============================================

CREATE PROCEDURE [dbo].[sp_GenerateOptimalPath]
    @StartAtomId BIGINT,
    @TargetConceptId INT,
    @MaxSteps INT = 50,
    @NeighborRadius FLOAT = 0.5  -- Spatial radius for neighbor search
AS

BEGIN
    SET NOCOUNT ON;

    SET @GeneratedText = NULL;

    IF @prompt IS NULL OR LTRIM(RTRIM(@prompt)) = ''
        THROW 50090, 'Prompt is required for text generation.', 1;

    IF @max_tokens <= 0
        SET @max_tokens = 1;

    IF @temperature IS NULL OR @temperature <= 0
        SET @temperature = 0.01;

    DECLARE @promptEmbedding VECTOR(1998);
    DECLARE @embeddingDim INT;
    EXEC dbo.sp_TextToEmbedding @text = @prompt, @ModelName = NULL, @embedding = @promptEmbedding OUTPUT, @dimension = @embeddingDim OUTPUT;

    IF @promptEmbedding IS NULL
        THROW 50091, 'Failed to derive prompt embedding for generation.', 1;

    DECLARE @models TABLE (ModelId INT PRIMARY KEY, Weight FLOAT NOT NULL, ModelName NVARCHAR(200));

    INSERT INTO @models (ModelId, Weight, ModelName)
    SELECT ModelId, Weight, ModelName
    FROM dbo.fn_SelectModelsForTask('text_generation', @ModelIds, NULL, 'text', 'language_model');

    IF NOT EXISTS (SELECT 1 FROM @models)
        THROW 50092, 'No eligible models found for text generation.', 1;

    DECLARE @modelsJson NVARCHAR(MAX) = (
        SELECT ModelId, Weight, ModelName
        FROM @models
        FOR JSON PATH
    );

    DECLARE @requestPayload NVARCHAR(MAX) = JSON_OBJECT(
        'prompt': @prompt,
        'max_tokens': @max_tokens,
        'temperature': @temperature,
        'top_k': @top_k
    );

    DECLARE @inferenceId BIGINT;
    INSERT INTO dbo.InferenceRequests (TaskType, InputData, ModelsUsed, EnsembleStrategy, OutputMetadata)
    VALUES (
        'text_generation',
        CONVERT(NVARCHAR(MAX), @requestPayload),
        CONVERT(NVARCHAR(MAX), @modelsJson),
        'weighted_vector_consensus',
        JSON_OBJECT('status': 'running')
    );
    SET @inferenceId = SCOPE_IDENTITY();

    DECLARE @sequence TABLE (
        StepNumber INT,
        AtomId BIGINT,
        Token NVARCHAR(400),
        Score FLOAT,
        Distance FLOAT,
        ModelCount INT,
        DurationMs INT
    );

    DECLARE @startTime DATETIME2 = SYSUTCDATETIME();

    -- Convert VECTOR to NVARCHAR(MAX) (JSON format) for CLR function
    -- SQL Server 2025 VECTOR type can only convert to VARCHAR/NVARCHAR/JSON, not VARBINARY
    DECLARE @promptEmbeddingJson NVARCHAR(MAX) = CAST(@promptEmbedding AS NVARCHAR(MAX));

    INSERT INTO @sequence (StepNumber, AtomId, Token, Score, Distance, ModelCount, DurationMs)
    SELECT
        ROW_NUMBER() OVER (ORDER BY (SELECT NULL)) AS StepNumber,
        t.AtomId,
        t.Token,
        t.Score,
        t.Distance,
        t.ModelCount,
        t.DurationMs
    FROM dbo.clr_GenerateTextSequence(
        CAST(@promptEmbeddingJson AS VARBINARY(MAX)),
        @modelsJson,
        @max_tokens,
        @temperature,
        @top_k
    ) AS t;

    SET @generatedText = LTRIM(RTRIM(@prompt));
    DECLARE @tokenSuffix NVARCHAR(MAX) = (
        SELECT STRING_AGG(Token, ' ') WITHIN GROUP (ORDER BY StepNumber)
        FROM @sequence
        WHERE Token IS NOT NULL AND LTRIM(RTRIM(Token)) <> ''
    );

    IF @tokenSuffix IS NOT NULL AND LTRIM(RTRIM(@tokenSuffix)) <> ''
    BEGIN
        DECLARE @basePrompt NVARCHAR(MAX) = LTRIM(RTRIM(@GeneratedText));
        DECLARE @i INT = 1;
        -- Generate next token
        IF @i % 3 = 0 -- Randomly attach without space
            SET @GeneratedText = LTRIM(RTRIM(@basePrompt + @tokenSuffix));
        ELSE
            -- Attach with space
            SET @GeneratedText = LTRIM(RTRIM(@basePrompt + ' ' + @tokenSuffix));
    END;

    DECLARE @totalDuration INT = DATEDIFF(MILLISECOND, @startTime, SYSUTCDATETIME());
    DECLARE @tokenCount INT = (SELECT COUNT(*) FROM @sequence);

    DECLARE @tokensJson NVARCHAR(MAX) = (
        SELECT StepNumber, AtomId, Token, Score, Distance, ModelCount, DurationMs
        FROM @sequence
        ORDER BY StepNumber
        FOR JSON PATH
    );

    DECLARE @streamId UNIQUEIDENTIFIER = NEWID();

    DECLARE @stream dbo.AtomicStream;
    SET @stream = CONVERT(dbo.AtomicStream, NULL);
    DECLARE @streamCreated DATETIME2(3) = SYSUTCDATETIME();
    DECLARE @primaryModel NVARCHAR(128) = (
        SELECT TOP (1) ModelName FROM @models ORDER BY Weight DESC, ModelId
    );
    DECLARE @modelCount INT = (SELECT COUNT(*) FROM @models);
    DECLARE @streamScope NVARCHAR(128) = 'text_generation';

    DECLARE @streamMetadata NVARCHAR(MAX) = JSON_OBJECT('inference_id': @inferenceId, 'model_count': @modelCount);

    SET @stream = provenance.clr_CreateAtomicStream(@streamId, @streamCreated, @streamScope, @primaryModel, @streamMetadata);
    SET @stream = provenance.clr_AppendAtomicStreamSegment(@stream, 'Input', @streamCreated, 'text/plain; charset=utf-16', JSON_OBJECT('prompt_length': LEN(@prompt)), CAST(@prompt AS VARBINARY(MAX)));
    SET @stream = provenance.clr_AppendAtomicStreamSegment(@stream, 'Control', @streamCreated, 'application/json', JSON_OBJECT('max_tokens': @max_tokens, 'temperature': @temperature, 'top_k': @top_k), CAST(JSON_QUERY(@modelsJson) AS VARBINARY(MAX)));

    IF @promptEmbedding IS NOT NULL
    BEGIN
        -- Store embedding as JSON (VECTOR type can only convert to NVARCHAR/JSON)
        DECLARE @promptEmbeddingBinary VARBINARY(MAX) = CAST(@promptEmbeddingJson AS VARBINARY(MAX));
        SET @stream = provenance.clr_AppendAtomicStreamSegment(
            @stream, 
            'Embedding', 
            @streamCreated, 
            'application/json; charset=utf-16', 
            JSON_OBJECT('dimension': @embeddingDim, 'format': 'vector_json'), 
            @promptEmbeddingBinary
        );
    END;

    SET @stream = provenance.clr_AppendAtomicStreamSegment(@stream, 'Telemetry', SYSUTCDATETIME(), 'application/json', JSON_OBJECT('token_count': @tokenCount, 'duration_ms': @totalDuration), CAST(JSON_QUERY(@tokensJson) AS VARBINARY(MAX)));
    SET @stream = provenance.clr_AppendAtomicStreamSegment(@stream, 'Output', SYSUTCDATETIME(), 'text/plain; charset=utf-16', JSON_OBJECT('token_count': @tokenCount), CAST(@GeneratedText AS VARBINARY(MAX)));
    -- Store resulting text in OUTPUT parameter (for caller convenience)
    -- @GeneratedText is already set

    UPDATE dbo.InferenceRequests
    SET TotalDurationMs = @totalDuration,
        OutputData = JSON_OBJECT('tokens': JSON_QUERY(@tokensJson), 'generatedText': @GeneratedText),
        OutputMetadata = JSON_OBJECT(
            'status': 'completed',
            'tokens_generated': @tokenCount,
            'temperature': @temperature,
            'prompt_length': LEN(@prompt),
            'result_length': LEN(@GeneratedText)
        )
    WHERE InferenceId = @inferenceId;

    INSERT INTO dbo.InferenceSteps (InferenceId, StepNumber, OperationType, DurationMs, RowsReturned)
    SELECT @inferenceId, StepNumber, 'text_generation_step', DurationMs, ModelCount
    FROM @sequence;

    -- Note: Stream column removed from GenerationStreams to allow CLR type redeploy
    -- Provenance still tracked in AtomicStream variable above, could be persisted elsewhere if needed
    -- INSERT INTO provenance.GenerationStreams (StreamId, Scope, Model, CreatedAt)
    -- VALUES (@streamId, @streamScope, @primaryModel, @streamCreated);

    SELECT
        @inferenceId AS InferenceId,
        @streamId AS StreamId,
        @prompt AS OriginalPrompt,
    @GeneratedText AS GeneratedText,
        @tokenCount AS TokensGenerated,
        @totalDuration AS DurationMs,
        JSON_QUERY(@tokensJson) AS TokenDetails;
END

CREATE PROCEDURE dbo.sp_GenerateText
    @prompt NVARCHAR(MAX),
    @max_tokens INT = 64,
    @temperature FLOAT = 0.8,
    @ModelIds NVARCHAR(MAX) = NULL,
    @top_k INT = 6,
    @GeneratedText NVARCHAR(MAX) = NULL OUTPUT
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @context TABLE (AtomId BIGINT PRIMARY KEY, AtomText NVARCHAR(100));
    DECLARE @generated_text NVARCHAR(MAX) = @prompt;
    DECLARE @iteration INT = 0;
    DECLARE @context_ids NVARCHAR(MAX);
    DECLARE @NextAtomId BIGINT;
    DECLARE @NextAtomText NVARCHAR(100);

    INSERT INTO @context (AtomId, AtomText)
    SELECT a.AtomId, CAST(a.CanonicalText AS NVARCHAR(100))
    FROM dbo.Atoms a
    WHERE CAST(a.CanonicalText AS NVARCHAR(100)) IN (
        SELECT LTRIM(RTRIM(value)) FROM STRING_SPLIT(@prompt, ' ')
    );

    WHILE @iteration < @max_tokens
    BEGIN
        SELECT @context_ids = STRING_AGG(CAST(AtomId AS NVARCHAR(20)), ',')
        FROM @context;

        IF @context_ids IS NULL
        BEGIN
            BREAK;
        END;

        DECLARE @next TABLE (TokenId BIGINT, TokenText NVARCHAR(100), SpatialDistance FLOAT, ProbabilityScore FLOAT);

        INSERT INTO @next
        EXEC dbo.sp_SpatialNextToken
            @context_atom_ids = @context_ids,
            @temperature = @temperature,
            @top_k = 1;

        SELECT TOP 1
            @NextAtomId = TokenId,
            @NextAtomText = TokenText
        FROM @next
        ORDER BY ProbabilityScore DESC;

        IF @NextAtomId IS NULL OR EXISTS (SELECT 1 FROM @context WHERE AtomId = @NextAtomId)
        BEGIN
            BREAK;
        END;

        INSERT INTO @context (AtomId, AtomText) VALUES (@NextAtomId, @NextAtomText);
        SET @generated_text = @generated_text + N' ' + @NextAtomText;
        SET @iteration = @iteration + 1;
    END;

    SELECT
        @prompt AS OriginalPrompt,
        @generated_text AS GeneratedText,
        @iteration AS TokensGenerated,
        'SPATIAL_GEOMETRY_R_TREE' AS Method;
END;

CREATE PROCEDURE dbo.sp_GenerateTextSpatial
    @prompt NVARCHAR(MAX),
    @max_tokens INT = 10,
    @temperature FLOAT = 1.0
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY DECLARE @StartDate DATETIME2;
-- Determine time range IF @TimeRange = 'Day' SET @StartDate = DATEADD(DAY, -1, SYSUTCDATETIME()); ELSE IF @TimeRange = 'Week' SET @StartDate = DATEADD(WEEK, -1, SYSUTCDATETIME()); ELSE IF @TimeRange = 'Month' SET @StartDate = DATEADD(MONTH, -1, SYSUTCDATETIME()); ELSE IF @TimeRange = 'Year' SET @StartDate = DATEADD(YEAR, -1, SYSUTCDATETIME());
IF @ReportType = 'Summary' BEGIN -- High-level metrics SELECT UsageType, SUM(Quantity) AS TotalQuantity, SUM(TotalCost) AS TotalCost, AVG(Quantity) AS AvgQuantity, COUNT(*) AS RecordCount FROM dbo.BillingUsageLedger WHERE TenantId = @TenantId AND RecordedUtc >= @StartDate GROUP BY UsageType ORDER BY TotalCost DESC FOR JSON PATH; END ELSE IF @ReportType = 'Detailed' BEGIN -- Time-series data SELECT CAST(RecordedUtc AS DATE) AS UsageDate, UsageType, SUM(Quantity) AS DailyQuantity, SUM(TotalCost) AS DailyCost FROM dbo.BillingUsageLedger WHERE TenantId = @TenantId AND RecordedUtc >= @StartDate GROUP BY CAST(RecordedUtc AS DATE), UsageType ORDER BY UsageDate, UsageType FOR JSON PATH; END ELSE IF @ReportType = 'Forecast' BEGIN -- Simple linear forecast (7-day moving average) WITH DailyUsage AS ( SELECT CAST(RecordedUtc AS DATE) AS UsageDate, UsageType, SUM(Quantity) AS DailyQuantity FROM dbo.BillingUsageLedger WHERE TenantId = @TenantId AND RecordedUtc >= DATEADD(DAY, -30, SYSUTCDATETIME()) GROUP BY CAST(RecordedUtc AS DATE), UsageType ) SELECT UsageType, AVG(DailyQuantity) AS AvgDailyUsage, AVG(DailyQuantity) * 30 AS ForecastMonthly FROM DailyUsage WHERE UsageDate >= DATEADD(DAY, -7, SYSUTCDATETIME()) GROUP BY UsageType FOR JSON PATH; END
RETURN 0; END TRY BEGIN CATCH DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE(); RAISERROR(@ErrorMessage, 16, 1); RETURN -1; END CATCH END;

CREATE PROCEDURE dbo.sp_GenerateUsageReport
    @TenantId INT,
    @ReportType NVARCHAR(50) = 'Summary', -- 'Summary', 'Detailed', 'Forecast'
    @TimeRange NVARCHAR(20) = 'Month' -- 'Day', 'Week', 'Month', 'Year'
AS

BEGIN
    SET NOCOUNT ON;

    IF @prompt IS NULL OR LTRIM(RTRIM(@prompt)) = ''
        THROW 50120, 'Prompt is required for video generation.', 1;

    IF @targetDurationMs IS NULL OR @targetDurationMs <= 0
        SET @targetDurationMs = 4000;

    IF @targetFps IS NULL OR @targetFps <= 0
        SET @targetFps = 24;

    DECLARE @promptEmbedding VECTOR(1998);
    DECLARE @embeddingDim INT;
    EXEC dbo.sp_TextToEmbedding @text = @prompt, @ModelName = NULL, @embedding = @promptEmbedding OUTPUT, @dimension = @embeddingDim OUTPUT;

    DECLARE @models TABLE (ModelId INT PRIMARY KEY, Weight FLOAT NOT NULL, ModelName NVARCHAR(200));

    INSERT INTO @models (ModelId, Weight, ModelName)
    SELECT ModelId, Weight, ModelName
    FROM dbo.fn_SelectModelsForTask('video_generation', @ModelIds, NULL, 'video,vision', 'video_generation');

    IF NOT EXISTS (SELECT 1 FROM @models)
        THROW 50121, 'No video-capable models are configured for generation.', 1;

    DECLARE @modelsJson NVARCHAR(MAX) = (
        SELECT ModelId, Weight, ModelName FROM @models FOR JSON PATH
    );

    DECLARE @requestJson NVARCHAR(MAX) = JSON_OBJECT(
        'prompt': @prompt,
        'targetDurationMs': @targetDurationMs,
        'targetFps': @targetFps,
        'top_k': @top_k
    );

    DECLARE @inferenceId BIGINT;
    INSERT INTO dbo.InferenceRequests (TaskType, InputData, ModelsUsed, EnsembleStrategy, OutputMetadata)
    VALUES (
        'video_generation',
        CONVERT(NVARCHAR(MAX), @requestJson),
        CONVERT(NVARCHAR(MAX), @modelsJson),
        'temporal_recombination',
        JSON_OBJECT('status': 'running')
    );
    SET @inferenceId = SCOPE_IDENTITY();

    DECLARE @startTime DATETIME2 = SYSUTCDATETIME();

    DECLARE @videoCandidates TABLE (
        VideoId BIGINT,
        SourcePath NVARCHAR(500),
        DurationMs BIGINT,
        Fps INT,
        Width INT,
        Height INT,
        Score FLOAT,
        Distance FLOAT,
        Rank INT
    );

    IF @promptEmbedding IS NOT NULL
    BEGIN
        ;WITH VideoBase AS (
            SELECT
                vid.VideoId,
                vid.SourcePath,
                vid.DurationMs,
                vid.Fps,
                vid.ResolutionWidth,
                vid.ResolutionHeight,
                VECTOR_DISTANCE('cosine', vid.GlobalEmbedding, @promptEmbedding) AS Distance
            FROM dbo.Videos vid
            WHERE vid.GlobalEmbedding IS NOT NULL
        )
        INSERT INTO @videoCandidates (VideoId, SourcePath, DurationMs, Fps, Width, Height, Score, Distance, Rank)
        SELECT TOP (@top_k)
            VideoId,
            SourcePath,
            DurationMs,
            Fps,
            ResolutionWidth,
            ResolutionHeight,
            1.0 - Distance,
            Distance,
            ROW_NUMBER() OVER (ORDER BY Distance, VideoId)
        FROM VideoBase
        ORDER BY Distance, VideoId;
    END;

    DECLARE @frameCount INT = CEILING(@targetDurationMs / (1000.0 / @targetFps));

    DECLARE @frames TABLE (
        FrameIndex INT,
        VideoId BIGINT,
        SourceFrameId BIGINT,
        TimestampMs BIGINT,
        PixelCloud GEOMETRY,
        ObjectRegions GEOMETRY,
        MotionVectors GEOMETRY,
        FrameEmbedding VECTOR(1998)  -- Changed from 768 to match VideoFrames.FrameEmbedding
    );

    IF EXISTS (SELECT 1 FROM @videoCandidates)
    BEGIN
        INSERT INTO @frames (FrameIndex, VideoId, SourceFrameId, TimestampMs, PixelCloud, ObjectRegions, MotionVectors, FrameEmbedding)
        SELECT TOP (@frameCount)
            ROW_NUMBER() OVER (ORDER BY c.Rank, vf.TimestampMs) - 1 AS FrameIndex,
            vf.VideoId,
            vf.FrameId,
            vf.TimestampMs,
            vf.PixelCloud,
            vf.ObjectRegions,
            vf.MotionVectors,
            vf.FrameEmbedding
        FROM dbo.VideoFrames vf
        INNER JOIN @videoCandidates c ON c.VideoId = vf.VideoId
        ORDER BY c.Rank, vf.TimestampMs;
    END;

    IF NOT EXISTS (SELECT 1 FROM @frames)
    BEGIN
        ;WITH Numbers AS (
            SELECT TOP (@frameCount) ROW_NUMBER() OVER (ORDER BY (SELECT NULL)) - 1 AS idx
            FROM sys.all_objects
        )
        INSERT INTO @frames (FrameIndex, VideoId, SourceFrameId, TimestampMs, PixelCloud, ObjectRegions, MotionVectors, FrameEmbedding)
        SELECT
            idx,
            NULL,
            NULL,
            idx * (1000 / @targetFps),
            geometry::STGeomFromText(
                'POINT(' + CAST(COS(idx * 0.25) AS NVARCHAR(40)) + ' ' + CAST(SIN(idx * 0.25) AS NVARCHAR(40)) + ')',
                0
            ),
            NULL,
            NULL,
            NULL
        FROM Numbers;
    END;

    DECLARE @durationMs INT = DATEDIFF(MILLISECOND, @startTime, SYSUTCDATETIME());
    DECLARE @framesJson NVARCHAR(MAX) = (
        SELECT FrameIndex, VideoId, SourceFrameId, TimestampMs,
               CASE WHEN PixelCloud IS NULL THEN NULL ELSE PixelCloud.STAsText() END AS PixelCloudWkt,
               CASE WHEN ObjectRegions IS NULL THEN NULL ELSE ObjectRegions.STAsText() END AS ObjectRegionsWkt,
               CASE WHEN MotionVectors IS NULL THEN NULL ELSE MotionVectors.STAsText() END AS MotionVectorsWkt
        FROM @frames
        ORDER BY FrameIndex
        FOR JSON PATH
    );

    DECLARE @candidatesJson NVARCHAR(MAX) = NULL;
    IF EXISTS (SELECT 1 FROM @videoCandidates)
    BEGIN
        SET @candidatesJson = (
            SELECT VideoId, SourcePath, DurationMs, Fps, Width, Height, Score, Distance, Rank
            FROM @videoCandidates
            ORDER BY Rank
            FOR JSON PATH
        );
    END;

    DECLARE @outputJson NVARCHAR(MAX) = JSON_OBJECT(
        'frames': JSON_QUERY(@framesJson),
        'candidates': JSON_QUERY(@candidatesJson),
        'targetFps': @targetFps
    );

    UPDATE dbo.InferenceRequests
    SET TotalDurationMs = @durationMs,
        OutputData = @outputJson,
        OutputMetadata = JSON_OBJECT(
            'status': 'completed',
            'frame_count': (SELECT COUNT(*) FROM @frames),
            'candidate_count': (SELECT COUNT(*) FROM @videoCandidates)
        )
    WHERE InferenceId = @inferenceId;

    INSERT INTO dbo.InferenceSteps (InferenceId, StepNumber, OperationType, DurationMs, RowsReturned)
    VALUES (@inferenceId, 1, 'video_candidate_search', @durationMs, ISNULL((SELECT COUNT(*) FROM @videoCandidates), 0));

    SELECT
        @inferenceId AS InferenceId,
        FrameIndex,
        VideoId,
        SourceFrameId,
        TimestampMs,
        PixelCloud,
        ObjectRegions,
        MotionVectors,
        FrameEmbedding
    FROM @frames
    ORDER BY FrameIndex;

    SELECT
        @inferenceId AS InferenceId,
        @prompt AS Prompt,
        @targetDurationMs AS TargetDurationMs,
        @targetFps AS TargetFps,
        @durationMs AS DurationMs,
        JSON_QUERY(@candidatesJson) AS CandidateVideos;
END;

CREATE PROCEDURE dbo.sp_GenerateVideo
    @prompt NVARCHAR(MAX),
    @targetDurationMs INT = 4000,
    @targetFps INT = 24,
    @ModelIds NVARCHAR(MAX) = NULL,
    @top_k INT = 3
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @GenerationStreamId BIGINT;

    IF @Debug = 1
        PRINT 'Starting attention-based generation with model ' + CAST(@ModelId AS NVARCHAR(10));

    -- Validate inputs
    IF @ModelId IS NULL OR @ModelId <= 0
    BEGIN
        RAISERROR('Invalid ModelId: %d', 16, 1, @ModelId);
        RETURN;
    END

    IF @InputAtomIds IS NULL OR LEN(@InputAtomIds) = 0
    BEGIN
        RAISERROR('InputAtomIds cannot be empty', 16, 1);
        RETURN;
    END

    -- Call CLR attention generation function
    SELECT @GenerationStreamId = dbo.fn_GenerateWithAttention(
        @ModelId,
        @InputAtomIds,
        @ContextJson,
        @MaxTokens,
        @Temperature,
        @TopK,
        @TopP,
        @AttentionHeads,
        @TenantId
    );

    IF @GenerationStreamId IS NULL OR @GenerationStreamId <= 0
    BEGIN
        IF @Debug = 1
            PRINT 'Attention generation failed - no stream returned';
        RETURN;
    END

    -- Log the generation
    INSERT INTO dbo.AttentionGenerationLog (
        ModelId,
        InputAtomIds,
        ContextJson,
        MaxTokens,
        Temperature,
        TopK,
        TopP,
        AttentionHeads,
        GenerationStreamId,
        DurationMs,
        TenantId,
        CreatedAt
    )
    VALUES (
        @ModelId,
        @InputAtomIds,
        @ContextJson,
        @MaxTokens,
        @Temperature,
        @TopK,
        @TopP,
        @AttentionHeads,
        @GenerationStreamId,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        @TenantId,
        SYSUTCDATETIME()
    );

    -- Return generation results
    SELECT
        @GenerationStreamId AS GenerationStreamId,
        @ModelId AS ModelId,
        @InputAtomIds AS InputAtomIds,
        @ContextJson AS ContextJson,
        @MaxTokens AS MaxTokens,
        @Temperature AS Temperature,
        @TopK AS TopK,
        @TopP AS TopP,
        @AttentionHeads AS AttentionHeads,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS DurationMs;

    IF @Debug = 1
        PRINT 'Attention-based generation completed, stream ID: ' + CAST(@GenerationStreamId AS NVARCHAR(20));
END;

