CREATE PROCEDURE dbo.sp_GenerateWithAttention
    @ModelId INT,
    @InputAtomIds NVARCHAR(MAX), -- Comma-separated atom IDs
    @ContextJson NVARCHAR(MAX) = '{}',
    @MaxTokens INT = 100,
    @Temperature FLOAT = 1.0,
    @TopK INT = 50,
    @TopP FLOAT = 0.9,
    @AttentionHeads INT = 8,
    @TenantId INT = 0,
    @Debug BIT = 0
AS

BEGIN SET NOCOUNT ON;
PRINT 'HYBRID SEARCH: Spatial filter + Vector rerank';
DECLARE @wkt NVARCHAR(200) = CONCAT('POINT (', @query_spatial_x, ' ', @query_spatial_y, ' ', @query_spatial_z, ')'); DECLARE @query_point GEOMETRY = geometry::STGeomFromText(@wkt, @srid);
DECLARE @candidates TABLE ( AtomEmbeddingId BIGINT PRIMARY KEY, SpatialDistance FLOAT );
-- V3: Added tenant filtering to the candidate selection phase INSERT INTO @candidates (AtomEmbeddingId, SpatialDistance) SELECT TOP (@spatial_candidates) ae.AtomEmbeddingId, ae.SpatialKey.STDistance(@query_point) AS spatial_distance FROM dbo.AtomEmbeddings AS ae INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId WHERE -- V3: TENANCY MODEL (a.TenantId = @TenantId OR EXISTS (SELECT 1 FROM dbo.TenantAtoms ta WHERE ta.AtomId = a.AtomId AND ta.TenantId = @TenantId)) AND ae.SpatialKey IS NOT NULL AND ae.Dimension = @query_dimension AND (@embedding_type IS NULL OR ae.EmbeddingType = @embedding_type) AND (@ModelId IS NULL OR ae.ModelId = @ModelId) ORDER BY ae.SpatialKey.STDistance(@query_point);
-- V3: Added tenant filtering to the final reranking and removed deleted columns SELECT TOP (@final_top_k) ae.AtomEmbeddingId, ae.AtomId, a.Modality, a.Subtype, ae.EmbeddingType, ae.ModelId, VECTOR_DISTANCE(@distance_metric, ae.EmbeddingVector, @query_vector) AS exact_distance, c.SpatialDistance AS spatial_distance FROM dbo.AtomEmbeddings AS ae INNER JOIN @candidates AS c ON c.AtomEmbeddingId = ae.AtomEmbeddingId INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId WHERE -- V3: TENANCY MODEL (redundant check, but safe) (a.TenantId = @TenantId OR EXISTS (SELECT 1 FROM dbo.TenantAtoms ta WHERE ta.AtomId = a.AtomId AND ta.TenantId = @TenantId)) AND ae.EmbeddingVector IS NOT NULL AND ae.Dimension = @query_dimension ORDER BY VECTOR_DISTANCE(@distance_metric, ae.EmbeddingVector, @query_vector);
PRINT 'Hybrid search complete: Spatial O(log n) + Vector O(k)'; END;

CREATE PROCEDURE dbo.sp_HybridSearch
    @query_vector VECTOR(1998),
    @query_dimension INT,
    @query_spatial_x FLOAT,
    @query_spatial_y FLOAT,
    @query_spatial_z FLOAT,
    @spatial_candidates INT = 100,
    @final_top_k INT = 10,
    @distance_metric NVARCHAR(20) = 'cosine',
    @embedding_type NVARCHAR(128) = NULL,
    @ModelId INT = NULL,
    @srid INT = 0,
    @TenantId INT -- V3: Added for security
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @ConversationHandle UNIQUEIDENTIFIER;
    DECLARE @MessageBody XML;
    DECLARE @MessageTypeName NVARCHAR(256);
    DECLARE @Observations NVARCHAR(MAX);
    DECLARE @Hypotheses NVARCHAR(MAX);

    BEGIN TRY
        -- 1. RECEIVE MESSAGE FROM ANALYZE PHASE
        WAITFOR (
            RECEIVE TOP(1)
                @ConversationHandle = conversation_handle,
                @MessageBody = CAST(message_body AS XML),
                @MessageTypeName = message_type_name
            FROM HypothesizeQueue
        ), TIMEOUT 5000; -- 5 second timeout

        IF @ConversationHandle IS NULL
        BEGIN
            PRINT 'sp_Hypothesize: No messages received';
            RETURN 0;
        END

        -- 2. PARSE OBSERVATIONS
        SET @Observations = CAST(@MessageBody AS NVARCHAR(MAX));

        DECLARE @AnalysisId UNIQUEIDENTIFIER = JSON_VALUE(@Observations, '$.analysisId');
        DECLARE @AnomalyCount INT = JSON_VALUE(@Observations, '$.anomalyCount');
        DECLARE @AvgDurationMs FLOAT = JSON_VALUE(@Observations, '$.avgDurationMs');

        -- 3. GENERATE HYPOTHESES BASED ON OBSERVATIONS
        DECLARE @HypothesisList TABLE (
            HypothesisId UNIQUEIDENTIFIER PRIMARY KEY DEFAULT NEWID(),
            HypothesisType NVARCHAR(50),
            Priority INT,
            Description NVARCHAR(MAX),
            ExpectedImpact NVARCHAR(MAX),
            RequiredActions NVARCHAR(MAX)
        );

        -- GDEL ENGINE: Check for compute job messages first
        -- This allows the OODA loop to plan the next chunk of a long-running computational task
        DECLARE @ComputeJobId UNIQUEIDENTIFIER = @MessageBody.value('(/Hypothesis/ComputeJob/JobId)[1]', 'uniqueidentifier');

        IF @ComputeJobId IS NOT NULL
        BEGIN
            PRINT 'sp_Hypothesize: Processing compute job: ' + CAST(@ComputeJobId AS NVARCHAR(36));

            DECLARE @JobParams NVARCHAR(MAX);
            DECLARE @CurrentState NVARCHAR(MAX);
            DECLARE @JobType NVARCHAR(100);

            SELECT 
                @JobParams = CAST(JobParameters AS NVARCHAR(MAX)),
                @CurrentState = CAST(CurrentState AS NVARCHAR(MAX)),
                @JobType = JobType
            FROM dbo.AutonomousComputeJobs
            WHERE JobId = @ComputeJobId AND Status = 'Running';

            IF @JobParams IS NULL
            BEGIN
                PRINT 'sp_Hypothesize: Job not found or already completed.';
                END CONVERSATION @ConversationHandle;
                RETURN 0;
            END

            -- Job type: PrimeSearch
            IF @JobType = 'PrimeSearch'
            BEGIN
                DECLARE @RangeEnd BIGINT = JSON_VALUE(@JobParams, '$.rangeEnd');
                DECLARE @LastChecked BIGINT = ISNULL(JSON_VALUE(@CurrentState, '$.lastChecked'), JSON_VALUE(@JobParams, '$.rangeStart') - 1);
                DECLARE @ChunkSize INT = 10000; -- Process 10k numbers per chunk

                IF @LastChecked >= @RangeEnd
                BEGIN
                    -- Job complete
                    UPDATE dbo.AutonomousComputeJobs
                    SET Status = 'Completed',
                        CompletedAt = SYSUTCDATETIME(),
                        CreatedAt = SYSUTCDATETIME()
                    WHERE JobId = @ComputeJobId;

                    PRINT 'sp_Hypothesize: Job completed.';
                    END CONVERSATION @ConversationHandle;
                    RETURN 0;
                END

                -- Plan next chunk
                DECLARE @NextStart BIGINT = @LastChecked + 1;
                DECLARE @NextEnd BIGINT = @LastChecked + @ChunkSize;
                IF @NextEnd > @RangeEnd SET @NextEnd = @RangeEnd;

                DECLARE @ActPayload XML = (
                    SELECT 
                        @ComputeJobId AS JobId,
                        @NextStart AS RangeStart,
                        @NextEnd AS RangeEnd
                    FOR XML PATH('PrimeSearch'), ROOT('Action')
                );

                DECLARE @ActHandle UNIQUEIDENTIFIER;

                BEGIN DIALOG CONVERSATION @ActHandle
                    FROM SERVICE HypothesizeService
                    TO SERVICE 'ActService'
                    ON CONTRACT [//Hartonomous/AutonomousLoop/ActContract]
                    WITH ENCRYPTION = OFF;

                SEND ON CONVERSATION @ActHandle
                    MESSAGE TYPE [//Hartonomous/AutonomousLoop/ActMessage]
                    (@ActPayload);

                END CONVERSATION @ConversationHandle;

                PRINT 'sp_Hypothesize: Planned chunk [' + CAST(@NextStart AS NVARCHAR(20)) + ', ' + CAST(@NextEnd AS NVARCHAR(20)) + ']';
                RETURN 0;
            END
        END

        -- REGULAR OODA LOOP: Generate hypotheses based on performance observations
        DECLARE @JobTypeOld NVARCHAR(100) = JSON_VALUE(@Observations, '$.jobType');

        IF @JobTypeOld IS NOT NULL AND @JobTypeOld != ''
        BEGIN
            -- Old-style job messages (for backward compatibility with sp_StartPrimeSearch)
            -- These will be migrated to use AutonomousComputeJobs table
            PRINT 'sp_Hypothesize: Received old-style job message. Consider migrating to AutonomousComputeJobs.';
        END

        -- HYPOTHESIS GENERATION: Analyze system performance and suggest improvements
        -- HYPOTHESIS 1: If anomalies detected, suggest index optimization
            IF @AnomalyCount > 5
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'IndexOptimization',
                    1,
                    'High number of performance anomalies detected. Missing indexes may be causing slow queries.',
                    '{"latencyReduction": "50-70%", "throughputIncrease": "30-50%"}',
                    '["AnalyzeMissingIndexes", "CreateRecommendedIndexes", "UpdateStatistics"]'
                );
            END

            -- HYPOTHESIS 2: If average duration increasing, suggest cache warming
            IF @AvgDurationMs > 1000
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'CacheWarming',
                    2,
                    'Average inference duration exceeds 1 second. Cache warming could reduce cold-start latency.',
                    '{"latencyReduction": "30-40%", "cacheHitRate": "60-80%"}',
                    '["PreloadFrequentEmbeddings", "EnableInMemoryOLTP", "OptimizeBufferPool"]'
                );
            END

            -- HYPOTHESIS 3: If embedding clusters detected, suggest concept discovery
            DECLARE @PatternCount INT = (
                SELECT COUNT(*) 
                FROM OPENJSON(@Observations, '$.patterns')
            );

            IF @PatternCount > 3
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'ConceptDiscovery',
                    3,
                    'Embedding clustering patterns detected. Unsupervised concept learning may reveal emergent semantics.',
                    '{"newConceptsExpected": ' + CAST(@PatternCount AS NVARCHAR(10)) + ', "accuracyImprovement": "5-15%"}',
                    '["RunClusterAnalysis", "ExtractConceptEmbeddings", "BindConceptsToAtoms"]'
                );
            END

            -- HYPOTHESIS 4: Model retraining if drift detected
            DECLARE @InferenceCount INT = JSON_VALUE(@Observations, '$.totalInferences');
            IF @InferenceCount > 10000
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'ModelRetraining',
                    4,
                    'High inference volume detected. Incremental model retraining may capture recent patterns.',
                    '{"accuracyImprovement": "3-8%", "recentDataCoverage": "95%"}',
                    '["CollectRecentFeedback", "IncrementalRetrain", "ValidateModelDrift"]'
                );
            END

            -- HYPOTHESIS 5: Prune model based on low-importance tensor atoms
            DECLARE @PruneThreshold FLOAT = 0.01; -- Define a threshold for low importance
            DECLARE @PruneableAtoms NVARCHAR(MAX) = (
                SELECT ta.TensorAtomId, tac.Coefficient
                FROM dbo.TensorAtoms ta
                JOIN dbo.TensorAtomCoefficients tac ON ta.TensorAtomId = tac.TensorAtomId
                WHERE tac.Coefficient < @PruneThreshold
                FOR JSON PATH
            );

            IF @PruneableAtoms IS NOT NULL AND @PruneableAtoms <> '[]'
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'PruneModel',
                    5,
                    'Identified tensor atoms with low importance coefficients. Pruning these may reduce model size and improve performance.',
                    '{"modelSizeReduction": "5-10%", "inferenceSpeedup": "3-5%"}',
                    @PruneableAtoms
                );
            END

            -- HYPOTHESIS 6: Refactor code based on duplicate AST signatures
            DECLARE @DuplicateCodeAtoms NVARCHAR(MAX) = (
                SELECT TOP 10 SpatialSignature.ToString() AS Signature, COUNT(*) AS DuplicateCount
                FROM dbo.CodeAtoms
                GROUP BY SpatialSignature.ToString()
                HAVING COUNT(*) > 1
                ORDER BY COUNT(*) DESC
                FOR JSON PATH
            );

            IF @DuplicateCodeAtoms IS NOT NULL AND @DuplicateCodeAtoms <> '[]'
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'RefactorCode',
                    6,
                    'Detected multiple code blocks with identical abstract syntax tree (AST) signatures, indicating duplicated logic.',
                    '{"codebaseReduction": "1-2%", "maintainabilityIncrease": "medium"}',
                    @DuplicateCodeAtoms
                );
            END

            -- HYPOTHESIS 7: Fix UX based on sessions ending in an error state
            -- This assumes an @ErrorRegion GEOMETRY variable is defined, representing error states.
            DECLARE @ErrorRegion GEOMETRY = geometry::Point(0, 0, 0).STBuffer(10); -- Placeholder for error region
            DECLARE @FailingSessions NVARCHAR(MAX) = (
                SELECT TOP 10 SessionId, Path.STEndPoint().ToString() AS EndPoint
                FROM dbo.SessionPaths
                WHERE Path.STEndPoint().STIntersects(@ErrorRegion) = 1
                FOR JSON PATH
            );

            IF @FailingSessions IS NOT NULL AND @FailingSessions <> '[]'
            BEGIN
                INSERT INTO @HypothesisList (HypothesisType, Priority, Description, ExpectedImpact, RequiredActions)
                VALUES (
                    'FixUX',
                    7,
                    'Detected user sessions terminating in a known error region of the state space.',
                    '{"userErrorRateReduction": "10-20%", "sessionCompletionIncrease": "5%"}',
                    @FailingSessions
                );
            END


        -- 4. PERSIST HYPOTHESES AS PENDING ACTIONS
        -- This enables the Act phase to execute them in priority order
        INSERT INTO dbo.PendingActions (ActionType, Parameters, Priority)
        SELECT 
            HypothesisType,
            JSON_OBJECT(
                'description': Description,
                'expectedImpact': JSON_QUERY(ExpectedImpact),
                'requiredActions': JSON_QUERY(RequiredActions)
            ),
            Priority
        FROM @HypothesisList
        WHERE NOT EXISTS (
            -- Avoid duplicate actions
            SELECT 1 FROM dbo.PendingActions pa
            WHERE pa.ActionType = [@HypothesisList].HypothesisType
              AND pa.Status = 'Pending'
        );

        -- 5. COMPILE HYPOTHESES FOR MESSAGING
        SELECT @Hypotheses = (
            SELECT 
                HypothesisId,
                HypothesisType,
                Priority,
                Description,
                JSON_QUERY(ExpectedImpact) AS ExpectedImpact,
                JSON_QUERY(RequiredActions) AS RequiredActions
            FROM @HypothesisList
            ORDER BY Priority
            FOR JSON PATH
        );

        DECLARE @HypothesisCount INT = (SELECT COUNT(*) FROM @HypothesisList);

        DECLARE @HypothesisPayload NVARCHAR(MAX) = JSON_OBJECT(
            'analysisId': @AnalysisId,
            'hypothesesGenerated': @HypothesisCount,
            'hypotheses': JSON_QUERY(@Hypotheses),
            'timestamp': FORMAT(SYSUTCDATETIME(), 'yyyy-MM-ddTHH:mm:ss.fffZ')
        );

        -- 6. SEND TO ACT QUEUE
        DECLARE @ActConversationHandle UNIQUEIDENTIFIER;
        DECLARE @ActMessageBody XML = CAST(@HypothesisPayload AS XML);

        BEGIN DIALOG CONVERSATION @ActConversationHandle
            FROM SERVICE HypothesizeService
            TO SERVICE 'ActService'
            ON CONTRACT [//Hartonomous/AutonomousLoop/ActContract]
            WITH ENCRYPTION = OFF;

        SEND ON CONVERSATION @ActConversationHandle
            MESSAGE TYPE [//Hartonomous/AutonomousLoop/ActMessage]
            (@ActMessageBody);

        -- 7. END ORIGINAL CONVERSATION
        END CONVERSATION @ConversationHandle;

        PRINT 'sp_Hypothesize completed: ' + CAST(@HypothesisCount AS VARCHAR(10)) + ' hypotheses generated';
        PRINT 'Hypotheses: ' + @Hypotheses;

        RETURN 0;
    END TRY
    BEGIN CATCH
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        DECLARE @ErrorSeverity INT = ERROR_SEVERITY();
        DECLARE @ErrorState INT = ERROR_STATE();

        IF @ConversationHandle IS NOT NULL
        BEGIN
            END CONVERSATION @ConversationHandle WITH ERROR = 1 DESCRIPTION = @ErrorMessage;
        END

        PRINT 'sp_Hypothesize ERROR: ' + @ErrorMessage;
        RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState);
        RETURN -1;
    END CATCH
END;

BEGIN SET NOCOUNT ON;
PRINT 'INFERENCE HISTORY ANALYSIS'; PRINT ' Time window: Last ' + CAST(@time_window_hours AS VARCHAR(10)) + ' hours';
DECLARE @cutoff_time DATETIME2 = DATEADD(HOUR, -@time_window_hours, SYSUTCDATETIME());
SELECT TaskType, COUNT(*) AS request_count, AVG(TotalDurationMs) AS avg_duration_ms, MIN(TotalDurationMs) AS min_duration_ms, MAX(TotalDurationMs) AS max_duration_ms, SUM(CASE WHEN OutputData IS NOT NULL THEN 1 ELSE 0 END) AS successful_count, SUM(CASE WHEN OutputData IS NULL THEN 1 ELSE 0 END) AS failed_count, SUM(CASE WHEN CacheHit = 1 THEN 1 ELSE 0 END) AS cache_hits FROM dbo.InferenceRequests WHERE RequestTimestamp >= @cutoff_time AND (@TaskType IS NULL OR TaskType = @TaskType) GROUP BY TaskType ORDER BY request_count DESC;
PRINT ' Inference history analysis complete'; END

CREATE PROCEDURE dbo.sp_InferenceHistory
    @time_window_hours INT = 24,
    @TaskType NVARCHAR(50) = NULL
AS

BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        BEGIN TRANSACTION;

        -- Validate inputs
        IF @ModelName IS NULL OR @ModelType IS NULL
        BEGIN
            RAISERROR('ModelName and ModelType are required', 16, 1);
            RETURN -1;
        END

        IF @ModelBytes IS NULL AND @FileStreamPath IS NULL
        BEGIN
            RAISERROR('Either ModelBytes or FileStreamPath must be provided', 16, 1);
            RETURN -1;
        END

        -- Create model record
        INSERT INTO dbo.Models (
            ModelName,
            ModelType,
            Architecture,
            Config,
            ParameterCount,
            TenantId,
            IsActive
        )
        VALUES (
            @ModelName,
            @ModelType,
            @Architecture,
            @ConfigJson,
            @ParameterCount,
            @TenantId,
            1
        );

        SET @ModelId = SCOPE_IDENTITY();

        -- Store model data
        IF @ModelBytes IS NOT NULL
        BEGIN
            -- Small model: Store directly in varbinary column
            UPDATE dbo.Models
            SET SerializedModel = @ModelBytes
            WHERE ModelId = @ModelId;
        END
        ELSE IF @FileStreamPath IS NOT NULL
        BEGIN
            -- Large model path storage
            -- NOTE: SerializedModel column is VARBINARY(MAX), not FILESTREAM
            -- File-based storage would require CLR Win32 API integration
            -- For now, just log the intended path
            PRINT 'Model file path provided: ' + @FileStreamPath;
            PRINT 'NOTE: File-based model storage not yet implemented. Use @ModelBytes parameter instead.';
        END

        -- Set as current version if requested
        IF @SetAsCurrent = 1
        BEGIN
            -- Deactivate previous versions
            UPDATE dbo.Models
            SET IsActive = 0
            WHERE ModelName = @ModelName
                  AND ModelId != @ModelId
                  AND TenantId = @TenantId;
        END

        -- Log model ingestion
        INSERT INTO provenance.ModelVersionHistory (
            ModelId,
            VersionTag,
            ChangeDescription,
            TenantId
        )
        VALUES (
            @ModelId,
            '1.0',
            'Initial model ingestion via sp_IngestModel',
            @TenantId
        );

        COMMIT TRANSACTION;

        SELECT 
            @ModelId AS ModelId,
            @ModelName AS ModelName,
            DATALENGTH(@ModelBytes) AS ModelSizeBytes,
            @SetAsCurrent AS IsCurrentVersion;

        PRINT 'Model ingested successfully: ' + 
              @ModelName + ' (ModelId: ' + CAST(@ModelId AS VARCHAR(10)) + ')';

        RETURN 0;
    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0
            ROLLBACK TRANSACTION;

        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        DECLARE @ErrorSeverity INT = ERROR_SEVERITY();
        DECLARE @ErrorState INT = ERROR_STATE();

        PRINT 'sp_IngestModel ERROR: ' + @ErrorMessage;
        RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState);
        RETURN -1;
    END CATCH
END;

-- Auto-split from dbo.ModelManagement.sql
-- Object: PROCEDURE dbo.sp_IngestModel

CREATE PROCEDURE dbo.sp_IngestModel
    @ModelName NVARCHAR(200),
    @ModelType NVARCHAR(50),
    @Architecture NVARCHAR(100),
    @ConfigJson NVARCHAR(MAX),
    @ModelBytes VARBINARY(MAX) = NULL,
    @FileStreamPath NVARCHAR(500) = NULL,
    @ParameterCount BIGINT = NULL,
    @TenantId INT = 0,
    @SetAsCurrent BIT = 0,
    @ModelId INT OUTPUT
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @ConversationHandle UNIQUEIDENTIFIER;
    DECLARE @MessageBody XML;
    DECLARE @MessageTypeName NVARCHAR(256);
    DECLARE @ExecutionResultsJson NVARCHAR(MAX);
    DECLARE @LearningOutcomes NVARCHAR(MAX);

    BEGIN TRY
        -- 1. RECEIVE MESSAGE FROM ACT PHASE
        WAITFOR (
            RECEIVE TOP(1)
                @ConversationHandle = conversation_handle,
                @MessageBody = CAST(message_body AS XML),
                @MessageTypeName = message_type_name
            FROM LearnQueue
        ), TIMEOUT 5000; -- 5 second timeout

        IF @ConversationHandle IS NULL
        BEGIN
            PRINT 'sp_Learn: No messages received';
            RETURN 0;
        END

        -- 2. PARSE EXECUTION RESULTS
        SET @ExecutionResultsJson = CAST(@MessageBody AS NVARCHAR(MAX));

        DECLARE @AnalysisId UNIQUEIDENTIFIER = JSON_VALUE(@ExecutionResultsJson, '$.analysisId');
        DECLARE @ExecutedActions INT = JSON_VALUE(@ExecutionResultsJson, '$.executedActions');
        DECLARE @QueuedActions INT = JSON_VALUE(@ExecutionResultsJson, '$.queuedActions');
        DECLARE @FailedActions INT = JSON_VALUE(@ExecutionResultsJson, '$.failedActions');

        -- 3. MEASURE PERFORMANCE DELTA
        -- Baseline metrics (from before actions)
        DECLARE @BaselineAvgDurationMs FLOAT;
        DECLARE @BaselineThroughput INT;

        SELECT 
            @BaselineAvgDurationMs = AVG(TotalDurationMs),
            @BaselineThroughput = COUNT(*)
        FROM dbo.InferenceRequests
        WHERE RequestTimestamp >= DATEADD(HOUR, -24, SYSUTCDATETIME())
              AND RequestTimestamp < DATEADD(MINUTE, -5, SYSUTCDATETIME()); -- Baseline: 24 hours ago to 5 minutes ago

        -- Current metrics (after actions)
        DECLARE @CurrentAvgDurationMs FLOAT;
        DECLARE @CurrentThroughput INT;

        SELECT 
            @CurrentAvgDurationMs = AVG(TotalDurationMs),
            @CurrentThroughput = COUNT(*)
        FROM dbo.InferenceRequests
        WHERE RequestTimestamp >= DATEADD(MINUTE, -5, SYSUTCDATETIME()); -- Recent: last 5 minutes

        -- Calculate deltas
        DECLARE @LatencyImprovement FLOAT = 
            CASE WHEN @BaselineAvgDurationMs > 0 
                 THEN ((@BaselineAvgDurationMs - @CurrentAvgDurationMs) / @BaselineAvgDurationMs) * 100
                 ELSE 0 
            END;

        DECLARE @ThroughputChange FLOAT = 
            CASE WHEN @BaselineThroughput > 0 
                 THEN ((@CurrentThroughput - @BaselineThroughput) / CAST(@BaselineThroughput AS FLOAT)) * 100
                 ELSE 0 
            END;

        -- 4. ANALYZE ACTION OUTCOMES
        DECLARE @ActionOutcomes TABLE (
            HypothesisId UNIQUEIDENTIFIER,
            HypothesisType NVARCHAR(50),
            ActionStatus NVARCHAR(50),
            Outcome NVARCHAR(50),
            ImpactScore FLOAT
        );

        INSERT INTO @ActionOutcomes
        SELECT 
            HypothesisId,
            HypothesisType,
            ActionStatus,
            CASE 
                WHEN ActionStatus = 'Executed' AND @LatencyImprovement > 10 THEN 'HighSuccess'
                WHEN ActionStatus = 'Executed' AND @LatencyImprovement > 0 THEN 'Success'
                WHEN ActionStatus = 'Executed' AND @LatencyImprovement < 0 THEN 'Regressed'
                WHEN ActionStatus = 'Failed' THEN 'Failed'
                ELSE 'Neutral'
            END AS Outcome,
            @LatencyImprovement AS ImpactScore
        FROM OPENJSON(@ExecutionResultsJson, '$.results')
        WITH (
            HypothesisId UNIQUEIDENTIFIER,
            HypothesisType NVARCHAR(50),
            ActionStatus NVARCHAR(50)
        );

        -- GDEL ENGINE: Check for compute job result messages first
        -- This is where we update job state and loop back to continue the computation
        DECLARE @PrimeResultJobId UNIQUEIDENTIFIER = @MessageBody.value('(/Learn/PrimeResult/JobId)[1]', 'uniqueidentifier');

        IF @PrimeResultJobId IS NOT NULL
        BEGIN
            DECLARE @LastCheckedValue BIGINT = @MessageBody.value('(/Learn/PrimeResult/LastChecked)[1]', 'bigint');
            DECLARE @ResultData NVARCHAR(MAX) = @MessageBody.value('(/Learn/PrimeResult/PrimesFound)[1]', 'nvarchar(max)');

            PRINT 'sp_Learn: Processing prime search results for JobId: ' + CAST(@PrimeResultJobId AS NVARCHAR(36));
            PRINT 'sp_Learn: Last checked: ' + CAST(@LastCheckedValue AS NVARCHAR(20));
            PRINT 'sp_Learn: Primes found: ' + @ResultData;

            -- Update job state
            UPDATE dbo.AutonomousComputeJobs
            SET 
                CurrentState = JSON_MODIFY(
                    ISNULL(CurrentState, '{}'),
                    '$.lastChecked',
                    @LastCheckedValue
                ),
                Results = CASE
                    WHEN Results IS NULL THEN @ResultData
                    ELSE (
                        SELECT STRING_AGG(value, ',')
                        FROM (
                            SELECT value FROM OPENJSON(Results)
                            UNION ALL
                            SELECT value FROM OPENJSON(@ResultData)
                        ) AS combined
                    )
                END,
                CreatedAt = SYSUTCDATETIME()
            WHERE JobId = @PrimeResultJobId;

            -- Send message back to Analyze to continue the loop
            DECLARE @AnalyzePayload XML = (
                SELECT @PrimeResultJobId AS JobId
                FOR XML PATH('JobRequest'), ROOT('Analysis')
            );

            DECLARE @ContinueHandle UNIQUEIDENTIFIER;

            BEGIN DIALOG CONVERSATION @ContinueHandle
                FROM SERVICE LearnService
                TO SERVICE 'AnalyzeService'
                ON CONTRACT [//Hartonomous/AutonomousLoop/AnalyzeContract]
                WITH ENCRYPTION = OFF;

            SEND ON CONVERSATION @ContinueHandle
                MESSAGE TYPE [//Hartonomous/AutonomousLoop/AnalyzeMessage]
                (@AnalyzePayload);

            END CONVERSATION @ConversationHandle;

            PRINT 'sp_Learn: Job state updated, continuing OODA loop.';
            RETURN 0;
        END

        -- REGULAR OODA LOOP: Measure performance delta for system improvements
        -- 5. STORE IMPROVEMENT HISTORY
        -- (Note: AutonomousImprovementHistory table to be created in future migration)
        -- For now, just compile the learning outcomes

        DECLARE @SuccessfulActions INT = (SELECT COUNT(*) FROM @ActionOutcomes WHERE Outcome IN ('Success', 'HighSuccess'));
        DECLARE @RegressedActions INT = (SELECT COUNT(*) FROM @ActionOutcomes WHERE Outcome = 'Regressed');

        SELECT @LearningOutcomes = (
            SELECT 
                HypothesisId,
                HypothesisType,
                ActionStatus,
                Outcome,
                ImpactScore
            FROM @ActionOutcomes
            FOR JSON PATH
        );

        -- PARADIGM-COMPLIANT FIX: Close the feedback loop by fine-tuning the model
        -- This is the "L" (Learn) in OODA - actually update model weights based on success/failure
        IF EXISTS (
            SELECT 1 
            FROM dbo.AutonomousImprovementHistory 
            WHERE CompletedAt >= DATEADD(HOUR, -1, SYSUTCDATETIME())
                AND GeneratedCode IS NOT NULL
                AND SuccessScore > 0.7 -- Only learn from successful improvements
        )
        BEGIN
            -- Trigger model weight updates for successful code generations
            DECLARE @ImprovementCursor CURSOR;
            DECLARE @ImprovementId UNIQUEIDENTIFIER;
            DECLARE @GeneratedCode NVARCHAR(MAX);
            DECLARE @SuccessScore DECIMAL(5,4);

            SET @ImprovementCursor = CURSOR FOR
                SELECT ImprovementId, GeneratedCode, SuccessScore
                FROM dbo.AutonomousImprovementHistory
                WHERE CompletedAt >= DATEADD(HOUR, -1, SYSUTCDATETIME())
                    AND SuccessScore > 0.7
                ORDER BY SuccessScore DESC;

            OPEN @ImprovementCursor;
            FETCH NEXT FROM @ImprovementCursor INTO @ImprovementId, @GeneratedCode, @SuccessScore;

            WHILE @@FETCH_STATUS = 0
            BEGIN
                -- Update model weights using the successful code as a training sample
                -- This fine-tunes the code generation model (e.g., Qwen3-Coder)
                BEGIN TRY
                    EXEC dbo.sp_UpdateModelWeightsFromFeedback
                        @ModelName = 'Qwen3-Coder-32B',
                        @TrainingSample = @GeneratedCode,
                        @RewardSignal = @SuccessScore,
                        @learningRate = 0.0001,
                        @TenantId = @TenantId;

                    -- Log the weight update
                    PRINT 'Model weights updated for improvement: ' + CAST(@ImprovementId AS NVARCHAR(36));
                END TRY
                BEGIN CATCH
                    -- Log but don't fail the learning cycle
                    PRINT 'Weight update failed for ' + CAST(@ImprovementId AS NVARCHAR(36)) + ': ' + ERROR_MESSAGE();
                END CATCH

                FETCH NEXT FROM @ImprovementCursor INTO @ImprovementId, @GeneratedCode, @SuccessScore;
            END

            CLOSE @ImprovementCursor;
            DEALLOCATE @ImprovementCursor;
        END

        DECLARE @LearningPayload NVARCHAR(MAX) = (
            SELECT 
                @AnalysisId AS analysisId,
                1 AS learningCycleComplete,
                (SELECT 
                    @BaselineAvgDurationMs AS baselineLatencyMs,
                    @CurrentAvgDurationMs AS currentLatencyMs,
                    @LatencyImprovement AS latencyImprovement,
                    @ThroughputChange AS throughputChange
                    FOR JSON PATH, WITHOUT_ARRAY_WRAPPER) AS performanceMetrics,
                (SELECT 
                    @SuccessfulActions AS successfulActions,
                    @RegressedActions AS regressedActions,
                    @ExecutedActions AS totalActions
                    FOR JSON PATH, WITHOUT_ARRAY_WRAPPER) AS actionOutcomes,
                JSON_QUERY(@LearningOutcomes) AS outcomes,
                FORMAT(SYSUTCDATETIME(), 'yyyy-MM-ddTHH:mm:ss.fffZ') AS timestamp
            FOR JSON PATH, WITHOUT_ARRAY_WRAPPER
        );

        -- 6. DETERMINE NEXT ACTION
        -- If significant improvement, restart cycle immediately
        -- If regression, wait longer before next cycle
        DECLARE @NextCycleDelayMinutes INT = 
            CASE 
                WHEN @LatencyImprovement > 20 THEN 5  -- High success: check again soon
                WHEN @LatencyImprovement > 0 THEN 15  -- Success: normal interval
                WHEN @LatencyImprovement < 0 THEN 60  -- Regression: wait longer
                ELSE 30                               -- Neutral: moderate interval
            END;

        -- 7. RESTART OODA LOOP (send back to Analyze)
        DECLARE @AnalyzeConversationHandle UNIQUEIDENTIFIER;

        -- Build analysis trigger message
        DECLARE @AnalyseTrigger NVARCHAR(MAX) = (
            SELECT 
                'LearningCycleComplete' AS triggerReason,
                @AnalysisId AS previousAnalysisId,
                @LatencyImprovement AS latencyImprovement,
                @NextCycleDelayMinutes AS delayMinutes,
                FORMAT(SYSUTCDATETIME(), 'yyyy-MM-ddTHH:mm:ss.fffZ') AS timestamp
            FOR JSON PATH, WITHOUT_ARRAY_WRAPPER
        );

        DECLARE @AnalyzeMessageBody XML = CAST(@AnalyseTrigger AS XML);

        -- Only restart if we have meaningful data
        IF @ExecutedActions > 0
        BEGIN
            -- Wait for the calculated delay before restarting
            WAITFOR DELAY @NextCycleDelayMinutes;

            BEGIN DIALOG CONVERSATION @AnalyzeConversationHandle
                FROM SERVICE LearnService
                TO SERVICE 'AnalyzeService'
                ON CONTRACT [//Hartonomous/AutonomousLoop/AnalyzeContract]
                WITH ENCRYPTION = OFF;

            SEND ON CONVERSATION @AnalyzeConversationHandle
                MESSAGE TYPE [//Hartonomous/AutonomousLoop/AnalyzeMessage]
                (@AnalyzeMessageBody);
        END

        -- 8. END ORIGINAL CONVERSATION
        END CONVERSATION @ConversationHandle;

        PRINT 'sp_Learn completed: ' + 
              CAST(@LatencyImprovement AS VARCHAR(20)) + '% latency improvement, ' +
              CAST(@SuccessfulActions AS VARCHAR(10)) + ' successful actions';
        PRINT 'Learning Outcomes: ' + @LearningOutcomes;
        PRINT 'Next OODA cycle starts in ' + CAST(@NextCycleDelayMinutes AS VARCHAR(10)) + ' minutes';

        RETURN 0;
    END TRY
    BEGIN CATCH
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        DECLARE @ErrorSeverity INT = ERROR_SEVERITY();
        DECLARE @ErrorState INT = ERROR_STATE();

        IF @ConversationHandle IS NOT NULL
        BEGIN
            END CONVERSATION @ConversationHandle WITH ERROR = 1 DESCRIPTION = @ErrorMessage;
        END

        PRINT 'sp_Learn ERROR: ' + @ErrorMessage;
        RAISERROR(@ErrorMessage, @ErrorSeverity, @ErrorState);
        RETURN -1;
    END CATCH
END;

BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        BEGIN TRANSACTION;

        DECLARE @ParentAtoms TABLE (AtomId BIGINT);

        -- Parse parent atom IDs
        INSERT INTO @ParentAtoms
        SELECT CAST(value AS BIGINT)
        FROM STRING_SPLIT(@ParentAtomIds, ',');

        -- Create graph edges (parent  child)
        INSERT INTO provenance.AtomGraphEdges (FromAtomId, ToAtomId, DependencyType, TenantId)
        SELECT 
            pa.AtomId,
