INSERT INTO @AllAtoms SELECT DISTINCT ae.AtomId FROM dbo.AtomEmbeddings ae LEFT JOIN dbo.TenantAtoms ta ON ae.AtomId = ta.AtomId WHERE (@TenantId IS NULL OR ta.TenantId = @TenantId) AND ae.ModelId IN (@Model1Id, @Model2Id, @Model3Id);
-- Score each atom with each model INSERT INTO @EnsembleResults (AtomId, Model1Score, Model2Score, Model3Score) SELECT aa.AtomId, ISNULL( (SELECT 1.0 - VECTOR_DISTANCE('cosine', ae1.EmbeddingVector, @QueryVector1) FROM dbo.AtomEmbeddings ae1 WHERE ae1.AtomId = aa.AtomId AND ae1.ModelId = @Model1Id), 0.0 ) AS Model1Score, ISNULL( (SELECT 1.0 - VECTOR_DISTANCE('cosine', ae2.EmbeddingVector, @QueryVector2) FROM dbo.AtomEmbeddings ae2 WHERE ae2.AtomId = aa.AtomId AND ae2.ModelId = @Model2Id), 0.0 ) AS Model2Score, ISNULL( (SELECT 1.0 - VECTOR_DISTANCE('cosine', ae3.EmbeddingVector, @QueryVector3) FROM dbo.AtomEmbeddings ae3 WHERE ae3.AtomId = aa.AtomId AND ae3.ModelId = @Model3Id), 0.0 ) AS Model3Score FROM @AllAtoms aa;
-- Compute weighted ensemble score UPDATE @EnsembleResults SET EnsembleScore = (Model1Score * @Model1Weight) + (Model2Score * @Model2Weight) + (Model3Score * @Model3Weight);
-- Return top K SELECT TOP (@TopK) er.AtomId, er.Model1Score, er.Model2Score, er.Model3Score, er.EnsembleScore, a.ContentHash, a.ContentType FROM @EnsembleResults er INNER JOIN dbo.Atoms a ON er.AtomId = a.AtomId -- No need for second TenantAtoms filter - already filtered in AllAtoms collection ORDER BY er.EnsembleScore DESC;
RETURN 0; END TRY BEGIN CATCH DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE(); RAISERROR(@ErrorMessage, 16, 1); RETURN -1; END CATCH END;

CREATE PROCEDURE dbo.sp_MultiModelEnsemble
    @QueryVector1 VECTOR(1998), -- Model 1 embedding
    @QueryVector2 VECTOR(1998), -- Model 2 embedding
    @QueryVector3 VECTOR(1998), -- Model 3 embedding
    @Model1Id INT,
    @Model2Id INT,
    @Model3Id INT,
    @Model1Weight FLOAT = 0.4,
    @Model2Weight FLOAT = 0.35,
    @Model3Weight FLOAT = 0.25,
    @TopK INT = 10,
    @TenantId INT = NULL -- Optional tenant filtering
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @ReasoningTree TABLE (
        PathId INT,
        StepNumber INT,
        BranchId INT,
        Prompt NVARCHAR(MAX),
        Response NVARCHAR(MAX),
        Score FLOAT,
        StepTime DATETIME2
    );

    IF @Debug = 1
        PRINT 'Starting multi-path reasoning with ' + CAST(@NumPaths AS NVARCHAR(10)) + ' paths';

    -- Generate multiple reasoning paths
    DECLARE @PathId INT = 1;
    WHILE @PathId <= @NumPaths
    BEGIN
        DECLARE @CurrentPrompt NVARCHAR(MAX) = @BasePrompt;
        DECLARE @StepNumber INT = 1;

        WHILE @StepNumber <= @MaxDepth
        BEGIN
            -- Generate response for this step
            DECLARE @StepResponse NVARCHAR(MAX);
            EXEC dbo.sp_GenerateText
                @prompt = @CurrentPrompt,
                @max_tokens = 80,
                @temperature = 0.9, -- Higher temperature for exploration
                @GeneratedText = @StepResponse OUTPUT;

            -- Store in reasoning tree
            INSERT INTO @ReasoningTree (PathId, StepNumber, BranchId, Prompt, Response, Score, StepTime)
            VALUES (@PathId, @StepNumber, 1, @CurrentPrompt, @StepResponse, 0.8, SYSUTCDATETIME());

            -- Prepare next step (could branch here in full implementation)
            SET @CurrentPrompt = 'Continue exploring: ' + @StepResponse;
            SET @StepNumber = @StepNumber + 1;
        END

        SET @PathId = @PathId + 1;
    END

    -- Evaluate paths (simplified scoring)
    UPDATE @ReasoningTree
    SET Score = Score + (RAND() * 0.4 - 0.2); -- Add some randomness for demonstration

    -- Find best path
    DECLARE @BestPathId INT;
    SELECT TOP 1 @BestPathId = PathId
    FROM @ReasoningTree
    GROUP BY PathId
    ORDER BY AVG(Score) DESC;

    -- Store reasoning tree
    INSERT INTO dbo.MultiPathReasoning (
        ProblemId,
        BasePrompt,
        NumPaths,
        MaxDepth,
        BestPathId,
        ReasoningTree,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @ProblemId,
        @BasePrompt,
        @NumPaths,
        @MaxDepth,
        @BestPathId,
        (SELECT * FROM @ReasoningTree FOR JSON PATH),
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return reasoning tree
    SELECT
        @ProblemId AS ProblemId,
        'multi_path' AS ReasoningType,
        @BestPathId AS BestPathId,
        PathId,
        StepNumber,
        BranchId,
        Prompt,
        Response,
        Score,
        StepTime
    FROM @ReasoningTree
    ORDER BY PathId, StepNumber;

    IF @Debug = 1
        PRINT 'Multi-path reasoning completed, best path: ' + CAST(@BestPathId AS NVARCHAR(10));
END;

CREATE PROCEDURE dbo.sp_MultiPathReasoning
    @ProblemId UNIQUEIDENTIFIER,
    @BasePrompt NVARCHAR(MAX),
    @NumPaths INT = 3,
    @MaxDepth INT = 3,
    @BranchingFactor INT = 2,
    @Debug BIT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @ComponentStream VARBINARY(MAX);

    IF @Debug = 1
        PRINT 'Starting sensor stream orchestration for ' + @SensorType + ' from ' + CAST(@TimeWindowStart AS NVARCHAR(30)) + ' to ' + CAST(@TimeWindowEnd AS NVARCHAR(30));

    -- Validate time window
    IF @TimeWindowStart >= @TimeWindowEnd
    BEGIN
        RAISERROR('TimeWindowStart must be before TimeWindowEnd', 16, 1);
        RETURN;
    END

    -- Build dynamic query for time-bucketed aggregation
    DECLARE @Query NVARCHAR(MAX) = N'
    SELECT
        ComponentStream = dbo.clr_StreamOrchestrator(AtomId, Timestamp, Weight)
    FROM (
        SELECT TOP (@MaxComponents)
            se.AtomId,
            se.Timestamp,
            se.Weight
        FROM dbo.SensorEvents se
        WHERE se.SensorType = @SensorType
        AND se.Timestamp BETWEEN @TimeWindowStart AND @TimeWindowEnd
        ORDER BY se.Timestamp
    ) AS WindowedEvents
    GROUP BY @SensorType; -- Dummy grouping for aggregate
    ';

    -- Execute the aggregation query
    DECLARE @Params NVARCHAR(MAX) = N'@SensorType NVARCHAR(100), @TimeWindowStart DATETIME2, @TimeWindowEnd DATETIME2, @MaxComponents INT';
    EXEC sp_executesql @Query, @Params,
        @SensorType = @SensorType,
        @TimeWindowStart = @TimeWindowStart,
        @TimeWindowEnd = @TimeWindowEnd,
        @MaxComponents = @MaxComponents;

    -- Note: In practice, you'd capture the result from the dynamic query
    -- For now, we'll simulate getting the ComponentStream

    -- Store orchestration result
    INSERT INTO dbo.StreamOrchestrationResults (
        SensorType,
        TimeWindowStart,
        TimeWindowEnd,
        AggregationLevel,
        ComponentStream,
        ComponentCount,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @SensorType,
        @TimeWindowStart,
        @TimeWindowEnd,
        @AggregationLevel,
        @ComponentStream,
        dbo.fn_GetComponentCount(@ComponentStream),
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return orchestration metadata
    SELECT
        @SensorType AS SensorType,
        @TimeWindowStart AS TimeWindowStart,
        @TimeWindowEnd AS TimeWindowEnd,
        @AggregationLevel AS AggregationLevel,
        dbo.fn_GetComponentCount(@ComponentStream) AS ComponentCount,
        dbo.fn_GetTimeWindow(@ComponentStream) AS TimeWindow,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()) AS DurationMs;

    IF @Debug = 1
        PRINT 'Sensor stream orchestration completed';
END;

