CREATE PROCEDURE dbo.sp_ScoreWithModel
    @ModelId INT,
    @InputAtomIds NVARCHAR(MAX), -- Comma-separated
    @OutputFormat NVARCHAR(50) = 'JSON',
    @TenantId INT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();

    IF @Debug = 1
        PRINT 'Starting self-consistency reasoning with ' + CAST(@NumSamples AS NVARCHAR(10)) + ' samples';

    -- PARADIGM-COMPLIANT: Generate samples in a table, then use CLR aggregate for consensus
    DECLARE @Samples TABLE (
        SampleId INT,
        Response NVARCHAR(MAX),
        ResponsePathVector VECTOR(1998),
        ResponseAnswerVector VECTOR(1998),
        Confidence FLOAT,
        SampleTime DATETIME2
    );

    -- Generate multiple reasoning samples
    DECLARE @SampleId INT = 1;
    WHILE @SampleId <= @NumSamples
    BEGIN
        DECLARE @SampleResponse NVARCHAR(MAX);
        DECLARE @PathEmbedding VECTOR(1998);
        DECLARE @AnswerEmbedding VECTOR(1998);
        DECLARE @EmbeddingDim INT;

        EXEC dbo.sp_GenerateText
            @prompt = @Prompt,
            @max_tokens = 150,
            @temperature = @Temperature,
            @GeneratedText = @SampleResponse OUTPUT;

        -- Get path embedding (full reasoning)
        EXEC dbo.sp_TextToEmbedding
            @text = @SampleResponse,
            @ModelName = NULL,
            @embedding = @PathEmbedding OUTPUT,
            @dimension = @EmbeddingDim OUTPUT;

        -- Extract final answer (last sentence for simplicity)
        DECLARE @FinalAnswer NVARCHAR(MAX) = REVERSE(SUBSTRING(REVERSE(@SampleResponse), 1, CHARINDEX('.', REVERSE(@SampleResponse)) - 1));

        EXEC dbo.sp_TextToEmbedding
            @text = @FinalAnswer,
            @ModelName = NULL,
            @embedding = @AnswerEmbedding OUTPUT,
            @dimension = @EmbeddingDim OUTPUT;

        INSERT INTO @Samples (SampleId, Response, ResponsePathVector, ResponseAnswerVector, Confidence, SampleTime)
        VALUES (@SampleId, @SampleResponse, @PathEmbedding, @AnswerEmbedding, 0.8, SYSUTCDATETIME());

        SET @SampleId = @SampleId + 1;
    END

    -- PARADIGM-COMPLIANT: Use CLR aggregate to find consensus
    DECLARE @ConsensusResult NVARCHAR(MAX);

    SELECT @ConsensusResult = dbo.SelfConsistency(
        CAST(ResponsePathVector AS NVARCHAR(MAX)),
        CAST(ResponseAnswerVector AS NVARCHAR(MAX)),
        Confidence
    )
    FROM @Samples;

    -- Extract consensus metrics from JSON
    DECLARE @AgreementRatio FLOAT = TRY_CAST(JSON_VALUE(@ConsensusResult, '$.agreement_ratio') AS FLOAT);
    DECLARE @NumSupportingSamples INT = TRY_CAST(JSON_VALUE(@ConsensusResult, '$.num_supporting_samples') AS INT);
    DECLARE @AvgConfidence FLOAT = TRY_CAST(JSON_VALUE(@ConsensusResult, '$.avg_confidence') AS FLOAT);

    -- Store self-consistency results
    INSERT INTO dbo.SelfConsistencyResults (
        ProblemId,
        Prompt,
        NumSamples,
        ConsensusAnswer,
        AgreementRatio,
        SampleData,
        ConsensusMetrics,
        DurationMs,
        CreatedAt
    )
    VALUES (
        @ProblemId,
        @Prompt,
        @NumSamples,
        JSON_VALUE(@ConsensusResult, '$.consensus_answer'),
        @AgreementRatio,
        (SELECT * FROM @Samples FOR JSON PATH),
        @ConsensusResult,
        DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME()),
        SYSUTCDATETIME()
    );

    -- Return results
    SELECT
        @ProblemId AS ProblemId,
        'self_consistency' AS ReasoningType,
        JSON_VALUE(@ConsensusResult, '$.consensus_answer') AS ConsensusAnswer,
        @AgreementRatio AS AgreementRatio,
        @NumSupportingSamples AS NumSupportingSamples,
        @AvgConfidence AS AvgConfidence,
        SampleId,
        Response,
        Confidence,
        SampleTime,
        @ConsensusResult AS ConsensusMetrics
    FROM @Samples
    ORDER BY SampleId;

    IF @Debug = 1
    BEGIN
        PRINT 'Self-consistency reasoning completed with agreement ratio: ' + CAST(@AgreementRatio AS NVARCHAR(10));
        PRINT 'Consensus Metrics: ' + ISNULL(@ConsensusResult, 'N/A');
    END
END;

CREATE PROCEDURE dbo.sp_SelfConsistencyReasoning
    @ProblemId UNIQUEIDENTIFIER,
    @Prompt NVARCHAR(MAX),
    @NumSamples INT = 5,
    @Temperature FLOAT = 0.8,
    @Debug BIT = 0
AS

BEGIN SET NOCOUNT ON;
PRINT 'SEMANTIC-FILTERED VECTOR SEARCH'; PRINT ' Topic filter: ' + ISNULL(@topic_filter, 'none'); PRINT ' Min topic score: ' + CAST(@min_topic_score AS VARCHAR); PRINT '';
SELECT TOP (@top_k) ae.AtomEmbeddingId, ae.AtomId, a.Modality, a.Subtype, VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_vector) AS vector_distance, sf.TopicTechnical, sf.TopicBusiness, sf.TopicScientific, sf.TopicCreative, sf.SentimentScore, sf.TemporalRelevance FROM dbo.AtomEmbeddings AS ae INNER JOIN dbo.SemanticFeatures AS sf ON sf.AtomEmbeddingId = ae.AtomEmbeddingId INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId WHERE -- V3: TENANCY MODEL (a.TenantId = @TenantId OR EXISTS (SELECT 1 FROM dbo.TenantAtoms ta WHERE ta.AtomId = a.AtomId AND ta.TenantId = @TenantId)) -- V3: EMBEDDING TYPE FILTER AND (@EmbeddingType IS NULL OR ae.EmbeddingType = @EmbeddingType) AND ae.EmbeddingVector IS NOT NULL AND (@topic_filter IS NULL OR (@topic_filter = 'technical' AND sf.TopicTechnical >= @min_topic_score) OR (@topic_filter = 'business' AND sf.TopicBusiness >= @min_topic_score) OR (@topic_filter = 'scientific' AND sf.TopicScientific >= @min_topic_score) OR (@topic_filter = 'creative' AND sf.TopicCreative >= @min_topic_score)) AND (@min_sentiment IS NULL OR sf.SentimentScore >= @min_sentiment) AND (@max_sentiment IS NULL OR sf.SentimentScore <= @max_sentiment) AND sf.TemporalRelevance >= @min_temporal_relevance ORDER BY VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_vector);
PRINT ' Semantic-filtered search complete'; END

CREATE PROCEDURE dbo.sp_SemanticFilteredSearch
    @query_vector VECTOR(1998),
    @top_k INT = 10,
    @TenantId INT, -- V3: Added for security
    @EmbeddingType NVARCHAR(50) = NULL, -- V3: Added for filtering
    @topic_filter NVARCHAR(50) = NULL,
    @min_topic_score FLOAT = 0.5,
    @min_sentiment FLOAT = NULL,
    @max_sentiment FLOAT = NULL,
    @min_temporal_relevance FLOAT = 0.0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @StartTime DATETIME2 = SYSUTCDATETIME();
    DECLARE @InferenceId BIGINT;
    DECLARE @ResultCount INT = 0;

    IF @query_embedding IS NULL
    BEGIN
        IF @query_text IS NULL
        BEGIN
            RAISERROR('Either @query_embedding or @query_text must be provided.', 16, 1);
            RETURN;
        END;

        -- Generate embedding from text using your TensorAtoms framework
        -- sp_TextToEmbedding uses sp_GenerateWithAttention and AttentionGeneration.cs CLR
        DECLARE @embedding_dimension INT;
        EXEC dbo.sp_TextToEmbedding 
            @text = @query_text,
            @ModelName = NULL,  -- Auto-select best embedding model
            @embedding = @query_embedding OUTPUT,
            @dimension = @embedding_dimension OUTPUT;

        IF @query_embedding IS NULL
        BEGIN
            RAISERROR('Failed to generate embedding from query text. Ensure models are ingested.', 16, 1);
            RETURN;
        END;
    END;

    DECLARE @input_data NVARCHAR(MAX) = CASE
        WHEN @query_text IS NULL THEN NULL
        ELSE CAST(JSON_OBJECT('queryText': @query_text) AS NVARCHAR(MAX))
    END;

    DECLARE @input_hash BINARY(32) = CASE
        WHEN @query_text IS NULL THEN NULL
        ELSE HASHBYTES('SHA2_256', CONVERT(VARBINARY(MAX), @query_text))
    END;

    DECLARE @search_method NVARCHAR(50) = CASE WHEN @use_hybrid = 1 THEN 'hybrid_spatial_vector' ELSE 'vector_only' END;
    DECLARE @models_used_json NVARCHAR(MAX) = CAST(JSON_OBJECT('searchMethod': @search_method) AS NVARCHAR(MAX));

    INSERT INTO dbo.InferenceRequests (
        TaskType,
        InputData,
        InputHash,
        ModelsUsed,
        EnsembleStrategy
    )
    VALUES (
        'semantic_search',
        @input_data,
        @input_hash,
        @models_used_json,
        'spatial_filter_vector_rerank'
    );

    SET @InferenceId = SCOPE_IDENTITY();

    DECLARE @Results TABLE
    (
        AtomEmbeddingId BIGINT NOT NULL,
        AtomId BIGINT NOT NULL,
        Modality NVARCHAR(128) NULL,
        Subtype NVARCHAR(128) NULL,
        EmbeddingType NVARCHAR(128) NULL,
        ModelId INT NULL,
        ExactDistance FLOAT NULL,
        SimilarityScore FLOAT NULL,
        SpatialDistance FLOAT NULL,
        SearchMethod NVARCHAR(50) NOT NULL
    );

    IF @use_hybrid = 1
    BEGIN
        DECLARE @spatial_x FLOAT = 0.0;
        DECLARE @spatial_y FLOAT = 0.0;
        DECLARE @spatial_z FLOAT = 0.0;
        DECLARE @spatial_candidates INT = CASE WHEN @top_k IS NULL OR @top_k <= 0 THEN 10 ELSE @top_k * 10 END;

        EXEC dbo.sp_ComputeSpatialProjection
            @input_vector = @query_embedding,
            @input_dimension = @query_dimension,
            @output_x = @spatial_x OUTPUT,
            @output_y = @spatial_y OUTPUT,
            @output_z = @spatial_z OUTPUT;

        DECLARE @Hybrid TABLE
        (
            AtomEmbeddingId BIGINT,
            AtomId BIGINT,
            Modality NVARCHAR(128),
            Subtype NVARCHAR(128),
            EmbeddingType NVARCHAR(128),
            ModelId INT,
            exact_distance FLOAT,
            spatial_distance FLOAT
        );

        INSERT INTO @Hybrid
        EXEC dbo.sp_HybridSearch
            @query_vector = @query_embedding,
            @query_dimension = @query_dimension,
            @query_spatial_x = @spatial_x,
            @query_spatial_y = @spatial_y,
            @query_spatial_z = @spatial_z,
            @spatial_candidates = @spatial_candidates,
            @final_top_k = @top_k,
            @embedding_type = @EmbeddingType,
            @TenantId = @TenantId;

        INSERT INTO @Results
        (
            AtomEmbeddingId,
            AtomId,
            Modality,
            Subtype,
            EmbeddingType,
            ModelId,
            ExactDistance,
            SimilarityScore,
            SpatialDistance,
            SearchMethod
        )
        SELECT
            h.AtomEmbeddingId,
            h.AtomId,
            h.Modality,
            h.Subtype,
            h.EmbeddingType,
            h.ModelId,
            h.exact_distance,
            CASE WHEN h.exact_distance IS NULL THEN NULL ELSE 1.0 - h.exact_distance END,
            h.spatial_distance,
            'HYBRID_SPATIAL_VECTOR'
        FROM @Hybrid AS h
        INNER JOIN dbo.Atoms AS a ON a.AtomId = h.AtomId
        WHERE @category IS NULL
           OR a.Subtype = @category;
    END
    ELSE
    BEGIN
        INSERT INTO @Results
        (
            AtomEmbeddingId,
            AtomId,
            Modality,
            Subtype,
            EmbeddingType,
            ModelId,
            ExactDistance,
            SimilarityScore,
            SpatialDistance,
            SearchMethod
        )
        SELECT TOP (@top_k)
            ae.AtomEmbeddingId,
            ae.AtomId,
            a.Modality,
            a.Subtype,
            ae.EmbeddingType,
            ae.ModelId,
            VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_embedding) AS distance,
            1.0 - VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @query_embedding) AS similarity,
            NULL,
            'VECTOR_ONLY'
        FROM dbo.AtomEmbeddings AS ae
        INNER JOIN dbo.Atoms AS a ON a.AtomId = ae.AtomId
        WHERE 
            -- V3: TENANCY MODEL
            (a.TenantId = @TenantId OR EXISTS (SELECT 1 FROM dbo.TenantAtoms ta WHERE ta.AtomId = a.AtomId AND ta.TenantId = @TenantId))
            -- V3: EMBEDDING TYPE FILTER
            AND (@EmbeddingType IS NULL OR ae.EmbeddingType = @EmbeddingType)
            AND ae.EmbeddingVector IS NOT NULL
            AND ae.Dimension = @query_dimension
            AND (@category IS NULL OR a.Subtype = @category)
        ORDER BY distance ASC;
    END;

    DECLARE @DurationMs INT = DATEDIFF(MILLISECOND, @StartTime, SYSUTCDATETIME());
    SET @ResultCount = (SELECT COUNT(*) FROM @Results);

    DECLARE @OutputMetadata NVARCHAR(MAX) = CAST(JSON_OBJECT(
        'duration_ms': @DurationMs,
        'result_count': @ResultCount,
        'search_method': @search_method
    ) AS NVARCHAR(MAX));

    UPDATE dbo.InferenceRequests
    SET
        TotalDurationMs = @DurationMs,
        OutputMetadata = @OutputMetadata,
        CacheHit = 0
    WHERE InferenceId = @InferenceId;

    SELECT
        r.AtomEmbeddingId AS AtomEmbeddingId,
        r.AtomId AS AtomId,
        r.Modality,
        r.Subtype,
        r.EmbeddingType,
        r.ModelId,
        r.ExactDistance AS CosineDistance,
        r.SimilarityScore,
        r.SpatialDistance,
        r.SearchMethod,
        @InferenceId AS InferenceId
    FROM @Results AS r
    ORDER BY r.ExactDistance;

    SELECT @InferenceId AS InferenceId, @DurationMs AS DurationMs, @ResultCount AS ResultsCount;
END;

CREATE PROCEDURE dbo.sp_SemanticSearch
    @query_text NVARCHAR(MAX) = NULL,
    @query_embedding VECTOR(1998) = NULL,
    @query_dimension INT = 768,
    @top_k INT = 5,
    @category NVARCHAR(50) = NULL,
    @use_hybrid BIT = 1,
    @TenantId INT, -- V3: Added for security
    @EmbeddingType NVARCHAR(50) = NULL -- V3: Added for filtering
AS

BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        DECLARE @SourceEmbedding VECTOR(1998);

        -- Get source embedding
        SELECT @SourceEmbedding = EmbeddingVector
        FROM dbo.AtomEmbeddings
        WHERE AtomId = @SourceAtomId AND TenantId = @TenantId;

        IF @SourceEmbedding IS NULL
        BEGIN
            RAISERROR('Source atom has no embedding vector', 16, 1);
            RETURN -1;
        END

        -- Find similar atoms using vector cosine similarity
        SELECT TOP (@TopK)
            ae.AtomId AS SimilarAtomId,
            (1.0 - VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @SourceEmbedding)) * 100.0 AS SimilarityScore,
            a.ContentHash,
            a.ContentType,
            a.CreatedAt
        FROM dbo.AtomEmbeddings ae
        INNER JOIN dbo.Atoms a ON ae.AtomId = a.AtomId AND ae.TenantId = a.TenantId
        WHERE ae.TenantId = @TenantId
              AND ae.AtomId != @SourceAtomId
              AND ae.EmbeddingVector IS NOT NULL

        ORDER BY VECTOR_DISTANCE('cosine', ae.EmbeddingVector, @SourceEmbedding) ASC;

        RETURN 0;
    END TRY
    BEGIN CATCH
        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        RAISERROR(@ErrorMessage, 16, 1);
        RETURN -1;
    END CATCH
END;

-- Auto-split from dbo.FullTextSearch.sql
-- Object: PROCEDURE dbo.sp_SemanticSimilarity

CREATE PROCEDURE dbo.sp_SemanticSimilarity
    @SourceAtomId BIGINT,
    @TopK INT = 10,
    @TenantId INT = 0
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @context_centroid GEOMETRY;
    DECLARE @atom_count INT;

    SELECT
        @context_centroid = ContextCentroid,
        @atom_count = AtomCount
    FROM dbo.fn_GetContextCentroid(@context_atom_ids);

    IF @context_centroid IS NULL OR @atom_count IS NULL OR @atom_count = 0
    BEGIN
        RAISERROR('No valid context atoms found', 16, 1);
        RETURN;
    END;

    DECLARE @resolved_top_k INT = CASE WHEN @top_k IS NULL OR @top_k <= 0 THEN 3 ELSE @top_k END;
    DECLARE @candidate_pool INT = @resolved_top_k * 4;

    DECLARE @candidates TABLE
    (
        AtomId BIGINT,
        AtomText NVARCHAR(100),
        SpatialDistance FLOAT,
        Logit FLOAT,
        ProbabilityScore FLOAT
    );

    INSERT INTO @candidates (AtomId, AtomText, SpatialDistance, Logit, ProbabilityScore)
    SELECT TOP (@resolved_top_k)
        ae.AtomId,
                CONVERT(NVARCHAR(256), a.AtomicValue) AS token, -- Derived from AtomicValue
        nn.SpatialDistance,
        -1.0 * nn.SpatialDistance AS Logit,
        0.0
    FROM dbo.fn_SpatialKNN(@context_centroid, @candidate_pool, N'AtomEmbeddings') AS nn
    INNER JOIN dbo.AtomEmbeddings ae ON ae.AtomEmbeddingId = nn.AtomEmbeddingId
    INNER JOIN dbo.Atoms a ON a.AtomId = ae.AtomId
    WHERE ae.AtomId NOT IN (SELECT CAST(value AS BIGINT) FROM STRING_SPLIT(@context_atom_ids, ','))
    ORDER BY nn.SpatialDistance ASC;

    IF NOT EXISTS (SELECT 1 FROM @candidates)
    BEGIN
        RETURN;
    END;

    DECLARE @maxLogit FLOAT = (SELECT MAX(Logit) FROM @candidates);
    DECLARE @temperatureSafe FLOAT = CASE WHEN @temperature IS NULL OR @temperature <= 0 THEN 1.0 ELSE @temperature END;

    UPDATE c
    SET ProbabilityScore = dbo.fn_SoftmaxTemperature(Logit, @maxLogit, @temperatureSafe)
    FROM @candidates AS c;

    DECLARE @totalWeight FLOAT = (SELECT SUM(ProbabilityScore) FROM @candidates);

    SELECT
        AtomId AS TokenId,
        AtomText AS TokenText,
        SpatialDistance,
        CASE
            WHEN @totalWeight IS NULL OR @totalWeight = 0 THEN 0
            ELSE ProbabilityScore / @totalWeight
        END AS ProbabilityScore
    FROM @candidates
    ORDER BY ProbabilityScore DESC, SpatialDistance ASC;
END;

